INSERT INTO `seasons` VALUES (1,'Сериал #Dетки онлайн','Главная героиня Лина ведёт модный и весьма популярный блог, в котором рассказывает о психологии подростков. Она очень известна в узких кругах любителей этой тематики. Кажется, что успех буквально преследует её везде, к чему бы не притрагивалась главная героиня. С другой стороны сюжета оказывается девчонка по имени Кира, у которой всё идёт наперекосяк: её раздражает школа, а постоянные проблемы в общении с одноклассниками заставляют девушку уходить глубоко в сеть, а порой даже взламывать чужие аккаунты. Правда, вскоре главных героинь, причем обеих, ожидает неожиданная встреча со странным типом - маньяком, который действует онлайн. И Кира и Лина заинтересованы в том, чтобы выследить негодяя. Им предстоит объединить усилия, чтобы понять, кому выгодно убивать подростков, готовясь к нападению по интернету. Чем обернётся этот пугающий и запутанный триллер?',1,1,'http://seasonvar.ru/serial-23627-Detki.html','http://cdn.bigsv.ru/oblojka/23627.jpg'),(2,'Сериал #СвободуРэйшону/#Freerayshawn онлайн','Рэйшон долгое время провел на территории Ирака, но в итоге вернулся на родину в Новый Орлеан после ужасных событий, произошедших с ним в чужой стране. Правда, дома жизнь не заладилась. Здесь мужчина оказывается вовлечен в войну преступных группировок, связанную с наркобизнесом. Персонаж не собирается мириться с этой ситуацией, поэтому  решает бороться с теми, кто пытается поставить его перед судом за происходящее вокруг. Он баррикадируется у себя дома и отбивается от наступающих представителей власти. Выйти на переговоры с Рэйшоном пытается представитель полиции Стивен Пойнси, который уговаривает \"загнанного зверя\" пойти на мир и сдаться.',1,2,'http://seasonvar.ru/serial-25526-SvoboduRejshonu.html','http://cdn.bigsv.ru/oblojka/25526.jpg'),(3,'Сериал #СеняФедя  1 сезон онлайн','Проект \"#СеняФедя\" - это новый спин-офф телесериала \"Кухня\". В центре внимания сюжета оказываются старые знакомые Сеня и Федя, которые решили открыть собственное дело. Теперь парни занимаются продвижением закусочной на колесах. Кто бы мог подумать, что с первого же дня у героев начнутся серьезные проблемы. Отношения не ладятся, а бизнес близок к закрытию из-за постоянных проблем. Однако персонажей объединяет совместный кредит, который не дает им разбежаться. В суматохе безумной работы и постоянной напряженности молодые люди сами не замечают того, как меняются. Ради работы семейный Сеня готов попробовать на вкус холостяцкую жизнь, а некогда гулёна Федор уже мечтает о тихом и спокойном семейном кругу. Смогут ли персонажи найти то, что ищут? Смогут ли они наладить бизнес? Справятся ли герои с возрастающей конкуренцией? Остается только верить в их успех! Приятного просмотра!',1,3,'http://seasonvar.ru/serial-20616-SenyaFedya-0-season.html','http://cdn.bigsv.ru/oblojka/20616.jpg'),(4,'Сериал #СеняФедя  2 сезон онлайн','В центре внимания сюжета отечественного сериала оказываются два знакомых зрителям персонажа. Сеня и  Федя продолжают стремиться к кулинарным вершинам: теперь у них свой бизнес! Главные герои владеют закусочной на колёсах, где готовят безумно вкусные блюда. Правда, персонажи ожидали, что смогут справиться с многочисленными проблемами организационного дела, однако их дела не ладятся с первого же дня. Увы, но закрыть дело вряд ли удастся, несмотря на обоюдное желание главных героев. Совместный кредит как ничто другое умудрился объединить молодых людей вместе. Приходится терпеть присутствие на рабочем месте друг друга и бороться за любой вырученный рубль. Конечно же, молодым людям крайне непросто сражаться с более именитыми конкурентами, которые ускакали далеко вперед в вопросах организации деятельности, однако вкуснота, которую предлагают персонажи, явно лучше, чем то, что можно найти в классических гастрономах. Параллельно с работой главные герои продолжат испытывать судьбу в личной жизни: у кого-то всё перевернётся с ног на голову и типичная семейная жизнь постепенно перерастёт в безумную холостяцкую, как у Сени, а Федя, который всегда любил гулять, окажется вынужден стать примерным семьянином.',2,3,'http://seasonvar.ru/serial-22255-SenyaFedya-2-season.html','http://cdn.bigsv.ru/oblojka/22255.jpg'),(5,'Сериал #СеняФедя  3 сезон онлайн','С третьим сезоном возвращается полюбившийся спин-офф популярного проекта \"Кухня\". Проект рассказывает о старых друзьях Сене и Феде, которые прошли большой путь вместе, а теперь решили организовать своеобразную закусочную на колёсах. Мобильный ресторан оказывается очень сложным делом, ведь главным персонажам приходится действительно очень стараться, чтобы успевать готовить и обслуживать своих посетителей. Главные действующие лица этого проекта с первого же рабочего дня не смогли наладить друг с другом отношения. Они столкнулись с многочисленными проблемами и разными взглядами на ведением бизнеса. Парни стараются отыскать компромисс, ведь некоторые решения все же нужно принять. Правда, не  только на работе, но и в личной жизни приходится многое менять и примерять на себя новые амплуа. Так, некогда семейный человек Сеня наслаждается холостяцкой жизнью, а Федя, некогда бывший бабник, теперь - примерный семьянин!',3,3,'http://seasonvar.ru/serial-23698-SenyaFedya-3-season.html','http://cdn.bigsv.ru/oblojka/23698.jpg'),(6,'Сериал #СеняФедя  4 сезон онлайн','Новый четвертый сезон увлекательного комедийного проекта, одного из многих ответвлений от оригинальной сюжетной линии \"Кухни\". Картина \"СеняФедя\" - это рассказ о совместном бизнесе, который ведут два приятеля. Они основали закусочную на колесах, которая работает на радость посетителям в разных уголках города. Конечно же, персонажам приходится не только просчитывать каждый свой ход, но и не конфликтовать, если это, конечно же, возможно. Они кажутся не такими уж и серьезными конкурентами для настоящих акул бизнеса, но даже в таком положении молодые люди всегда оптимистичны и верят в свои силы. Что же будет дальше? В профессиональную  жизнь Сени и Феди нередко вмешивается жизнь личная, которая привносит свои, порой даже не самые приятные особенности. Авторы сценария этого сериала демонстрирует нам множество забавных и увлекательных событий, ведь после оригинальной \"Кухни\" все для них круто изменилось. Так Сеня, который всегда был примерным семьянином, теперь пытается свыкнуться с амплуа холостяка, когда некогда бабник Федя пытается найти свою тихую семейную гавань. Четвертый сезон продолжит эту увлекательную историю. Приятного просмотра.',4,3,'http://seasonvar.ru/serial-26956-SenyaFedya-04-sezon.html','http://cdn.bigsv.ru/oblojka/26956.jpg'),(7,'Сериал #Хэштег любви/Love #Hashtag онлайн','Сериал предлагает зрителям погрузиться в историю взаимоотношений между людьми в наше непростое и захватывающее время, когда верх в жизни берут высокие технологии. Проект предлагает погрузиться в рассказ о нескольких молодых людях, которые строят свои отношения не только в реальном мире, но и посредством сети интернет, где делятся своими чувствами, эмоциями и впечатлениями друг о друге. Конечно же, эти проявления смогла найти самые разные воплощения, в том числе и в невербальной форме. Речь идет о лайках, хэштегах и прочих интересных знаках, которые могут так или иначе выразить истинное отношение человека к тому или иному событию...',1,4,'http://seasonvar.ru/serial-29906-Heshteg_lyubvi.html','http://cdn.bigsv.ru/oblojka/29906.jpg'),(8,'Сериал #Яжотец онлайн','В свои сорок четыре года главный персонаж истории Михаил вряд ли может похвастаться выдающимися успехами. Главный персонаж не преуспел практически ни в чем. Он проживает в квартире, которая принадлежит его жене. Женщина оказывается настоящей хозяйкой, которая тащит за собой всю семью. Единственное, что у Миши есть - видеоблог, который тот активно ведет вместе со своим сыном Степой. Там действующие лица распаковывают игрушки и проводят обзоры новинок. Однажды во время записи очередного видео главный персонаж Михаил узнает печальную новость: у его супруги есть другой мужчина, с которым та уже давно встречается. Миша решает развестись с женой и стать так называемым воскресным папой, при этом продолжая снимать блог вместе с сыном. Однако теперь это не обзор игрушек, а обучающее и воспитательное видео, на котором главный персонаж рассказывает своему сыну о своей жизни и передает ему бесценный опыт. Конечно же, его, как такого, нет, однако рассказы Михаила оказываются очень интересными.',1,5,'http://seasonvar.ru/serial-31014-YAzhotetc.html','http://cdn.bigsv.ru/oblojka/31014.jpg'),(9,'Сериал (не)Пара/Mismatched онлайн','Порой отношения способны приобретать самые неожиданные очертания. Так, например, главные действующие лица этого сериала совершенно не похожи друг на друга. Они такие разные, что, кажется, им никогда не быть вместе. Действующие персонажи действительно порой стараются найти друг в друге хоть что-то, что действительно позволит им полюбить по-настоящему. Однако любой сторонний наблюдатель способен сделать вывод: \"Да они вообще друг другу не подходят\". Зрителям же предстоит погрузиться в историю отношений между романтичным парнем Риши и его возлюбленной Димпл, увлеченной техникой!',1,6,'http://seasonvar.ru/serial-28031-nePara.html','http://cdn.bigsv.ru/oblojka/28031.jpg'),(10,'Сериал +100500 онлайн','Не стоит ничего изобретать, а особенно в шоу-бизнесе. Эту простую истину взял да и открыл для себя Макс Голополосов, руководитель русскоязычного шоу «+100500». Он не стал подобно Kamikadzedead надрываться, чтобы стать уникальным. Кому это нужно? Если можно просто взять и скопировать готовое, и желательно иностранное. Максим, недолго думая «слизал», всё что можно, и чего нельзя, у своего зарубежного «брата по цеху» Рея Уильяма Джонсона, назвав себя при этом почему-то Адамом Томасом Мораном. То есть, полностью войдя в образ иностранца. Но и его образец не является творцом, или даже первооткрывателем. Он просто мелькает перед камерой со скоростью веника, жутко матерясь, делая при этом вид, что он комментатор сетевых роликов.',1,7,'http://seasonvar.ru/serial-5051-100500.html','http://cdn.bigsv.ru/oblojka/5051.jpg'),(11,'Сериал +100500 на ТВ онлайн','Макс Голополосов теперь на телевидении со своим мегапопулярным шоу +100500! Находчивый парень показывает нам самые интересные и смешные видео из интернета и весело комментирует увиденное.  Каждый новый выпуск в шоу появляются свежие видеоролики со всего веб-пространства! Макс не стесняется жестко стебать то, что происходит в кадре, а герои подобных видео нередко становятся народными любимцами и звездами интернета. Да и море типичных фразочек пошли именно из этого шоу. Чего уж там вспоминать, само название +100500 стало крылатым выражением в народе для разъяснения количества чего-либо) В общем, если вы вечером устали, придя с работы, то именно это шоу поднимет вам настроение и боевой дух! Приятного просмотра, уважаемые зрители!',1,8,'http://seasonvar.ru/serial-3398--100500TV.html','http://cdn.bigsv.ru/oblojka/3398.jpg'),(12,'Сериал .#Sтуденты онлайн','Это удивительный юмористический скетч ком, который расскажет нам жизнь учащихся в вузах. Все самое яркое из жизни студентов, все самое смешное и комичное. Как и во всех университетах, мы здесь найдём  девушку – красавицу, в которую влюблён весь курс. А так же алчного ректора, парней помешенных на компьютерных играх, взбалмошные и отрешённые компании девчонок со своими не понятным ни кому интересами, самодовольных и уверенных себе старшекурсников и стеснительных «перваков». Все скетчи объединены непринуждённым абсурдным молодёжным юмором, чем и привлекает так своего зрителя.',1,9,'http://seasonvar.ru/serial-9692-Studenty2014.html','http://cdn.bigsv.ru/oblojka/9692.jpg'),(13,'Сериал ...И в бедности/Broke онлайн','Главные действующие лица этого сериала жили в счастливом браке. Они любили друг друга и никогда ни в чем не нуждались, ведь всегда чувствовали поддержку от своих близких. Больше всего главным персонажам помогал богатый отец, который давал море денег на различные расходы своим родственникам. Правда, не так давно эта поддержка прекратилась, из-за чего действующим лицам теперь приходится думать о том, как выживать дальше. Главным персонажам приходится переехать на  временное место к сестре жены. Джеки - интересная женщина. Она - мать-одиночка, которая всегда старается помочь своим детям стать лучше. Появление родственников сказывается на жизни под крышей её дома.',1,10,'http://seasonvar.ru/serial-25567-I_v_bednosti_pslwesv.html','http://cdn.bigsv.ru/oblojka/25567.jpg'),(14,'Сериал .хак Знак/.hack Sign онлайн','Совсем скоро в мировую паутину запустят всемирно долгожданную ролевую игру под названием «The World» или просто «Мир». Ее сюжет развивается около «Цукасы», которая, по неизвестным никому причинам, оказалась в нашем мире и не может вернуться  домой. Мир с появлением «Цукасы» начал мгновенно изменяться. Множество загадочных происшествий и непонятных вещей периодически нарушают баланс в существовании планеты. И только игрокам подвластно изменить исход судьбы человечества и разгадать загадки «Цукасы».',1,11,'http://seasonvar.ru/serial-4922-hakZNAK.html','http://cdn.bigsv.ru/oblojka/4922.jpg'),(15,'Сериал .хак Квант/.hack Quantum онлайн','2020 год. Улучшенная и обновленная версия «Мира »R:X. Три персонажа - Мэри, Тобиас и Сакуя, встретившись, решают отправиться на поиски приключений. Прослеживается аналогия между персонажами и известными игроками Чёрной розой \"BlackRose\", Кайтом \"Kite\", и Балмунгом \"Balmung\".',1,12,'http://seasonvar.ru/serial-5371-hak_Kvant.html','http://cdn.bigsv.ru/oblojka/5371.jpg'),(16,'Сериал .хак Корни/.hack Roots онлайн','“The World” в 2015 году потерпел крушение, и был уничтожен огромным пожаром, который случился в информационном центре SS Corporation. Но год спустя SS Corporation восстановила игру «Мир Р-2». Главный игрок – Хасео, пытается избежать гибели. У него нет особых целей, он просто хочет выжить, но все принимает совсем другие краски, когда Хасео встретится с Ованом, который расскажет не только о судьбе игрока, но и о его скрытых талантах, которыми предстоит овладеть.',1,13,'http://seasonvar.ru/serial-4923-hakKorni.html','http://cdn.bigsv.ru/oblojka/4923.jpg'),(17,'Сериал .хак Легенда сумеречного браслета/.hack Tasogare no udewa densetsu онлайн','«The World» - это онлайновая игра, можно сказать эпицентр всего сериала. Прошло довольно-таки много лет, около четырех, после инцидента под название «Twilight», который обескуражил весь мир, причем как on-line, так и мир в реальности. Огромная компания CyberConnect, прародитель «The World», создала для играющих новую компанию «Limited Edition Character». «Black Rose» и «Kite» - это главные и всем известные игровые персонажи, которые и стали наградами за первые места. \n\r\nСюго и Рэна - брат и сестра, они учатся в старшей школе. Они то и смогли пройти всю компанию и занять первые места. Сюго не хотел больше принимать участия в игре, но он не смог устоять от уговоров Рэна. И ему пришлось снова принять участие в легендарной игре «The World».',1,14,'http://seasonvar.ru/serial-4584--hakLegenda_sumerechnogo_brasleta.html','http://cdn.bigsv.ru/oblojka/4584.jpg'),(18,'Сериал .хак Лиминалити/.hack Liminality онлайн','Несмотря на то, что действие фильма Люминалити происходит после 2010 года, футуристическим назвать его сложно, из-за отсутствия каких-либо тематических декораций. Скорее, это детектив с весьма запутанным сюжетом. В 2005 году, глобальная катастрофа в обличии вируса «Поцелуй Плутона», всемирный Интернет на 77 минут отключается. Весь мир в панике, связи нет, планета погружена в хаос. Не без усилий удается предотвратить самопроизвольный запуск автоматической системы ПРО США. На несколько лет мир замирает, но в 2007 году появляется на свет новейшая система с колоссальным уровнем защиты ОС «ALTIMIT». В связи с этим, отличие мира будущего от нашего с вами минимально. \n\r\nГлавные действующие лица Люминалити - четыре человека совершенно разной возрастной категории - расследуют загадочные и пугающие случаи, связанные с новой модной игрой МИР. Корпорация СиСи, являющаяся создателем печально известной игрый, старается держаться в тени и не комментирует происходящее. В одной только Японии шесть человек являвшихся игроками, были поражены неизвестным недугом и впали в кому.\n\r\nТем временем, в одном из Японских городов Нагасаке происходит весьма странная авария. Кроме всего, наши герои сталкиваются с хакером Херуба, которая пытается окончательно их запутать. СиСи же умалчивает об этих случаях и «делает» вид, что ничего не происходит.',1,15,'http://seasonvar.ru/serial-5322-hak_Liminaliti.html','http://cdn.bigsv.ru/oblojka/5322.jpg'),(19,'Сериал 1/7 жизни/1/7 of Life онлайн','Добро пожаловать на просмотр нового сериала, который является своеобразным циклом из семи увлекательных историй новой игры, которая обещает стать очень увлекательной и затягивающей. События в жанре фантастики знакомят нас с уникальными персонажами, каждый из которых представляет собой целую историю, полотно, которое разворачивается перед изумленными зрителями. Мы погружаемся в рассказ об отношениях, чувствах, в рассказ с обсуждением темы красоты, развития, мудрости, разных временных периодов, стремления к мечте и многих-многих других тем, которые так или иначе сопутствуют по жизни каждому человеку. Но какие они получают проявления в новом мире, незнакомом нам? Мире, где есть место для фантастических событий и проявления сверхъестественного. Он так похож на наш, но все же немного иной.',1,16,'http://seasonvar.ru/serial-26970-17_zhizni.html','http://cdn.bigsv.ru/oblojka/26970.jpg'),(20,'Сериал 10 причин моей ненависти/10 Things I Hate About You  1 сезон онлайн','Беззаботная жизнь сестричек Бианки и Кэти претерпевает серьёзное изменение – девчонки вынуждены по ряду причин перейти в новый колледж. Здесь новичкам предстоит заново завоёвывать популярность среди одноклассников, и добиваться популярности.\r\nКрасоткам Стрэтфорд по началу приходится совсем не легко в уже устоявшемся мире учеников и учителей колледжа, в котором свои звёзды, свои лузеры, свои устои и понятия. Да к тому же местная лидерша спортивной группы поддержки, капризная и эгоцентричная «королева школы» - та ещё девица. Мало им проблем, так ещё на горизонте появляется хулиган и бунтарь Патрик с таинственным взглядом и пафосной надменностью, в которого, конечно же, влюблены все девчонки школы.',1,17,'http://seasonvar.ru/serial-965--10_prichin_moej_nenavisti-1-season.html','http://cdn.bigsv.ru/oblojka/965.jpg'),(21,'Сериал 10 секретов/10 Secrets онлайн','Сериал концентрирует своё внимание на Сиракаве Кэйте, инспекторе, работающем на стройке. Главный персонаж пытается концетрироваться на работе, совмещая её с семейными делами. Несмотря на то что главный герой развелся с женой, он по-прежнему заботится о своей четырнадцатилетней дочери, которая нуждается в поддержке родителей в столь непростое время. Бывшая супруга изредка навещает дочку, потому что тоже много работает - она исполняет обязанности корпоративного юриста в крупной компании. Однажды главный герой примет странный звонок от неизвестного абонента. Незнакомец скажет, что его дочь у него, а, чтобы её спасти, Сиракава должен отправиться к своей бывшей супруге. Что же скрывает женщина? Как оказалось, она ещё при совместной жизни с героем утаивала от него многое, что могло бы перевернуть жизнь Кэйте. Теперь же Кэйте предстоит разгадать тайны прошлого, чтобы понять, где находится его дочка.',1,18,'http://seasonvar.ru/serial-25289-10_sekretov.html','http://cdn.bigsv.ru/oblojka/25289.jpg'),(22,'Сериал 10 Секунд до победы/10 Segundos para Vencer онлайн','Эдер Жофре - человек, чье имя вписано в десятку лучших бойцов всех времен и народов. Конечно же, его появление в этом списке делает мужчине честь, ведь добиться таких высот - значит громко заявить о себе и оказаться на вершине спортивного Олимпа. Главный герой стремился преодолевать все препятствия, что доводилось встречать на своем пути. Каждый новый бой - это новая жизнь, новая история, которая начиналась еще задолго до выхода на ринг. Главный герой начинал подготовку к бою и чувствовал, что впереди его ждёт самая сложная схватка - сражение с самим собой в подготовительном процессе. Этот сериал рассказывает о самых важных поворотах в карьере главного героя, начиная от первых успехах, желании уйти из спорта на пике, а также о возвращении  в бокс после продолжительной паузы. Зрителям предстоит окунуться в незабываемую атмосферу с историей, посвященной одному из лучших боксеров всех времен.',1,19,'http://seasonvar.ru/serial-27474-10_Sekund_do_pobedy.html','http://cdn.bigsv.ru/oblojka/27474.jpg'),(23,'Сериал 10 сценариев конца света: Последние дни человечества/10 Ways to End the World онлайн','Уникальный исследовательский проект, который расскажет зрителям о десяти вероятных исходах глобальных катастроф, которые способны привести к вымиранию всего живого (ну или почти) на планете Земля. В центре внимания этой программы оказывается научное исследование, которое проводилось учеными со всего мира. Десять сценариев конца света  - это пусть и маловероятные, но все же возможные сценарии, которые могут ожидать человечество, если наступит конец света. Что именно может произойти? Что станет причиной глобального вымирания? Сможет ли человек как-то противостоять надвигающейся угрозе? На эти многочисленные вопросы постарается дать ответ исследовательский сериал \"Последние дни человечества\".',1,20,'http://seasonvar.ru/serial-18076-10_stcenariev_kontca_sveta_Poslednie_dni_chelovechestva.html','http://cdn.bigsv.ru/oblojka/18076.jpg'),(24,'Сериал 100 Вопросов/100 Questions  1 сезон онлайн','Героиня американского комедийного сериала – Шарлотта Пейн, как и многие молодые девушки, мечтает найти свою настоящую любовь. Когда ее поиски единственного и неповторимого заканчиваются неудачей, она решает обратиться за помощью в службу знакомств. Однако сотрудник агентства, вместо того, чтобы представить девушке портфолио кандидатов для знакомства, предлагает ей сначала ответить на 100 вопросов, что помогут ей разобраться в себе и в том, какой спутник жизни ей необходим.\r\nКаждый эпизод – это попытка Шарлотты, при помощи лучших друзей, найти ответ на один из вопросов, что приводит к довольно неожиданным результатам. Так героиня внезапно осознает, что мужчина её мечты больше похож на мужчину из ее кошмаров.',1,21,'http://seasonvar.ru/serial-1093--100_Voprosov-1-season.html','http://cdn.bigsv.ru/oblojka/1093.jpg'),(25,'Сериал 100 миль в неизвестность/100 Miles from Nowhere онлайн','Путешествия волнуют и воодушевляют всех людей. Даже известные личности и, в том числе, спортсмены обожают ездить по миру и смотреть на достопримечательности, общаться с людьми и чувствовать особенности жизни где-либо. Мэтт Галланд - известный атлет, который организует путешествия за границу, берет с собой в путь лучших приятелей, среди которых Блейк Джозефсон и Дэнни Брайсон. Эта троица исколесила почти весь мир, но впереди еще так много земель, где стоит побывать! В дороге главные герои сталкиваются с рядом непростых испытаний: это и жара, и холод, и голод, и желание поскорее встать на ночлег и как следует отдохнуть!',1,22,'http://seasonvar.ru/serial-16144-100_mil__v_neizvestnost_.html','http://cdn.bigsv.ru/oblojka/16144.jpg'),(26,'Сериал 100 подвигов Эдди Макдауда/100 Deeds for Eddie McDowd  1 сезон онлайн','Удивительный фантастический сериал в комедийной манере рассказывает о подростке, который стал собакой. Невероятно, но лишь пару дней назад Эдди Маклауд слыл грозой всей округи, его боялись не только дети и домашние животные, но даже взрослые. Хулиган мучил всех, кто попадался ему на пути. Но злодеяниям парня должен был прийти конец. \n\r\nНеожиданно на его пути встретился настоящий колдун, явившийся к парню в образе бродяги. В качестве наказания колдун превратил Эдди Макдауда в настоящего пса. \n\r\nДля того чтобы снять страшное проклятие, Эдди Макдауду необходимо совершить сто хороших поступков. Речь Эдди понимают лишь те люди, кого он когда-то обидел, и остальные псы. Наступает тяжелый период в жизни Эдди: он встал на путь исправления. \n\r\nВ каждом новом эпизоде Эдди, пытаясь совершить как можно больше добрых дел, оказывается в самых смешных и абсурдных ситуациях. Без хорошего друга Эдди Макдауду никогда бы не удалось совершить добрые дела, поэтому ему вызвался помогать Джастин – стеснительный парень, который тоже пострадал от проделок хулигана. Судьба наконец-то дарует шанс проблемному подростку стать добрым человеком и завести друзей.',1,23,'http://seasonvar.ru/serial-2969--100_podvigov_Eddi_Makdauda-1-season.html','http://cdn.bigsv.ru/oblojka/2969.jpg'),(27,'Сериал 100 подвигов Эдди Макдауда/100 Deeds for Eddie McDowd  2 сезон онлайн','Удивительная история о том, как одного хулигана за его проделки превратили в собаку. Эдди Макдауд – настоящая гроза в своей округе, его боятся не только школьники младших классов, но даже их родители и домашние животные. \n\r\nЭтот семнадцатилетний мальчишка буквально терроризировал всех несчастных, кто попадался ему на пути. Однако Эдди заплатил высокую цену за свои хулиганства. Как-то раз он встретил самого настоящего волшебника в образе бродяги, который превратил Эдди Макдауда в обычного пса! А вернуться в свой человеческий облик Эдди сможет лишь тогда, когда совершит ни много ни мало сто добрых поступков. \n\r\nОднако понять, что говорит теперь Эдди, могут только другие собаки и люди, которых он ранее обидел. Вот теперь для него настали тяжелые времена: в каждой новой серии Эдди в облике собаки попадает в самые нелепые и веселые ситуации. \n\r\nПо иронии судьбы помочь Эдди стать обычным мальчиком помогает стеснительный подросток Джастин, которому раньше доставалось больше всех от несносного хулигана. Так у трудного подростка Эдди Макдауда появляется настоящий друг и возможность стать добрым человеком.',2,23,'http://seasonvar.ru/serial-3029--100_podvigov_Eddi_Makdauda-2-season.html','http://cdn.bigsv.ru/oblojka/3029.jpg'),(28,'Сериал 100 подвигов Эдди Макдауда/100 Deeds for Eddie McDowd  3 сезон онлайн','Сериал со сказочным сюжетом представляет собой историю про то, как мальчишка Эдди МакДауд за свои многочисленные проделки и плохие поступки чарами обиженного доброго волшебника был превращен в собаку. Однако чародей оставил ему шанс снова стать прежним…\r\nЧтобы разрушить магические чары и обрести свою былую внешность, парню нужно всего-то совершить сто добрых поступков. Однако в собачьей шкуре сделать это для него будет весьма непросто. Да и речь его понятна теперь только собакам, да тем, кого он когда-то обидел.\r\nНашего героя ждет масса курьезных ситуаций, в которые он попадает, пытаясь вернуть себе человеческий облик. И никто не хочет ему помогать, кроме Джастина – того, кто больше всех натерпелся от Эдди, когда еще тот был человеком.',3,23,'http://seasonvar.ru/serial-3047--100_podvigov_Eddi_Makdauda-3-season.html','http://cdn.bigsv.ru/oblojka/3047.jpg'),(29,'Сериал 100 тысяч минут вместе/100 000 хвилин разом онлайн','Главные действующие лица этого сериала уже семь лет в браке. Они кажутся счастливыми, однако кажется, что между персонажами уже нет той страсти и искренних чувств, что были раньше. Главный герой работает пилотом и немало времени проводит на работе. Его супруга устроилась в качестве фитнесс-тренера в один из местных залов. Персонажи все реже и реже видятся друг с другом, что сказывается на отношениях. Однако неожиданно в их историю любви вмешивается пандемия. Главные персонажи вынуждены на два месяца закрыться вместе в доме, не выходя на работу. Это может ударить по их карьере, зато неожиданным образом скажется на взаимоотношениях, которые неожиданно наконец-то обретут верный вектор развития после долгого застоя.',1,24,'http://seasonvar.ru/serial-28827-100_tysyach_minut_vmeste_psugwqe.html','http://cdn.bigsv.ru/oblojka/28827.jpg'),(30,'Сериал 100 шагов: Успеть до старших классов/100 Things to Do Before High School онлайн','Если вы неожиданно встретите Си-Джей Мартин, то поймёте, что перед вами простая девчонка. А когда узнаете её получше, то узнаете, что она ещё и ни о чём сверхъестественном не мечтает. Она обучается в младших классах своей школы и хочет поскорее вырасти, чтобы наконец-то самостоятельно решать свои проблемы и заниматься важными делами. Правда, брат старается каким-либо образом отговорить сестру от быстрого взросления, утверждая, что старшие классы школы - это то ещё безумие, которые создаст из жизни девушки настоящий хаос. К тому же Си-Джей очень хочет продолжить обучение вместе со своими друзьями Фенвиком и Криспо, а переход в старшие классы может поменять их местами с другими учениками. Конечно же, рано или поздно старшие классы наступают. Главная героиня отлично подготовилась после уроков и многочисленных дней в средней школе. К тому же девушка составила целый список из ста дел, которые необходимо сделать, чтобы стать наиболее успешным старшеклассником. Конечно же, впереди у неё немало забавных и прикольных приключений, которые так или иначе запомнятся главной героине и сгенерируют немало комичных и смешных ситуаций. К тому же Си-Джей ожидают новые встречи и интересные знакомства. В будущем окажется, что старшая школе не такая уж и страшная, если к ней хорошо подготовиться.',1,25,'http://seasonvar.ru/serial-22904-100_shagov_Uspet__do_starshih_klassov-0-season.html','http://cdn.bigsv.ru/oblojka/22904.jpg'),(31,'Сериал 1000 мест, которые стоит посетить/1000 Places to See Before You Die онлайн','В основу данного проекта лег известный бестселлер писательницы Патриции Шульц, который рассказывает о самых известных и загадочных мест на Земле, которые следует посетить каждому любознательному человеку. Дикая флора и фауна, экзотическая этнография, древнейшие тайны и устои. Различные исторические памятники, впечатляющие постройки, туризм и различные забавы – все это вы увидите, если присоединитесь к просмотру этой увлекательнейшей киноленты. В общем,если вы хотите побывать там, где еще никогда раньше не были, то добро пожаловать за просмотр этого сериала! Спасибо за внимание!',1,26,'http://seasonvar.ru/serial-6842-1000_mest_kotorye_stoit_posetit.html','http://cdn.bigsv.ru/oblojka/6842.jpg'),(32,'Сериал 1001 онлайн','Достаточно интересную картину нам подарила Россия.  Сочетания волшебства и реальности на этот раз действительно удалось. Картина нам повествует о двух мирах. Один эта наша реальность, двадцать первый век. Где жизнь идет своим чередом, где нужно работать и терпеть унижения. Второй мир это волшебный мир, где есть и красивые дворца и люди в красивых одеждах, где есть свои гаремы и красивая музыка. И эти два мира отделяются друг от друга огромными воротами, ключ к которым не у каждого есть.',1,27,'http://seasonvar.ru/serial-9471-1001.html','http://cdn.bigsv.ru/oblojka/9471.jpg'),(33,'Сериал 100ЯНОВ онлайн','Народный артист Юрий Стоянов представляет вниманию зрителей авторское шоу, которое создано в лучших традициях популярного в прошлом проекта \"Городок\". Перед вами интереснейший сборник юмористических постановок, где сочетается как абсурдный, так и тонкий остроумный юмор. Автор предстаёт перед зрителями в различных образах, которые высмеиваются или высмеивают что-либо. Если вы были большим поклонником \"Городка\", то обязательно оцените новый юмористический сериал \"100ЯНОВ\". Заряд хорошего настроения и прекрасное расположение духа обеспечено. Отличный юмор и прекрасная актёрская игра - главные отличительные черты нового шоу.',1,28,'http://seasonvar.ru/serial-26038-100YANOV.html','http://cdn.bigsv.ru/oblojka/26038.jpg'),(34,'Сериал 101-ое предложение/The 101st Proposal онлайн','Главным героем сериала «101-ое предложение» является Даль Чже, славный и робкий мужчина, которого нельзя назвать симпатичным юношей. Главный герой Даль Чже самый невезучий человек, ведь, помимо всего, он ещё и остался без работы. Он хочет найти себе девушку и сыграть свадьбу. Герой уже сто раз пробовал завести отношения, но у него ничего не получалось. Но однажды его жизнь перевернулась.\r\nПока за столиком наш герой ожидал свою новую девушку. Совершенно случайно к нему подсела другая девушка, красота котороя поразила Даль Чже. Он сразу же влюбляется в эту красотку. Эта незваная гостья оказалась племянницей той женщины, к которой обращался главный герой для поиска своей второй половинки.\r\nДевушка по имени Хан Су Чжон пару лет назад пережила смерть своего возлюбленного, поэтому, чтобы ей было не так тяжело, она помогает сиротам. Получится ли у нашего героя влюбить в себя Хан Су Чжон? Превратится ли Даль Чже из неудачника в успешного человека?',1,29,'http://seasonvar.ru/serial-12116-101-oe_predlozhenie.html','http://cdn.bigsv.ru/oblojka/12116.jpg'),(35,'Сериал 103 онлайн','Сериал рассказывает о людях, которые изо дня в день спасают жизни казахстанцев. Главные действующие лица этой истории, при всем при этом, очень остроумный и юморные ребята, которые не дадут заскучать. Их искрометные шутки способны поднять настроение даже в самых сложных ситуациях. Конечно же, у каждого персонажа свои мечты, свои желания, проблемы и трудности, с которыми порой приходится мириться, но в то же время с ними можно бороться совместными усилиями. Единство на работе - это главный факт успеха, который обязательно поможет. Новая комедия - это прекрасная возможность в очередной раз погрузиться в медицинскую тематику, но уже в комедийном жанре.',1,30,'http://seasonvar.ru/serial-28995-103.html','http://cdn.bigsv.ru/oblojka/28995.jpg'),(36,'Сериал 1066/1066: The Battle for Middle Earth онлайн','Эта история о трех совершенно разных народностях – викингах, нормандцев и англичан.  Многие слышали о достаточно темном пятне в британской истории – Нормандском завоевании.  Но народ знал лишь одну сторону  завоевания, которая была подана со слов самого британского короля. Теперь же нам известно мнение и тех, кто сражался -  воинов, простых сельских жителей.',1,31,'http://seasonvar.ru/serial-11754-1066.html','http://cdn.bigsv.ru/oblojka/11754.jpg'),(37,'Сериал 11 глаз/11 eyes онлайн','Какэру Сацуки не знал своих родителей. Он вырос в приюте вместе с сестрой, но к десяти годам остался один. Единственный близкий человек покончил с собой, пошатнув веру в лучшее главного персонажа, который тоже задумался об уходе из жизни. Печального исхода было бы не избежать, если не поддержка со стороны Юки, доброй девочки, чья жизнь сложилась так же печально. Пройдёт семь лет. Юка попадёт в приёмную семью Минасэ, где будет счастлива, когда её друг Какэру продолжит жить один. Он смог попасть в школу, где теперь обучается вместе с подругой детства. Между главными героями по-прежнему тёплые отношения, однако Юка всё ещё остаётся единственным человеком, с которым Какэру продолжает общаться. Наладить контакт с последним пытается Тадаси, местный комик и просто весёлый парень.Кажется, к нелюдимому Какэру неравнодушна Каори, милая девушка, разглядевшая в главном герое большое и доброе сердце. Вскоре главные действующие лица станут свидетелями Красной Ночи. Это событие - кошмар наяву, властелинами которого являются Чёрные Рыцари. Единственный способ спастись - победить хозяев Ночи. Шесть школьников, стоящих перед могущественным злом, принимают вызов судьбы.',1,32,'http://seasonvar.ru/serial-24497-11_glaz.html','http://cdn.bigsv.ru/oblojka/24497.jpg'),(38,'Сериал 11 марта: чтобы никто не забыл/11-M, para que nadie lo olvide онлайн','Сериал основан на реальных событиях, рассказывающих о крупных террористических атаках, пронесшихся по территории Испании одиннадцатого марта две тысячи четвертого года. Эти события стали настоящим шоком для жителей крупной европейской страны. В четырех поездах на вокзале Аточа у станций Санта Еухения и Эль Посо Дель Тио Раймундо произошли взрывы. По подсчетам представителей охраны правопорядка сработало порядка порядка тринадцати взрывных устройств. В итоге, как утверждает статистика, во время взрыва погибли более сотни человек, а еще порядка тысячи были серьезно ранены.',1,33,'http://seasonvar.ru/serial-27017-11_marta_chtoby_nikto_ne_zabyl.html','http://cdn.bigsv.ru/oblojka/27017.jpg'),(39,'Сериал 11/22/63/11.22.63  1 сезон онлайн','В одном богом забытом кафе у старого джентльмена Эла хранится таинственный шкаф, о котором он никому не рассказывает. Однако вскоре к нему в гости заходит один знакомый, работающий учителем английского языка. Мужчина в годах раскрывает ему тайну этого шкафа-кладовки! Оказывается дверь ведет в прошлое! В силу возраста, сам владелец кафе не может путешествовать во времени, но знает, как исполнить свою давнюю мечту. Он уговаривает учителя Джейка зайти в кладовку! Тот, перейдя через порог, оказывается в прошлом. Перед Джейком теперь только одна задача - спасти от смерти президента Кеннеди.',1,34,'http://seasonvar.ru/serial-13185-112263-1-sezon.html','http://cdn.bigsv.ru/oblojka/13185.jpg'),(40,'Сериал 12 знаков/Zodiak - Der Horoskop-Mörder онлайн','Наверное, все семьи скрывают какие-либо тайны. Этих тайн становится больше, если семья богата. Внебрачная дочь возвращается в свою родную семью к отцу, который празднует день рождения. Именно отсюда и начинается повествование этой драматической истории. Странные события начинают происходит параллельно с появлением девушки. Загадочным образом приближенные главного героя погибают. Череда загадочных смертей заставляет жителей задуматься над прошлым. Невозможно понять, кто убивает ни в чем неповинных людей. Вскоре становится понятно,что погибают люди разных знаков Зодиака. Двенадцать знаков, знания астрологии и умение разбираться в людях - вот ключ к разгадке.',1,35,'http://seasonvar.ru/serial-13908-12_znakov.html','http://cdn.bigsv.ru/oblojka/13908.jpg'),(41,'Сериал 12 лет: Биение маленького сердца/12-sai.: Chicchana Mune no Tokimeki  1 сезон онлайн','Главная героиня сериала ходит в шестой класс. Ей всего двенадцать лет. Девчонка решила рассказать о себе и об этом возрасте, ведь он по-настоящему уникален и интересен. Главная героиня отдаёт себе отчёт в том, что именно этот период жизни становится для неё переходным. Она уже не чувствует себя ребёнком, но в то же время ещё не может назвать себя взрослой. Каждый день Ханаби ожидают новые открытия, неожиданные встречи, откровенные разговоры, которые так или иначе расставят точки над i во многих вопросах, которые ранее казались неясными и размытыми. Что же будет дальше? В двенадцать лет, как оказалось, жизнь только начинается.',1,36,'http://seasonvar.ru/serial-25638-12_let_Bienie_malen_kogo_serdtca_psjwdly.html','http://cdn.bigsv.ru/oblojka/25638.jpg'),(42,'Сериал 12 лет: Биение маленького сердца/12-sai.: Chicchana Mune no Tokimeki  2 сезон онлайн','В двенадцать лет наступает переходный период, который открывает перед людьми тайны подростковой жизни. Главная героиня аниме - милая шестиклассница Ханаби, которая только-только познает особенности этого мира. Девчонка пока не может понять, что с ней происходит: она уже не  чувствует себя ребёнком, но, в то же время, взрослым назвать себя тоже не может. Что же делать дальше? Как объяснить происходящие вокруг амурные истории? То удаётся поймать за поцелуем своего классного руководителя, то приходится столкнуться с многочисленными трудностями в общении с представителями противоположного пола, когда, кажется, в сердце зародилась первая любовь.',2,36,'http://seasonvar.ru/serial-25639-12_let_Bienie_malen_kogo_serdtca_pspqsev-2-season.html','http://cdn.bigsv.ru/oblojka/25639.jpg'),(43,'Сериал 12 ночей/12 Nights онлайн','Главные действующие лица этого сериала обожают путешествовать. Кажется, что они готовы провести в поездках всю свою жизнь, однако, как показывает практика, всё не так просто в этом мире. Главные действующие персонажи заняты различными делами. Работа, учёба и многое другое - все это, конечно же, отнимает время и возможность куда-нибудь рвануть. Конечно же, молодые люди найдут возможность вырваться. Причем авторы сценария предлагают зрителям погрузиться в их приключения в трёх разных временных периодах. Главные действующие лица этого проекта уверены, что именно в таких поездках они становятся по-настоящему свободными. Сюжет переносит зрителей сначала в две тысячи десятый год. Здесь произойдёт судьбоносное событие в жизни персонажей. О нём вы узнаете в самом сериале. В две тысячи пятнадцатом между героями опять возникнут важные выяснения отношений во время путешествий. Конечной же остановкой станет две тысячи восемнадцатый год, который решит многие вопросы, касающиеся главных персонажей и их чувств друг к другу. Эта потрясающая история, рассказывающая о двенадцати ночах в дороге воодушевит зрители и преисполнит их романтикой. Приятного просмотра.',1,37,'http://seasonvar.ru/serial-24054-12_nochej.html','http://cdn.bigsv.ru/oblojka/24054.jpg'),(44,'Сериал 12 обезьян/12 Monkeys  1 сезон онлайн','Многосерийный фильм, снятый по мотиву  оригинала одна тысяча девятьсот девяносто пятого  года. Коул - уголовник из будущего времени, после апокалипса. Он осужден за вызывающие, резкие и бесстрашные действия  и несоблюдение закона. Опасным вирусом было  уничтожено практически  все человечество, а тем, кто выжил, пришлось скрыться  в недрах  земли. Ученым уже удалось изобрести способы  перемещения во временных интервалах, и Коул послужил «подопытным кроликом». Ему доверена ответственная и важная миссия – получить  для исследования  данный вирус из прошедшего времени,  за что  он будет прощен и о его  поведении забудут...',1,38,'http://seasonvar.ru/serial-11142-12_obez_yan_pspjerl-0001-sezon.html','http://cdn.bigsv.ru/oblojka/11142.jpg'),(45,'Сериал 12 обезьян/12 Monkeys  2 сезон онлайн','Представляем вашему вниманию новый сезон фантастического сериала \"12 обезьян\". Проект был создан по мотивам одноименного фильма 1995 года. В центре внимания - уголовник Коул, который прибыл из постапокалиптического мира. Он был осужден в свое время за неподчинение властям, а теперь сослан в прошлое, чтобы предотвратить катастрофу, из-за которой неизвестный вирус уничтожил большую часть населения земли. Те, кто смог пережить влияние смертоносного вещества, укрылись под землей. Ученые все же смогли спастись. Они времени зря не теряли - изобрели машину времени и решили испробовать ее на одном из правонарушителей. Коул обязан раздобыть образцы вируса из прошлого, чтобы тот не смог распространиться по всему миру!',2,38,'http://seasonvar.ru/serial-13407-12_obez_yan_psvgplo-002-sezon.html','http://cdn.bigsv.ru/oblojka/13407.jpg'),(46,'Сериал 12 обезьян/12 Monkeys  3 сезон онлайн','Представляем вам новый фантастический сериал, который рассказывает нам о событиях, изменивших мир. Проект снят по мотивам фильма, выпущенного в девяносто пятом году прошлого столетия. Земля уже не та, какой мы ее знаем. Постапокалиптический мир заставляет человечество искать новые способы выживания. Коул - главный герой сериала. Он - уголовник, которого судят за то, что тот просто отказался подчиниться новоиспеченным властям. Но с чего же все началось? Мир начал меняться, когда неизвестный вирус захватил всю планету. Он уничтожал людей одного за другим. Однако некоторым удалось все же выжить. Спасение было найдено под Землей. Как раз кстати было изобретено средство для путешествия во времени. Коул же стал одним из тех, кто первым испытал на себе работу этого прибора. Он должен достать вирус в прошлом, чтобы наконец-то остановить тот ужас, творящийся в мире.',3,38,'http://seasonvar.ru/serial-15449-12_obez_yan_pslahzd-03-sezon.html','http://cdn.bigsv.ru/oblojka/15449.jpg'),(47,'Сериал 12 обезьян/12 Monkeys  4 сезон онлайн','Коул отбывает наказание за совершение преступления против власти. Его осудили за неподчинение действующему режиму. Правда, терять мужчине нечего - мир уже разрушен, а остатки человечества, выжившие после апокалипсиса, ждут свой час под землей. Страшный вирус уничтожил практически все живое на планете. Однако у ученых есть идея, как все исправить. Они уже изобрели машину для путешествия во времени, а испытать ее предстоит как раз на Коуле, который должен будет отправиться в прошлое, чтобы найти образцы смертоносного вируса и сделать все возможное, чтобы не позволить миру погибнуть в очередной раз.',4,38,'http://seasonvar.ru/serial-18750-12_obez_yan_psbmifg-00004-sezon.html','http://cdn.bigsv.ru/oblojka/18750.jpg'),(48,'Сериал 12 рождественских поваров/12 Chefs of Christmas with Jeni Barnet онлайн','Если вы не знаете, что приготовить на Новый Год или Рождество, то обязательно посмотрите этот кулинарный проект. Вам представлены двенадцать выдающихся шеф-поваров, каждый из которых представит свои рецепты и уникальные угощения, которые обязательно украсят ваш стол. Джени Барнетт ведет это шоу и поддержит доброжелательную и праздничную атмосферу. В этом проекте вы увидите как привычные для всех простых людей блюда, так и необычные вкусняшки, без которых, конечно же, ваш стол не будет выглядеть интересным и оригинальным. Так что запасайтесь временем и изучайте лучшие рецепты для лучших зимних праздников! Приятного просмотра, уважаемые зрители и любители кулинарии!',1,39,'http://seasonvar.ru/serial-17667-12_rozhdestvenskih_povarov.html','http://cdn.bigsv.ru/oblojka/17667.jpg'),(49,'Сериал 12 смертельных дней/12 Deadly Days онлайн','Перед вами проект, представляющий интересное сочетание жанров. Комедийный хоррор \"12 смертельных дней\" предлагает зрителям окунуться в двенадцать потрясающих эпизодов, рассказывающих об ужасных событиях, произошедших с людьми прямо перед рождественскими праздниками. Место действия - штат Калифорния. Безымянный город живет обычной жизнью, но за этой обыденностью скрывается что-то пугающее и странное. То ли вампиры решили устроить пиршество, то ли ожившие ели пугают простых прохожих, то ли злой Санта забирается в трубу дома не для того, чтобы подарить подарок. Кто знает, какая еще здесь творится чертовщина...',1,40,'http://seasonvar.ru/serial-19457-12_smertel_nyh_dnej-0-season.html','http://cdn.bigsv.ru/oblojka/19457.jpg'),(50,'Сериал 12 стульев (1971) онлайн','Когда после революции к власти перешли коммунисты, наступило тяжело время, многие, чтобы не лишиться сбережений, драгоценностей, часто переходящих по наследству и представляющих огромную ценность, причем не только материальную, были вынуждены прятать их в укромные места. Люди старались скрыть свое дворянское происхождение, дабы жестоко не поплатиться за принадлежность к высшему сословию. Главный герой дворянин Ипполит Матвеевич был известен в светских кругах, но после революции он стал работать в ЗАГСе, скромно перебирая бумажки, и стараясь ничем не выделяться от основной массы простолюдин. Перед самой смертью теща рассказала ему о спрятанных драгоценностях, которые оценивались в сто пятьдесят золотых рублей. Схоронила предприимчивая женщина их под обивку стула гостиного гарнитура знаменитейшего мастера Гамбса. Гарнитур состоит из двенадцати стульев. И только под обивкой одного покоятся жемчуга и бриллианты тещи Ипполита Матвеевича. Конечно же, нельзя оставлять такие богатства, мало ли в чьи руки они попадут, Ипполит Матвеевич намерен разыскать драгоценности, но вот беда – стулья из гарнитура давно уже распроданы, раздарены, и находятся у разных людей. Помочь ему вызывался искатель приключений Остап Бендер. Вместе эти двое готовы пойти на все, чтобы заполучить обратно сокровища…даже на женитьбу!',1,41,'http://seasonvar.ru/serial-7470-12_stul_ev_1971.html','http://cdn.bigsv.ru/oblojka/7470.jpg'),(51,'Сериал 12 стульев (1976) онлайн','Главный герой картины – Ипполит Воробьянинов - живёт своей жизнью, работает в ЗАГСе на должности делопроизводителя. К власти только что пришли коммунисты, время неспокойное, поэтому Ипполит Петрович старается вести себя тихо и не привлекать к себе лишнего внимания. \r\nВскоре и героя умирает тёща. И перед смертью она сообщает ему, что в один из двенадцати стульев мастера по фамилии Гамбс, которыми когда-то владела её семья, она собственноручно зашила драгоценности. \r\nСпокойной жизни И. Воробьянинова с этого момента пришёл конец. Теперь секрет, который доверила ему тёща, не даёт ему покоя. Он решает, во что бы то ни стало, отыскать тот самый стул, где лежат драгоценности. Но только вот задача это не простая, так как гарнитур из дюжины стульев давно разрознен, и каждый стул придётся искать отдельно. \r\nНо, как оказалось, не только своему зятю доверила секрет тёща. О стуле, полном драгоценностей, знают мошенник Остап Бендер и священник. О. Бендер предлагает И. Воробьяниному действовать сообща, чтобы было проще найти сокровища. Взамен он просит процент от найденных сокровищ.',1,42,'http://seasonvar.ru/serial-7471-12_stul_ev_1976.html','http://cdn.bigsv.ru/oblojka/7471.jpg'),(52,'Сериал 12 стульев (2005) онлайн','История, написанная Ильфом и Петровым, не дает покоя многим кинематографистам. По ней снимают фильмы, ставят спектакли, и популярности «Двенадцать стульев» не теряют и по сей день. Это классика, прочно угнездившаяся в сознании наших соотечественников. В  2005 году был снят телевизионный мюзикл по этому замечательному произведению. Однако современная история несколько отличается от оригинала, хотя бы тем, что в качестве героев мюзикла присутствуют и сами авторы – И. Ильф и Е. Петров. Ипполит Матвеевич узнал от умирающей тещи, что некогда она спрятала сокровища в один из стульев гостиного гарнитура, сделанного мастером Гамбсом. Стулья уже давно разрознены, но в одном из них зашиты жемчуга и бриллианты, Ипполиту Матвеевичу не дает покоя мысль, что такие богатства могут попасть в чужие руки. Он намерен отыскать стулья и вернуть драгоценности. Но в одиночку не так и просто справиться с этой задачей. Ему посчастливилось найти помощника – «Великого комбинатора», а попросту афериста Остапа Бендера. Вместе они занимаются поисками стульев, их ждут незабываемые приключения…',1,43,'http://seasonvar.ru/serial-7472-12_stul_ev_2005.html','http://cdn.bigsv.ru/oblojka/7472.jpg'),(53,'Сериал 12 часов онлайн','Новая криминальная драма \"12 часов\"  рассказывает зрителям историю одного из оперативников. Главный персонаж, которого многие знают по прозвищу Сава, на самом деле, Юрий Савостьянов. Он шёл на очередную встречу со своим осведомителем в небольшое кафе, однако мужчине всегда казалось, что обстановка крайне напряжённая. Опасения подтвердились, ведь неизвестный киллер скрывался за личиной простой уборщицы этого заведения. Правда, тот собирался убить Савостьянова, однако не смог, оставив на главном герое только лёгкие раны. Правда, вскоре Сава понял, что лучше бы погиб этим ужасным днём, ведь, оставшись в живых, он потерял в перестрелке и осведомителя и любимую девушку, на которой мечтал жениться. Это стало для главного персонажа настоящим ударом, поэтому мужчина принял волевое решение - вернуться к делам как можно скорее, чтобы раз и навсегда разделаться с преступным миром. Главный персонаж не оставляет попыток отыскать того самого наёмного убийцу, ввязываясь всё в новые и новые операции, устраиваемые организацией УУР. Впереди его ждёт очередная миссия, которая неожиданно даст персонажу новую информацию о человеке, разрушившем его жизнь. Неожиданно расследование громкого заказного убийства позволяет Саве найти связь между перестрелкой годичной давности.',1,44,'http://seasonvar.ru/serial-22382-12_chasov-0-season.html','http://cdn.bigsv.ru/oblojka/22382.jpg'),(54,'Сериал 13 дней вдали от солнца/Treze Dias Longe do Sol онлайн','Саулу мечтает о том, чтобы построить медицинский центр. Правда, руководство его компании считает, что это здание слишком дорогое, а дохода принесет крайне мало. В итоге было принято решение сэкономить на строительстве, закупив дешевые материалы, однако эта тонкость останется в секрете. Привлечение неквалифицированной рабочей силы - еще один пункт плана руководителей, о котором Саулу даже не догадывается. В итоге стройка оканчивается трагедией, в которой обвиняют главного персонажа, так как он выступил инициатором начала работы. Самому же Саулу, а также его возлюбленной Марион и нескольким людям удаётся выжить, несмотря на то что разрушения оказались губительными для остальных. Однако они оказываются в ловушке, отрезанные от внешнего мира горой бетона и арматуры. Теперь группе выживших предстоит объединиться, чтобы отыскать путь наружу. На поверхности помимо попыток спасти попавших в беду находятся и те, кто пытается разобраться, что же пошло не так. Разворачивается расследование, в ходе которого на Саулу находят компромат, конечно же, подстроенный высшим руководством.',1,45,'http://seasonvar.ru/serial-28043-13_dnej_vdali_ot_solntca.html','http://cdn.bigsv.ru/oblojka/28043.jpg'),(55,'Сериал 13 заповедей/13 Geboden онлайн','В центре внимания сюжета проекта оказывается печальная и пугающая история. Серия преступлений прогремела на огромный мегаполис. Несколько ритуальных убийств было совершено неизвестным преступником, который явно вдохновлялся десятью заповедями. Следствие пришло к выводу, что маньяк возомнил себя кем-то вроде мессии, а теперь начал совершать преступления, приводя общественность в ужас и заставляя ту содрогаться при первом упоминании моральных ценностей, которые пытается отстаивать убийца. В центре внимания сюжета оказывается Вики, молодой полицейский, который вместе со своим более опытным коллегой Петером берется за это непростое дело. Петер уже давно подумывает о том, чтобы уйти в отставку и спокойно отдыхать на пенсии. Правда, пока что этого сделать не удастся, ведь на свободе разгуливает сумасшедший маньяк, который продолжает совершать ритуальные преступления. Каждый раз его преступления становятся все более и более безумными, а шансов отыскать негодяя все меньше и меньше, ведь тот старается не совершать ошибок.',1,46,'http://seasonvar.ru/serial-20951-Trinadtcat__zapovedej-0-season.html','http://cdn.bigsv.ru/oblojka/20951.jpg'),(56,'Сериал 13 знаков зодиака онлайн','Звезды были созданы, чтобы раскрыть человеку тайны его жизни. Нужно лишь научиться воспринимать «звездные послания». Тогда и жизнь твоя может кардинальным образом поменяться. Звезды знают судьбу каждого человека еще до его рождения. Человек не в праве, он просто не может менять то, что предначертано судьбой. Современные люди частенько верят в гороскопы, которые, как они надеются, откроют им глаза на их судьбу и предназначение. Некоторые люди не признают тех фактов, которые рассказывают про нас зодиакальный знак. Есть ли здесь загадка? Во-первых, один гороскоп не может подходить для всех представителей определенного знака зодиака. Настоящий человеческий гороскоп на самом деле очень сложен, и зависит от нескольких десятков факторов, которые оставляют отпечатки на наших судьбах и характерах – вот почему все люди настолько отличаются друг от друга. \n\r\nНо, следует учитывать, что, несмотря на всю сложность и разнообразные узоры, которые рисуют звезды в момент нашего появления на свет, все же есть нечто общее у всех представителей одного зодиакального знака. Об этом и многом другом поведает Василиса Володина – астролог с многолетним опытом работы. Сейчас Василиса работает экспертом в программе «13 знаков зодиака». Сейчас существование человечества и его судьба определены 12-ю знаками зодиака. \n\r\nНе так давно человечество узнало про Змееносца. Созвездие Змееносца становится все ярче с каждым годом, а значит, этот знак зодиака становится с каждым разом все сильнее… Остается только гадать, признают ли астрологи Змееносца новым зодиакальным знаком?',1,47,'http://seasonvar.ru/serial-6638-13_znakov_zodiaka.html','http://cdn.bigsv.ru/oblojka/6638.jpg'),(57,'Сериал 13 привидений Скуби-Ду/The 13 Ghosts of Scooby-Doo онлайн','Все мы знаем про веселого и забавного пса Скуби-Ду, который вместе со своими друзьями путешествует по миру в поисках чего-то веселого и прикольного, но постоянно натыкаются на преступников, переодетых в костюм призраков, чудовищ, монстров и прочего. Однако сейчас у главных героев очень важное задание. Вместе с Шегги, Дафной и Скеппи отважный Скуби-ду постарается помочь колдуну Винсенту,  а также мальчику по имени Флифлам. Эти персонажи пытаются поймать тринадцать беглых приведений. Их место в особом сундуке демонов. Вне его эти существа могут натворить дел! Скубби-Ду и его компания с радостью поможет в поимке.',1,48,'http://seasonvar.ru/serial-15542-13_prividenij_Skubi-Du--0-season.html','http://cdn.bigsv.ru/oblojka/15542.jpg'),(58,'Сериал 13 причин, почему/Thirteen Reasons Why  1 сезон онлайн','Главный герой этого сериала - Клей Дженсен. Молодой человек спокойно живет в своем доме, никого не трогает и пытается вести спокойный образ жизни. Кто бы мог подумать, что неожиданно ему кто-то подбросит к двери странную коробку, где будут лежать аудиокассеты, некогда записанной Ханной Бейкер. Некогда Клей был влюблен в эту девушку, когда еще учился в школе. Однако сейчас их пути разошлись, а парень ничего не знал о Ханне. Правда, теперь ему стало известно, что девушка покончила жизнь самоубийством. Кто бы мог подумать, что у нее на это было тринадцать причин, о которых она рассказала в этих записях. Главная причина - Клей.',1,49,'http://seasonvar.ru/serial-15300-13_prichin_pochemu-0-season.html','http://cdn.bigsv.ru/oblojka/15300.jpg'),(59,'Сериал 13 причин, почему/Thirteen Reasons Why  2 сезон онлайн','Ханна Бейкер покончила жизнь самоубийством, оставив после себя немало пищи для размышления как следователям, так и близким людям. Главная героиня никому не сказала о своем желании покинуть этот мир. Однако вскоре молодой человек Клей Дженсен нашел у порога своего дома странную коробку, в которой были кассеты, записанные печально погибшей Ханной. Клей всегда был влюблен в свою знакомую, но никогда не мог  найти в себе силы завоевать сердце красавицы. В своих аудиозаписях Ханна рассказывает о том, что причиной ее самоубийства стали многие причины. Их всего тринадцать, однако главная из них - Клей.',2,49,'http://seasonvar.ru/serial-18654-13_prichin_pochemu-02-sezon.html','http://cdn.bigsv.ru/oblojka/18654.jpg'),(60,'Сериал 13 причин, почему/Thirteen Reasons Why  3 сезон онлайн','С третьем сезоном на экраны возвращается сериал \"Тринадцать причин, почему\". Авторы сценария предлагают нам невероятную драматическую историю, которая развернулась в небольшой школе, затронув несколько учеников. Центральными фигурами оказались Клей Дженсен и Ханна Бейкер. Первый был влюблён в свою одноклассницу и пытался сделать всё возможное, чтобы добиться её внимания. Конечно же, безуспешно. Сама же Ханна неожиданным образом ушла из жизни, совершив самоубийство. Это стало настоящим шоком для всех вокруг. В том числе и для Клея, который неожиданно после печальных событий обнаруживает у дома загадочную коробку с аудиозаписями, где и скрывается вся правда о смерти главной героини. На тринадцати кассетах она рассказывает о каждой из причин, которая заставила её уйти из жизни. На удивление главного персонажа, одной из этих причин оказывается он сам. Что же будет дальше? Третий сезон продолжает эту интереснейшую историю. Главные персонажи сериала близки к сдаче экзаменов...',3,49,'http://seasonvar.ru/serial-22962-13_prichin_pochemu-3-season.html','http://cdn.bigsv.ru/oblojka/22962.jpg'),(61,'Сериал 13 причин, почему/Thirteen Reasons Why  4 сезон онлайн','Сериал \"13 причин, почему\" - это безумная и напряжённая история о простом парне Клее Дженсене, который оказывается в эпицентре безумных событий, связанных с гибелью его знакомой Ханны Бейкер. На самом же деле, молодой человек был когда-то безумно влюблен в девушку, однако та не отвечала ему взаимностью. Теперь Ханны нет. Она совершила самоубийство, оставив после себя только кассету с записями, которые и попали в руки Клея. Молодой человек обнаруживает эту коробку близ своего дома. Прослушивание записей открывает тайны прошлого Ханны. Она описывает тринадцать причин, из-за которых решилась на самоубийство. Одной из главных является Дженсен.',4,49,'http://seasonvar.ru/serial-25873-13_prichin_pochemu-4-season.html','http://cdn.bigsv.ru/oblojka/25873.jpg'),(62,'Сериал 13-ое ноября: нападение на Париж/November 13: Attack on Paris онлайн','Проект предлагает зрителям пообщаться с людьми, которые пережили ужасные события в середине ноября в Париже. Теракты датированы тринадцатым числом две тысячи пятнадцатого года. В документальном сериале очевидцы и участники, оставшиеся в живых после террористической атаки, поведают свои истории  о том, как непросто приходилось выживать в условиях смертельной опасности и нечеловеческой напряженности. Только по-настоящему храбрые и отважные люди могли позволить себе думать о спасении и о безопасности остальных попавших в беду людей. Нам же остается лишь стать свидетелями и слушателями их рассказа.',1,50,'http://seasonvar.ru/serial-19603-13-oe_noyabrya_napadenie_na_Parizh.html','http://cdn.bigsv.ru/oblojka/19603.jpg'),(63,'Сериал 15 дней/15 Days онлайн','Проект является остросюжетным триллером с элементами детектива. Смерть молодого человека становится шоком для всех его близких людей. Правда, становится ясно, что руку на парня поднял кто-то из близких, причем тот, на кого можно меньше всего подумать. Сюжет не раскрывает тайну убийства, поэтому под подозрение попадают абсолютно все представители семейства. Главные действующие лица этого сериала сталкиваются с самыми невероятными событиями, связанными с отношениями и прошлым главного персонажа. Что же на самом деле произошло в роковой и злополучный момент? Узнаем совсем скоро.',1,51,'http://seasonvar.ru/serial-26253-15_dnej.html','http://cdn.bigsv.ru/oblojka/26253.jpg'),(64,'Сериал 17 онлайн','В центре внимания сюжета оказывается парнишка семнадцати лет. Главный герой по имени Абди стоит перед серьёзным жизненным выбором. Молодой человек, как и многие другие ребята в его возрасте, должен поступить так, как велит ему сердце. С одной стороны, перед ним перспективы: он может закончить школу и отправиться в большой мир, полный возможностей и перспектив. Главный герой может работать над собой, однако другая сторона манит не меньше. Абди уверен, что пойти по стопам всех своих сверстников - это не самая плохая идея. Конечно же, персонажу приходится непросто, ведь криминальный мир, к которому так привыкли местные жители, становится чуть ли не главным источником дохода в этих землях. Семнадцатилетнему Абди предстоит сделать судьбоносный выбор. Его близкие давно мечтали избавиться от криминального гнёта, однако теперь парень стоит на распутье: либо он заканчивает школу и отправляется в свободное путешествие, либо он становится частью этого злополучного и жестокого криминального мира.',1,52,'http://seasonvar.ru/serial-21432-17.html','http://cdn.bigsv.ru/oblojka/21432.jpg'),(65,'Сериал 17+ онлайн','Культовый ,модный сериал о новом поколении. Его герои ребята, только окончившие среднюю школу. Они ищут своё место в жизни, свой жизненный путь.\r\nКогда смотришь его тебе кажется, что эти события реально происходили рядом в твоей жизни. В фильме рассказывается о новых неформальных течениях среди нынешней молодежи такие, как готы, эму, маргиналы...Про малолетних девчонках, которые уже стали мамами, хотя по сути сами ещё дети.\r\nРазвлечения, ночные клубы, секс, наркотики - это всё увлечения нынешних молодых людей...',1,53,'http://seasonvar.ru/serial-9816-17.html','http://cdn.bigsv.ru/oblojka/9816.jpg'),(66,'Сериал 17-й участок/17 precinct онлайн','Поклонники долго этого ждали и очень огорчились, когда пилот о полицейских, использующих вместо оружия волшебные диски, а вместо судмедэкспертизы – заклинания, так и не вышел на экраны. Однако теперь этот недочет исправлен, и все желающие могут насладиться этим сериалом в стиле фэнтези, созданным Рональдом Д.Муром. \n\r\nАктерский состав просто невероятен, он во многом состоит из актеров «Звездного Крейсера Галактика» и «Каприки», таких как Джимми Бамбер, Тришия Хэлфер, Джеймс Каллис, Эсай Моралес. Отличный подарок для поклонников стиля фэнтези.',1,54,'http://seasonvar.ru/serial-5887-17-j_uchastok.html','http://cdn.bigsv.ru/oblojka/5887.jpg'),(67,'Сериал 1790 год/Anno 1790 онлайн','Шокирующие своей бедностью трущобы располагаются рядом с шикарными дворцами, аристократки ходят по тем же улицам, что и шлюхи, богатые торговцы пересекаются с нищими – вот это и есть настоящий Стокгольм XVIII века. Йохан Доод, врач королевского флота возвращается в город из самого пекла русско-шведской войны. Мужчина планирует немного отдохнуть и возвратиться обратно в армию, но его планы нарушает внезапная смерть полицейского комиссара. Все вокруг уверенны, что это несчастный случай, ведь по внешним признакам представитель правопорядка скончался от сердечного приступа, но Доода не проведешь, врач сразу определяет, что смерть была насильственной и представляет неопровержимые доказательства своей теории.\r\nВальштедт, шеф стокгольмской полиции впечатлен смышленостью, незаурядным умом и твердостью характера Йохана, поэтому он предлагает ему место окружного комиссара. Доод принимает предложение, тем самым нажив себе врага в лице Нордина, начальника тюрьмы, имевшего виды на эту должность. Врачу, перевоплотившемуся в сыщика, приходится с риском для жизни расследовать загадочные преступления, мотивы которых не поражают своей новизной – это ревность, политика, жадность, месть, зависть.',1,55,'http://seasonvar.ru/serial-9191-1790_god.html','http://cdn.bigsv.ru/oblojka/9191.jpg'),(68,'Сериал 18 колес правосудия/18 Wheels of Justice  1 сезон онлайн','Майклу Кейтсу, сотруднику министерства юстиции было поручено задание проникнуть под псевдонимом в группировку Джейкоба Колдера. Но после того как Кейтс узнает, что ее девушку убил Джейкоб, он начинает двойную охоту. Жена и дочь Кейтса погибают. Кейтс после этого еще раз меняет имя и при поддержке своего босса Бёртона Хендерсти, теперь его зовут Ченс Боуман, он работает водителем-дальнобойщиком, ищет людей, которые могут хоть что-то знать про Джейкоба Колдера.',1,56,'http://seasonvar.ru/serial-2178--18_koles_pravosudiya-1-season.html','http://cdn.bigsv.ru/oblojka/2178.jpg'),(69,'Сериал 18 колес правосудия/18 Wheels of Justice  2 сезон онлайн','Главный герой Майкл работает агентом под прикрытием. Его очередное задание – внедрение в опасную банду. Но операция проходит не совсем успешно и бывшую девушку героя убивают. План сорван и Майкла раскрывают. Вдобавок ко всему вспомнилась старая трагедия с семьей героя, в результате которой он потерял своего сына и жену. Теперь его характер кардинально изменился: он стал жестким и бескомпромиссным. \r\nМайкл кидает вызов банде и начинает охотиться за их главарём. Сменив полностью имидж идёт разработка нового плана вместе с боссом. Теперь главный герой еще больше жаждет расправы над бандой. Но пока он просто дальнобойщик, который невзначай ищет человека, расспрашивая о нём у попутчиков и таких же водителей.',2,56,'http://seasonvar.ru/serial-2182--18_koles_pravosudiya-2-season.html','http://cdn.bigsv.ru/oblojka/2182.jpg'),(70,'Сериал 18-е измерение/18if онлайн','Мир снов загадочен и не исследован никем. Пространство, в которое попадает человек - это всего лишь иллюзия, созданная мозгом. Она наполнена мечтами,обрывочными воспоминаниями и многочисленными странностями. Люди, оказавшиеся в своем сне, чувствуют себя в зависимости от предпочтений собственного же мозга. В центре внимания сюжета оказывается Харуто Цукиширо. Этот парень обладает уникальной способностью, которую сам считает проклятьем. Когда герой засыпает, то его сознание каким-то невероятным образом проникает в чужой сон. Однажды парнишка оказывается во сне ведьмы, который оборачивается для него настоящим кошмаром. К тому же, выбраться оттуда оказывается не так просто, ведь ведьма решила поспать как можно дольше.',1,57,'http://seasonvar.ru/serial-19763-18-e_izmerenie-0-season.html','http://cdn.bigsv.ru/oblojka/19763.jpg'),(71,'Сериал 18-летний олигарх онлайн','Эдик - успешный молодой человек, который ведет разгульный образ жизни. У него есть все, чтобы быть успешным и счастливым. Главный персонаж не ценит остальных людей, которые пытаются быть ему близки. Однако вскоре его жизнь навсегда изменится: когда мужчина узнает о проблемах со здоровьем и любимая супруга уйдет от него, то все превратится в один сплошной кошмар. Эдуард знает, что его супруга все это время была неверна ему, поэтому, вместо того, чтобы делиться при разводе нажитым имуществом, главный персонаж переписывает все средства на счет внебрачной дочери Леси, которой не так давно стукнуло восемнадцать. В итоге девушка из глухого села становится  обладательницей многомиллионного состояния, которое теперь в её руках и под её управлением. Правда, такой поворот событий не по душе никому. Бывшая супруга готова бороться за свою долю, а девочка, не знавшая раньше настоящего отца, хранит обиду за то, что тот бросил маму много лет назад ради сомнительных перспектив.',1,58,'http://seasonvar.ru/serial-28472-18-letnij_oligarh.html','http://cdn.bigsv.ru/oblojka/28472.jpg'),(72,'Сериал 18-летняя невеста/Nang rang 18 seh онлайн','Многие знают о том, что в богатых семьях принято планировать свадьбы своих детей. Конечно же, брак по договорённости - это не то, о чем мечтают молодые. Правда, многие так и не могут пойти против подобных традиций. Что же делать в таких случаях? В центре внимания сюжета оказываются представители семейства Квон. Они уверены, что породниться с семейством своего приятеля - это отличная идея, которая сделает обе семьи очень счастливыми. Конечно же, чтобы провернуть такую схему, им необходимо подготовить внучку к совершеннолетию. Наследница Юн должна будет стать супругой продолжателя рода семейства Квон, однако из-за финансовых трудностей главные действующие лица были вынуждены покинуть свой дом и временно забыть о собственных предпочтениях. Правда, Квон помнят обо всем. Но захотят ли они вступать в брак с девушкой из бедной семьи, где не так давно прогремел крупномасштабный кризис? В общем и целом, впереди главных действующих персонажей ждет по-настоящему захватывающая история. Приятного просмотра.',1,59,'http://seasonvar.ru/serial-23748-18-letnyaya_nevesta.html','http://cdn.bigsv.ru/oblojka/23748.jpg'),(73,'Сериал 1812-1815. Заграничный поход онлайн','Данный телесериал посвящается двухсотлетию со дня Бородинской битвы. Именно в результате этого сражения Наполеоновские войска были полностью изгнаны из Российской империи. Телесериал решил продолжить тему войны 1812 года. Создатели решили предложить зрителю интересный проект, в котором будет говориться о событиях, которые происходили в 1813-1815 годах. Возможно, действия, которые происходили в это время, менее известны широкой публике, но они так же не менее интересны. В данном телепроекте вы узнаете о нелегком пути российских войск, которым пришлось пройти от  Москвы до самого Парижа. Мы узнаем много интересного о сражениях при Дрездене и Кульме, о разгроме французских войск под Лейпцигом, о многих сражениях российских войск во Франции. У нас есть возможность узнать намного подробнее о самом факте отречения Наполеона и его первой ссылке на остров Эльба, о неожиданном появлении французского императора и о его нескольких месяцах правления, после чего и произошло окончательное разгромленные французской армии.',1,60,'http://seasonvar.ru/serial-11836-1812_psfgmnc-00-sezon.html','http://cdn.bigsv.ru/oblojka/11836.jpg'),(74,'Сериал 1812: Энциклопедия великой войны онлайн','Отечественная война 1812 года. Армия Наполеона уже несколько лет шествует по миру, завоевывая одну страну за другой и не ведая поражений. Бонапарт уверен, что ключи от московских ворот ему отдадут без боя.\r\nКогда французское войско, превышающее русское более чем в полтора раза, вторгается в Российскую империю, Наполеон планирует незначительную войну, которая не отнимет ни много сил, ни времени. Уже через полгода обратно во Францию через имперские земли отправятся жалкие остатки армии, не знавшей поражений до этого.\r\nКак получилось так, что Россия при меньшем числе военных сил и при технической отсталости от французов одержала победу и стала не очередной покоренной страной, а государством-освободителем, положившим конец могуществу Наполеона и всей Франции?..',1,61,'http://seasonvar.ru/serial-6784-1812_-_Entciklopediya_velikoj_vojny.html','http://cdn.bigsv.ru/oblojka/6784.jpg'),(75,'Сериал 1864 онлайн','Мы окажемся в историческом периоде середины 19 века. Братья Лауст и Питер жили и радовались жизни, строили планы, любили, причём их любовь была одна на двоих ,оба были влюблены в одну девушку. Но все их планы в один миг унесла война. Год 1864 Датское Королевство оказывается втянуто в кровавую бойню, войну с Германией, Пруссией, Австрией. Питер и Лауст теперь солдаты и их долг защищать Родину, забыв о всех мечтах прошлой жизни.\r\nВсю жестокость ,весь ужас войны, боль, смерть, разлука - это теперь жизнь героев. Много бойцов датской армии больше никогда не вернутся домой, Дания тоже не станет прежней. Ну а тем, кому всё же будет суждено вернуться, тоже ждёт не простая судьба...',1,62,'http://seasonvar.ru/serial-10909-1864.html','http://cdn.bigsv.ru/oblojka/10909.jpg'),(76,'Сериал 187 Детройт/Detroit 1-8-7  1 сезон онлайн','\"187 Детройт\" - это многосерийная драматическая история, снятая в реалистичной стилистике. Сюжет не старается рассказать о каких-то бессмертных полицейских, отдающих себя полностью работе, а представляют реальных сотрудников правоохранительных органов, которые несут службу. Главные действующие лица - простые мужчины и женщины, посчитавшие, что защита правосудия куда важнее, чем личные амбиции и карьера в какой-либо ещё сфере с большими перспективами. Многих сюда привел зов долга, а кто-то просто не нашёл иного выхода для продолжения нормальной жизни и достойного существования. Их история разворачивается в городе Детройт, который считается одним из самых опасных и преступных в Соединённых Штатах Америки.',1,63,'http://seasonvar.ru/serial-1604--187_Detrojt-1-season.html','http://cdn.bigsv.ru/oblojka/1604.jpg'),(77,'Сериал 1899 онлайн','Сериал предлагает нам погрузиться в захватывающую и пугающую до мурашек историю, которая обязательно предложит сюжет, способный заинтриговать и удержать у просмотра даже самого скептически настроенного зрителя. История переносит нас в восемьдесят девятый год прошлого столетия. В центре внимания оказывается корабль, который направляется из Европы в Америку. На его борту - мигранты, мечтающие начать новую счастливую жизнь, однако их мечтам не суждено сбыться, так как главные герои столкнутся на своем пути с другим судном, которое, по официальным данным, считается без вести пропавшим. С этого момента для пассажиров рейса из Европы в Нью-Йорк начинается настоящий кошмар.',1,64,'http://seasonvar.ru/serial-29813-1989.html','http://cdn.bigsv.ru/oblojka/29813.jpg'),(78,'Сериал 19-2  1 сезон онлайн','В сериале пойдет речь о двух, совершенно разных людях, которые не могут поладить между собой, волей судьбы им приходится работать вместе. Речь идет о двух сотрудниках полицейского подразделения в городе Монреаль. Они с самого начала отказывались работать друг с другом. Это и понятно, ведь они очень разные люди, интересы нисколько не совпадают. Каждый из них привык в работе полагаться только на свои знания и методы, и не может терпеть, когда кто-то лезет к нему со своими советами. Их отношения между собой не выдерживают ни какой критики. К тому, эти люди еще и принадлежат к различным расам, что, по сути, еще больше усиливало конфликт между ними. Но как бы там ни было, приказ есть приказ, и им нужно работать вместе, не смотря на разногласия между собой. Теперь они начинают искать подходы друг к другу, ведь работая вместе, им придется прикрывать друг друга, совместно планировать тактические наступления в перестрелках и вообще, видеть друг друга практически целыми днями. Кроме всего этого, им нужно не забывать патрулировать улицы, и выполняя свои должностные полномочия.',1,65,'http://seasonvar.ru/serial-9259-19-2.html','http://cdn.bigsv.ru/oblojka/9259.jpg'),(79,'Сериал 19-2  2 сезон онлайн','Герои сериала – полицейские из Монреаля. Они напарники, давно служат вместе. Казалось бы, ничего особенного в этом нет. Если бы не одна проблема. Напарники терпеть не могут друг друга. Каждое совместное дежурство для них – пытка. Все из-за того, что стражи порядка наделены противоположными характерами. Общее у них то, что каждый уверен в собственной правоте и упрямо отстаивает собственную точку зрения. \r\nИх место службы – улицы Монреаля, которые они ежедневно патрулируют на служебной машине. такое тесное соседство требует слаженности действий при опасной ситуации. а договариваться при взаимной антипатии - очень сложная задача. \r\nНо опыт службы, верность присяге и уверенность в том, что они выполняют важное и нужное дело, помогают напарникам находить общий язык. Они работают всегда быстро, четко и слаженно, поэтому безопасность на вверенном героям участке гарантирована всегда.',2,65,'http://seasonvar.ru/serial-11236-19-2-2-season.html','http://cdn.bigsv.ru/oblojka/11236.jpg'),(80,'Сериал 19-2  3 сезон онлайн','В центре внимания оказывается один из самых криминальных городков. История рассказывает нам о криминальном мире и полицейском департаменте города Монреаль. Кажется, чтобы навести здесь порядок, нужны нереально крутые копы. Однако на службу поступают всякие. Недавно так вообще организовалась странная парочка сотрудников, которая не то чтобы совсем не смотрелась вместе, так еще и конфликтует чуть ли ни каждый день. Сюжет рассказывает зрителям о повседневной жизни двух оперативников, которые поневоле стали напарниками, поэтому теперь терпят выходки друг друга. Но, ради работы, нужно терпеть!',3,65,'http://seasonvar.ru/serial-14126-19-2-3-season.html','http://cdn.bigsv.ru/oblojka/14126.jpg'),(81,'Сериал 19-2  4 сезон онлайн','В полиции Монреаля служат двое полицейских, которые по собственной воле никогда бы не стали работать в одной команде. Меньше всего герои хотели становиться напарниками. Но у начальства другое мнение и их желания не берут во внимание. Герои разные люди, у них на все расхожее мнение, и кажется, что нет ничего общего. В работе также они используют разные методы. Такая разобщенность сказывается пагубно на их службе, добавляет проблем личная неприязнь. В обязанности напарников входит патрулирование одного из районов города, в котором повышена криминальная активность. Что ни день, то очередное правонарушение, злоумышленники воплощают свои дерзкие планы, а от Ника и Бена требуется расстроить их планы, заставить преступников нести наказание за свои действия...',4,65,'http://seasonvar.ru/serial-16492-19-2-4-season.html','http://cdn.bigsv.ru/oblojka/16492.jpg'),(82,'Сериал 19-2 (2011)  1 сезон онлайн','Ник и Бен – полицейские, которые ежедневно патрулируют улицы большого города. Во время службы может произойти всякое, и они делают всё, что них требуется. Несмотря на то, что оба терпеть друг друга не могут, они честно выполняют свои должностные обязанности. В том числе, прикрывают спину напарника. Ведь самое главное, чтобы нарушители не тревожили простых горожан, а с разбирательством своих личных отношений можно и подождать.\r\nТакая ситуация сложилась не случайно – ведь у мужчин совершенно разные взгляды на жизнь. Тяжело, наверное, работать в такой паре, но выбирать ребятам не приходится. Криминальные элементы опять угрожают спокойной жизни мирных жителей и, прежде всего, надо разобраться с этой проблемой.',1,66,'http://seasonvar.ru/serial-15073-19-2_2011-1-season.html','http://cdn.bigsv.ru/oblojka/15073.jpg'),(83,'Сериал 19-2 (2011)  2 сезон онлайн','Вашему вниманию представлена история о двух совершенно непохожих друг на друга мужчинах, которые волею судьбы оказались напарниками. Оба героя служат в полиции Монреаля. При первом же знакомстве Ник и Бен поняли, что им будет сложно найти общий язык и сработаться. У них разнятся взгляды на жизнь, разные предпочтения, характеры. Но им предстоит контролировать одну территорию, расположенную в центральной части девятнадцатого района – зону номер два. Напарники отвечают за безопасность в этой зоне, разоблачают планы злоумышленников и все время ругаются между собой. Сумеют ли эти двое смириться со своей участью и перестать конфликтовать? Постоянно вспыхивающие между напарниками ссоры отражаются на их работе...',2,66,'http://seasonvar.ru/serial-16213-19-2_2011-2-season.html','http://cdn.bigsv.ru/oblojka/16213.jpg'),(84,'Сериал 19-2 (2011)  3 сезон онлайн','Приглашаем вас на просмотр нового сезона сериала \"19-2\". Проект рассказывает нам о работе двух копов, которые трудятся в полицейском отделении города Монреаль. Их поставили в пару, хотя главные герои совершенно не похожи друг на друга. Абсолютные противоположности стараются хоть как-то ужиться друг с другом. Бен и Ник пытаются найти общие темы для разговоров,но все тщетно. Правда, серьезные рабочие условия и достаточно трудные расследования заставляют главных героев сблизиться и начать работать как один единый механизм. А между делом  можно и отдохнуть, не задумываясь о том, насколько они недолюбливают друг друга.',3,66,'http://seasonvar.ru/serial-17267-19-2_2011-3-season.html','http://cdn.bigsv.ru/oblojka/17267.jpg'),(85,'Сериал 1917. Судьбы онлайн','Поклонникам документального кино, а также желающим узнать лучше историю страны представлен познавательный сериал Виктора Лебединского, посвященный периоду завершения Первой мировой войны, а также тому, как складывались человеческие судьбы после окончания военного времени. Окончание войны еще не означало, что началось легкое время для людей. Последующие события обернулись для большинства людей серьезными испытаниями. Едва ли находились семьи, которые не потеряли на войне родных, близких. Оказалось, что не все беды закончились, вскоре людей ожидало еще одно потрясение – отречение царя...',1,67,'http://seasonvar.ru/serial-16279-1917_Sud_by.html','http://cdn.bigsv.ru/oblojka/16279.jpg'),(86,'Сериал 1941 онлайн','Вблизи маленькой приграничной деревушки все чаще раздаются взрывы бомб и ракет... Два старых приятеля уже давно решили судьбу своих детей - они собираются организовать свадьбу между ними, не спрашивая на то их согласия. Однако дети не особо обрадовались, узнав о решении своих  родителей. Гриша не хочет вступать в брак с Аленой, ведь он любит совершенно другую женщину, к которой сбегает со свадебной церемонии. Брат Гриши напротив давно влюблен в Алену и даже намеревался похитить ее, но отец строго запретил делать это. На следующий день после сорвавшейся свадьбы начинается война... По дороге в город, автомобиль Григория попадает под масштабную бомбардировку немецких войск. Теперь все мужчины идут воевать, а женщины остаются одни...  \n\n\n',1,68,'http://seasonvar.ru/serial-228-1941.html','http://cdn.bigsv.ru/oblojka/228.jpg'),(87,'Сериал 1942 онлайн','Великая Отечественная война. 1942-й год. В лесу скрывается партизанский отряд, в котором находится Григорий. Они пережили сложную зиму, потеряв многих товарищей. Осталось несколько красноармейцев, односельчан, Муха и сам Григорий. Крепких мужчин почти нет, большинство партизан – это слабые женщины, старики и дети. Карательные отряды эсесовцев и латышских полицаев прочесывают местность, поэтому путь в родную деревню для жителей заказан. Вся жизнь проходит в лесу. Сложные переплетения людских судеб – Григорий с Дашей, Алена почти сломлена выпавшими на нее бедами. Муж живет с другой, а любовь Алены разбита: все ее чувства были отданы тому, кого назвали предателем...',1,69,'http://seasonvar.ru/serial-2396--1942.html','http://cdn.bigsv.ru/oblojka/2396.jpg'),(88,'Сериал 1943 онлайн','1943 год, новый год. После того, как фашисты потерпели поражение под Сталинградом, готовится реванш. На территорию, занятую оккупантами, выбрасывается советский десант. К сожалению, все погибают, остается только молодая девушка-радистка Катя. В лесу ее находит парень по прозвищу Муха и прячет ее в селе, где он проживает с Аленой. Для того чтобы не выдать себя, они играют роль мужа и жены. О радистке Кате узнают городские подпольщики. Для установления связи с радисткой направляется Григорий, который исполняет службу в полиции. Между советской радисткой Катей и Григорием возникают романтические чувства. Но Григорий не прост, он пытается восстановить отношения, как с Дашей, так и с Аленой. Эта задумка у него не выходит...',1,70,'http://seasonvar.ru/serial-6813-1943.html','http://cdn.bigsv.ru/oblojka/6813.jpg'),(89,'Сериал 1962: Битва в холмах/1962: the War in the Hills онлайн','Сюжет сериала повествует историю о ста пятидесяти солдатах индийской армии. Эти отважные мужчины столкнулись с превосходящими силами противника, когда занимались обороной важнейшей стратегической точки. Три тысячи военных китайцев напали на зону, охраняемую этим небольшим отрядом. В основе сериала лежат реальные события, которые так или иначе связаны с боями близ реки Галван. Этот участок уже давно является спорной территорией, на которой разворачиваются баталии между военными из Китая и Индии. Эта история навсегда осталась в памяти и сердцах граждан Индии, как пример отваги и воли к жизни.',1,71,'http://seasonvar.ru/serial-28857-1962_Bitva_v_holmah.html','http://cdn.bigsv.ru/oblojka/28857.jpg'),(90,'Сериал 1971: Год, который изменил музыку навсегда/1971: The Year That Music Changed Everything онлайн','Сюжет переносит в семьдесят первый год прошлого столетия. Этот период стал для музыки настоящим подъёмом, ведь впервые на сцене появились люди, которые привнесли в сферу что-то новое, необычное, при этом став влиятельными персонами не только в шоу-бизнесе, но и в политике и культуре. Конечно же, перемены пришлись к лучшему, ведь мир смог создать немало по-настоящему впечатляющих шедевров, которые до сих пор прослушиваются десятками тысяч людей ежедневно. В сериале будут представлены неизданные ранее кадры из жизни знаменитостей, среди которых мы с лёгкостью можем заметить таких выдающихся личностей, как Элтон Джон, представителей коллектива Роллинг Стоунс, Мик Джаггер, Боб Марли, Арета Франклин и The Who. Многие зрители в возрасте знают, о ком идёт речь, да и представители аудитории помладше тоже в курсе, про кого здесь пойдет рассказ. Вышеназванные люди - настоящие творцы, гении, которые посвятили свою жизнь музыки, создав бессмертное наследие. Сериал доказывает, что люди, оставляющие своё наследие в той или иной сфере деятельности, предопределяют дальнейшее её развитие и влияние на мир в целом!',1,72,'http://seasonvar.ru/serial-30014-1971_God_kotoryj_izmenil_muzyku_navsegda_psledpu.html','http://cdn.bigsv.ru/oblojka/30014.jpg'),(91,'Сериал 1983 онлайн','Переносимся с вами в две тысячи второй год. Несмотря на то, что многие из нас жили в это время, проект предлагает посмотреть на альтернативное течение истории, которое оказалось возможным после событий восемьдесят третьего года, развернувшихся в Польше. Совершенный неизвестными активистами-оппозиционерами теракт остановил демократизацию восточноевропейского государства. Польша сохранила социалистический порядок и создала железный занавес для внешнего мира. Советский Союз не распался к две тысячи второму году, а это значит, что история приобрела совершенно новый поворот событий.',1,73,'http://seasonvar.ru/serial-20517-1983.html','http://cdn.bigsv.ru/oblojka/20517.jpg'),(92,'Сериал 1992 онлайн','Развитие событий происходит в тысяча девятьсот девяносто втором году в городе Милан. В это время ведутся мероприятия по сокращению различных финансовых афер, с коррупцией и взятничеством. Одним из громких дел было дело о Мишеле Майнаги, который будучи собственником большого лекарственного производства, реализовывал кровь с вирусом ВИЧ. В сериале рассматривается множество сюжетных линий, одна из которых касается служителя полиции Луки Пасторе. Он был заражен вирусом по причине Мишеля Майнаги. Также в сериале пересекутся жизни возлюбленной Мишеля - Вероники, кандидата Пиетро Боско в парламент, работника рекламной компании Леонардо Нотте.',1,74,'http://seasonvar.ru/serial-12494-1992_psmaiju-0-season.html','http://cdn.bigsv.ru/oblojka/12494.jpg'),(93,'Сериал 1993 онлайн','Леонардо Нотте знакомится с Сильвио Берлускони. Первый - известный пиарщик и уверенный в себе политтехнолог. Его встреча с медиамагнатом поворачивает жизнь обоих в новом векторе развития. Берлускони из человека, связанного с шоу-бизнесом, становится политиком с подачи Нотте. Свой пост в это время теряет Беттино Кракси, который был председателем совета министров. Первая республика в Италии терпит крах. Это становится толчком для начала деятельности представителей мафиозных структур. Так, в Риме, Милане и Флоренции начинает развиваться криминальная сфера, в которой наибольшее влияние имеет мафия.',1,75,'http://seasonvar.ru/serial-27978-1993_psgruxc.html','http://cdn.bigsv.ru/oblojka/27978.jpg'),(94,'Сериал 1994 онлайн','Сюжет разворачивается в девяносто четвертом году прошлого столетия. В центре внимания сюжета оказывается итальянская республика. Страна переживает сложный период, ведь переворот возникает один за другим: элита теряет прежнюю власть, становясь все менее влиятельной и необходимой в этом государстве. На смену первой республике приходит вторая, принося еще более разительные изменения. Этот сериал не только о политической ситуации, но и о людях, которые живут в Италии и думают о том, что же им делать дальше на фоне всех этих глобальных перемен. Эта история о судьбах, надеждах и вере в лучшее.',1,76,'http://seasonvar.ru/serial-28085-1994.html','http://cdn.bigsv.ru/oblojka/28085.jpg'),(95,'Сериал 1:11: Время для встречи с тобой/1:11 Time To Go See You онлайн','Молодость создана для того, чтобы искать свою судьбу, своё предназначение и быть ближе к мечтам. Главные действующие лица этой истории однажды всерьёз влюбились, однако при всём при этом в их жизни произошли крутые перемены. Завязать первые отношения так и не удалось, однако прекрасные чувства всё ещё не покинули сердца юнцов. Они по-прежнему не могут забыть о первой любви, что становится большой проблемой. Какие-то мистические силы останавливают каждый день ровно в час-одиннадцать, что позволяет главным персонажам в тишине и наедине с самими собой подумать о том, что же делать дальше...',1,77,'http://seasonvar.ru/serial-29765-111_Vremya_dlya_vstrechi_s_toboj.html','http://cdn.bigsv.ru/oblojka/29765.jpg'),(96,'Сериал 2 дня/2 Days онлайн','Сериал рассказывает о двух молодых людях, кузенах, которые решили хорошо провести время. Они готовы веселиться и тустоваться вместе, однако их досуг закончится неожиданными последствиями. Главный герой знакомится с гангстером, который меняет их жизнь невероятно круто. Следующие дни станут для молодых людей решающими в их судьбе, ведь они переживут невероятно много. Они столкнутся с реальным убийством, получат в свои руки сумку с наркотиками, а также проверят на крепость свои отношения, ведь только верные друзья смогут пережить все то, что их ждет в течение последующих двух дней.',1,78,'http://seasonvar.ru/serial-28833-2_dnya.html','http://cdn.bigsv.ru/oblojka/28833.jpg'),(97,'Сериал 2 оторвы на престоле/2 Dope Queens  1 сезон онлайн','Перед вами новое комедийное шоу, рассказывающее о невероятных затеях двух совершенно неугомонных особ. В центре внимания проекта оказываются Фиби Робинсон и Джесика Уильямс. Эта парочка великолепно справляется с задачей развлечения публики. Однако им удается одновременно поднимать серьезные вопросы, которые являются злободневными и по-настоящему важными для современного общества. Им удается провести беседы об отношениях, сексе, семейной жизни, расовом различии людей, внешнем виде, ориентации. Главные героини не обойдут стороной ни одну интригующую тему, которая может вызвать резонанс!',1,79,'http://seasonvar.ru/serial-17936-2_otorvy_na_prestole.html','http://cdn.bigsv.ru/oblojka/17936.jpg'),(98,'Сериал 2 оторвы на престоле/2 Dope Queens  2 сезон онлайн','В центре внимания этого проекта оказывается Джессика Уильямс и Фиби Робинсон. Главные героини обожают обсуждать различные темы, а их общение оказывается невероятно забавным и очень увлекательным. Конечно же в Нью-Йорке жизнь не стоит на месте, поэтому всегда найдётся причина о чём-либо поговорить. Нередко общение касается известного Билли Джоэла, к которому героини явно неравнодушны. К тому же их не смущает общаться на камеру на темы расы, социальных проблем, смешивая всё это с обсуждениями секса, романтики, межполовых отношений и прочего. В общем, в новом сезоне градус дебатов будет ещё более высоким.',2,79,'http://seasonvar.ru/serial-21543-2_otorvy_na_prestole-2-sezon.html','http://cdn.bigsv.ru/oblojka/21543.jpg'),(99,'Сериал 2,5 человека/Two and a Half Men  1 сезон онлайн','Представьте себе типичного гедониста, назовём его Чарли. Он успешный музыкант, имеющий дом на берегу океана и привыкший ни в чём себе не отказывать. Никаких семейных обязательств, новые обворожительные женщины, алкоголь, шумные вечеринки и жизнь одним днём.\r\nА теперь представьте его полную противоположность — ничего толком не добившегося мужчину, переживающего процесс тяжёлого развода, в ходе которого уже бывшая жена отобрала всё его имущество, в том числе и жильё. Всё это — брат Чарли, Алан, воспитывающий десятилетнего сына, с которым он обязан проводить время. \r\nАлан просится пожить у брата, которого сие обстоятельство не совсем радует, ведь он привык к холостяцкой жизни… однако им всё же приходится как-то уживаться всем вместе. Главное, чтобы дядюшка не учил ребёнка играть в покер и охмурять дам.',1,80,'http://seasonvar.ru/serial-472-25_cheloveka-1-season.html','http://cdn.bigsv.ru/oblojka/472.jpg'),(100,'Сериал 2,5 человека/Two and a Half Men  2 сезон онлайн','Два брата живут вместе: один из них любит свободу и меняет девушек как перчатки, другой - совсем недано расстался со своей супругой. Любимым занятием Чарли является общение с девушками, он каждый день заводит интрижку с новой красоткой и такая жизнь его вполне устраивает, Алан тоже старается не отстать от своего брата. В свободное от романов время братья воспитывают десятилетнего сына Алана, частенько посвящая его в вопросы совсем неподходящие для его возраста: учат Джейка играть в покер и флиртовать с девушками...',2,80,'http://seasonvar.ru/serial-481-25_cheloveka_psnoqmt-002-sezon.html','http://cdn.bigsv.ru/oblojka/481.jpg'),(101,'Сериал 2,5 человека/Two and a Half Men  3 сезон онлайн','Два брата живут вместе, один из них непоправимый холостяк, который очень дорожит своей свободой, другой - совсем недавно расстался с супругой. Чарли интересует лишь одно - красивые девушки, которых он меняет как перчатки. Алан пытается быть наравне с братом. В свободное от любовных романов время братья занимаются воспитанием 10-летнего сынишки Алана Джейка: они мечтают сделать из него настоящего мужчину, часто посвящая его в темы, совершенно неподходящие для его возраста, учат играть в покер и флиртовать с девушками...',3,80,'http://seasonvar.ru/serial-493-25_cheloveka_psqgphy-3-sezon.html','http://cdn.bigsv.ru/oblojka/493.jpg'),(102,'Сериал 2,5 человека/Two and a Half Men  4 сезон онлайн','После того, как Алану пришлось разойтись с женой, он перебрался на постоянное место жительства к своему брату-Чарли... Вот с этого и начинаются сюрпризы судьбы для братьев. На их попечении остается сын Алана, которого нужно воспитывать и о котором нужно заботиться... Но чарли, по своей натуре, бабник, ни как не может позволить сломать мнение окружающих, уже давно сложившееся о нем, как о дон жуане... Да и брат Чарли, почувстовав мужскую компанию углубляется в нюансы игры в покер и легкого флирта с противоположным полом...',4,80,'http://seasonvar.ru/serial-526-25_cheloveka-004-sezon.html','http://cdn.bigsv.ru/oblojka/526.jpg'),(103,'Сериал 2,5 человека/Two and a Half Men  5 сезон онлайн','Два брата живут вместе. Один из них привык к вниманию девушек, он каждый вечер проводит с новой девушкой и безумно боиться, что какая-нибудь из них сможет окольцевать его. Другой совсем недавно развелся с женой и пытается ни в чем не отставать от брата. В свободное от любовных интрижек время братья занимаются воспитанием 10-летнего сына Алана Джейка: они хотят сделать из него настоящего мужчину, порой посвящая его в темы, совсем неподходящие для его возраста, учат его играть в покер и флиртовать с девушками...',5,80,'http://seasonvar.ru/serial-545-25_cheloveka-005-sezon.html','http://cdn.bigsv.ru/oblojka/545.jpg'),(104,'Сериал 2,5 человека/Two and a Half Men  6 сезон онлайн','Два брата живут вместе в одной квартире. Один из них - покоритель женских сердец, который больше всего на свете боится попасть под влияние чар какой-нибудь очаровательной леди, другой - недавно развелся с женой. Чарли меняет девушек как перчатки, Алан тоже старается не отставать от брата. В свободное от любовных похождений время братья занимаются воспитанием 10-летнего сынишки Алана Джейка: они пытаются сделать из него настоящего мужчину, порой посвящая его в темы, совершенно не подходящие для его возраста, учат особенностям игры в покер и флирту с девушками...',6,80,'http://seasonvar.ru/serial-608--25_cheloveka-006-sezon.html','http://cdn.bigsv.ru/oblojka/608.jpg'),(105,'Сериал 2,5 человека/Two and a Half Men  7 сезон онлайн','Чарли свободолюбивый мужчина, который не любит себя обременять долгими отношениями с девушками. Его брат Алан совсем недавно развелся со своей женой, и теперь братья вновь живут вместе. Чарли постоянно развлекается с девушками, заводит отношения на пару ночей, а Алан же пытается не отставать от брата.  Кроме всех гулянок и интрижек на Алане еще и воспитание десятилетнего сына Джейка, из которого дядя и отец хотят сделать настоящего мужчину. Для этого они посвящают его во все вопросы взрослой жизни, учат игре в покер и флирту с прекрасным полом…',7,80,'http://seasonvar.ru/serial-726--25_cheloveka-007-sezon.html','http://cdn.bigsv.ru/oblojka/726.jpg'),(106,'Сериал 2,5 человека/Two and a Half Men  8 сезон онлайн','Чарли – холостяк со стажем, живёт в своём особняке, ни о чем не жалея. Он боится, что, найдя жену, он лишится своей свободы, которую так любит. Но ситуация меняется, когда его брат разводится со своей женой, которая отсудила у него всё вместе с домом. Алану ничего не остаётся, как переехать к Чарли. \r\nХолостяк этому не особо рад, и обоим братьям придётся найти общий язык, чтобы ужиться под одной крышей. Ведь Чарли пишет музыку для рекламы и довольно-таки обеспеченный человек, в то время как его брат занимается непонятно чем и постоянно находит проблемы.\r\nАлан наконец-то находит свою любовь – девушку по имени Линси. Отношения у парочки сложились очень удачно, и у них уже в планах пожениться и начать совместную жизнь.',8,80,'http://seasonvar.ru/serial-1553--25_cheloveka-0008-sezon.html','http://cdn.bigsv.ru/oblojka/1553.jpg'),(107,'Сериал 2,5 человека/Two and a Half Men  9 сезон онлайн','В центре сюжета фильма остаются те же родные братья Чарли и Алан. Чарли так и не женился, ведь он все время считает, что обручальные кольца – это оковы его спокойной жизни. \r\nВместе с братьями продолжает жить и сын Алана Джейк. Все шло, как обычно, но вот в дом приходит беда. Чарли уезжает с любимой девушкой в Париж и там становится жертвой несчастного случая. \r\nПосле похорон брата Алан решает продать дом Чарли, потому что он не может жить здесь, где все напоминает ему о брате, и у него нет финансов, чтобы содержать его. Алан знакомится с одним богачом, который переживает развод со своей женой. Алан помогает Уолдену разобраться с его неприятностями, поддерживает его, ведет с ним утешительные беседы, в благодарность миллионер помогает ему решить вопрос с продажей дома. \r\nКак-то Алан находит дневник Чарли, откуда очень многое узнает о брате.',9,80,'http://seasonvar.ru/serial-3126--25_cheloveka-009-sezon.html','http://cdn.bigsv.ru/oblojka/3126.jpg'),(108,'Сериал 2,5 человека/Two and a Half Men  10 сезон онлайн','Алан разошелся с женой и переехал к своему брату Чарли, заядлому холостяку, считающему, что нет ничего лучше свободы.\r\nЖизнь братьев складывается прекраснейшим образом. Они могут гулять, напропалую флиртовать с красавицами и не задумываются над серьезными отношениями. Но, помимо веселой жизненной программы, мужчинам предстоит еще и поработать воспитателями. У Алана есть сын Джейк, который после развода остался с ним. Теперь папаша с братом учат мальчика всем жизненным премудростям.\r\nМужчинам кажется, что парень растет таким, каким и должен быть настоящий мужчина. Но не каждого мальчика с малых лет учат азартным играм и флирту с противоположным полом. Не Казанову ли случайно растят братья? Жизнь расставит все по своим местам.',10,80,'http://seasonvar.ru/serial-4998-25_cheloveka-00010-sezon.html','http://cdn.bigsv.ru/oblojka/4998.jpg'),(109,'Сериал 2,5 человека/Two and a Half Men  11 сезон онлайн','Из 11-го сезона популярного в Америке ситкома окончательно исчезнет та самая «половинка». Подросток Джей, который весь предыдущий год служил в армии и редко появлялся на экране, по задумке сценаристов уедет учиться в колледж. Поэтому останутся только двое – Уолден и Алан (по-прежнему их играют Эштона Катчер и Джон Крайар). Но недолго им предстоит горевать без третьего персонажа. В жизни молодых людей появится вполне «целая» девушка (Эмбер Тэблин). Для большей остроты она окажется лесбиянкой. Правда, по ходу сезона, девушка, находясь в компании двух привлекательных парней, решит пересмотреть свои взгляды на взаимоотношение полов.',11,80,'http://seasonvar.ru/serial-7789-25_cheloveka-11-sezon.html','http://cdn.bigsv.ru/oblojka/7789.jpg'),(110,'Сериал 2,5 человека/Two and a Half Men  12 сезон онлайн','В одном доме живут три человека. Это братья, Чарли и Алан. Они воспитывают Джейка. Иногда эти взрослые люди сами ведут себя как дети. Чарли - бабник и пьяница, заботящийся о своей независимости. Алан предпочитает сидеть дома, он недавно развелся и страдает. Джейк становится учеником в колледже. Джейк уезжает из дома, братья остаются вдвоем. Но неожиданно в их доме появляется Дженнифер Харпер – это дочь Чарли. Она точная копия своего отца, только в женском варианте. Плюс ко всему она имеет нетрадиционную сексуальную ориентацию. Дженнифер - лесбиянка. Сможет ли она заменить Джейка? \nЖизнь семейства полна самых разных событий. Харперы постоянно попадают в курьезные и веселые ситуации. Будут ли они и дальше жить вместе?',12,80,'http://seasonvar.ru/serial-10729-25_cheloveka-012-sezon.html','http://cdn.bigsv.ru/oblojka/10729.jpg'),(111,'Сериал 20 лет без любви онлайн','Мелодраматический сериал от российских кинематографистов рассказывает о хитросплетениях судеб абсолютно разных людей, и их попытках решить возникшие в связи с этим проблемы.\r\nОдна страна, но два абсолютно разных мира. С одной стороны – Москва, где бурная насыщенная событиями жизнь, денежные потоки, масса богатых людей. С другой стороны – провинциальный Приморск, где дни похожи один на другой, а жители постоянно заняты повседневным решением своих житейских проблем…\r\nКазалось бы, что может объединять не знакомых между собой дочь главы крупной промышленной корпорации из Москвы – Леру, и уроженку Приморска - Свету, которые даже между собой не знакомы? Об этом знает только её величество Судьба. Именно она за один день переплетет девичьи судьбы, заставив по-новому взглянуть на себя, поставив перед выбором, который уже кое-кто сделал до них и за них…',1,81,'http://seasonvar.ru/serial-3796--20_let_bez_lyubvi_psnzhby.html','http://cdn.bigsv.ru/oblojka/3796.jpg'),(112,'Сериал 20 минут/20 Dakika онлайн','Мелек, её муж и двое прелестных воспитанных детишек живут счастливой безоблачной жизнью, даже не предполагая, что может случиться в недалёком будущем. По нелепой случайности женщину обвиняют в убийстве, преступлении, которого она не совершала.\r\nВсе попытки мужа вызволить любимую их беды не приносят успеха. Адвокаты тоже разводят руками, не в состоянии помочь женщине и доказать её невиновность. В отчаянии Али решается на крайний шаг – он должен организовать побег супруги, если другого выхода нет, а правосудие слепо и глухо. Обыкновенный учитель делает непростой для себя выбор. Теперь обоим придётся скрываться от преследования властей. Но, возможно, они сами смогут провести расследование, найти убийцу, и вернуть былое уважение к своей семье.',1,82,'http://seasonvar.ru/serial-7527-20_minut.html','http://cdn.bigsv.ru/oblojka/7527.jpg'),(113,'Сериал 2000-летняя офисная девчонка/2000 Year Old Office Girl онлайн','Девушка по имени Моме вкалывает на работе в офисе. Она выглядит точно так же, как и многие другие служащие этого заведения. Однако, мало кто знает главную тайную девушки - ей две тысячи лет с рождения. Удивительно, но юная, на вид, особа никогда не болеет и не может никак умереть, что дает ей возможность жить постоянно. Правда, секрет её гибели заключается в любви. Друг, занимающийся гаданием, предсказал ей гибель в тот год, когда девушка найдет своего возлюбленного. Удивительно, но пока что сердце Моме кажется холодным, как камень. Несмотря на  это у неё есть четыре претендента, готовых побороться за расположение красавицы. Каждый из персонажей - интересная и необычная личность, что внесет свою лепту в историю главной героини. Один из них - богатый клиент, который не так давно обратился  к женщине за помощью в её фирму. Второй - шеф, который управляет деятельностью подчиненных, в том числе и главной героиней. Третий - случайный знакомый бариста, который нашел в главной героине родственную душу, а четвертым оказывается парнишка, который не так давно поступил на работу  в офис и стал коллегой Моме. В такой необычной компании главная героиня может найти свою любовь и свой конец...',1,83,'http://seasonvar.ru/serial-29048-2000-letnyaya_ofisnaya_devchonka.html','http://cdn.bigsv.ru/oblojka/29048.jpg'),(114,'Сериал 2000е/The 2000s онлайн','Проект \"Двухтысячные\" -  это обзор не так давно прошедшего десятилетия, которое перевернуло взгляды людей на мир и жизнь в целом. Перед нами по-настоящему монументальный в вопросе прогресса и перемен период в десять лет! Авторы сценария этого исследовательского документального проекта рассказывают зрителям о таких феноменах нового времени, как интернет, социальные сети, высокие технологии, гаджеты и прочее. Мы познакомимся с самой популярной сетью в мире Фейсбуком, а также узнаем, почему так популярна марка Эпл и какие конкуренты у нее появились на рынке в наше время. Приятного просмотра.',1,84,'http://seasonvar.ru/serial-20305-2000e--0--season.html','http://cdn.bigsv.ru/oblojka/20305.jpg'),(115,'Сериал 21 Тандер/21 Thunder онлайн','Вниманию поклонников спортивных драм, представлен сериал «21 Тандер», сюжет которого посвящен членам футбольной команды Монреаль Тандер U21. Зрители узнают о судьбах парней, которые решили связать свою жизнь с футболом, о том, как складываются их жизни, что именно привело их в этот клуб, о взлетах и падениях каждого из них. О том, как эти ребята стали одной командой, как складывались их отношения внутри коллектива, какой вклад внес тренер в развитие команды – расскажет увлекательный сериал. Чтобы игроки стали настоящей командой, прониклись командным духом, требуется приложить много сил и о стороны тренера, и со стороны самих игроков, только тогда можно рассчитывать на высокие результаты! А герои мечтают об успехе и ориентированы на победу!',1,85,'http://seasonvar.ru/serial-16401-21_Tander.html','http://cdn.bigsv.ru/oblojka/16401.jpg'),(116,'Сериал 22 июля/22. Juli онлайн','22 июля две тысячи одиннадцатого года стало датой скорби в Норвегии. Ужасная череда трагедий, прокатившаяся по стране, заставила людей сплотиться перед общей бедой. Теракт унес жизни десятков человек. Среди простого народа и представителей специальных служб нашлись смельчаки, бросившиеся помогать пострадавшим. Они спасают раненых, обеспечивая им первую медицинскую помощь; они утешают скорбящих, потерявших надежду на лучшее; они контактируют с властями, чтобы добиться максимально возможного числа спасённых. Эта история о тех, кто выполнял свой профессиональный и гражданский долг.',1,86,'http://seasonvar.ru/serial-24510-22_iyulya.html','http://cdn.bigsv.ru/oblojka/24510.jpg'),(117,'Сериал 22/7/Nanabun no Nijuuni онлайн','Айдол-группы в Японии считаются самыми успешными бизнес-проектами. Среди талантливой молодёжи находятся перспективные и пробивные мальчишки и девчонки, которые верны своему стремлению и становятся настоящими звездами большой сцены. Ясуши Акимото решает создать свою группу. Продюсер уже видел на своём веку немало ярких представителей молодёжной поп-культуры, однако на этот раз ему придётся поработать с ребятами, которые никогда раньше не были на большой сцене. Так создаётся группа 22/7, которая цепляет уже своим неординарным названием. Столь яркое наименование становится главной фишкой артистов. Зрители потянулись к ним в надежде, что смогут увидеть по-настоящему крутые выступления и интересных личностей. Девушки готовы стать знаменитостями, но для начала им необходимо пройти кастинг для попадания в состав. Благо, кастинг - это всего лишь фарс. На самом деле состав этого коллектива уже сформирован, а счастливые обладательницы билета в группу уже должны начать готовиться к гастролям и большой славе. Знакомьтесь поближе с новыми суперзвездами: Аканэ Маруяма, Аяка Татикава, Миу Такигава, Дзюн Тода, Мияко Кого, Рэйка Сато, Николь Сайто и Сакура Фудзима.',1,87,'http://seasonvar.ru/serial-24643-227.html','http://cdn.bigsv.ru/oblojka/24643.jpg'),(118,'Сериал 220 вольт любви онлайн','В сериале «200 вольт любви» речь пойдёт о провинциальной девушке Маше Медведевой, которая приехала в Москву с целью добиться личного успеха и карьерного. Главная героиня сериала устраивается в продюсерский центр, к Маргарите Терновской, и становится у неё секретарём. В этом центре, с Машей произошёл несчастный случай (произошло короткое замыкание), и в результате его, главная героиня обретает удивительный дар – она может слышать в офисе Терновской, электрические приборы и может с ними говорить (в той аномальной зоне, которая возникла в результате короткого замыкания). Мало того, что Маша может слышать эти приборы, но она также может их видит в таком ракурсе, в котором остальные люди их не видят. Сначала, от свалившегося такого на неё дара, Маша была в шоке, но потом, она к нему приспосабливается и начинает этот обретённый дар использовать в своих интересах. Зачастую, из-за этого Маша попадает в разные забавные ситуации, да, и электроприборы не прочь над Машей и сами подшутить, своими выходками подставляя её часто. Но, когда возникает критическая ситуация, они встают всегда на защиту Маши. Стоит сказать, что обладают эти электрические приборы своим даром, только в офисе Терновской (то есть, в зоне аномалии), за исключением мобильного телефона, который повсеместно обладает этим свойством, потому что, свой разряд, аккумуляторный прибор получил через Машу напрямую. Почему не все электроприборы наделены таким даром, главная героиня узнаёт в общении с компьютером, в одной из серий, этого сериала.',1,88,'http://seasonvar.ru/serial-1899--220_vol_t_lyubvi.html','http://cdn.bigsv.ru/oblojka/1899.jpg'),(119,'Сериал 24 Часа/24  1 сезон онлайн','24 часа – ровно столько времени есть у главного героя, чтобы сделать все для спасения нескольких жизней, включая, порой, свою собственную.\r\nДжек Бауэр – специальный агент подразделения по борьбе с террористами в Лос-Анджелесе. Каждый день несет в себе новую угрозу – у многих есть мотивы угрожать безопасности не только мирных граждан, но и серьезных политических деятелей. Агенты иностранных спецслужб, террористические организации, чьи сети окутали весь мир – все они «жаждут» встречи с Джеком и его командой. \r\nРади собственной выгоды и мести преступники готовы на многое. Похищение людей, взрывы, покушение на жизнь главы государства – это далеко не полный перечень возможных злодеяний. На выполнение каждой миссии у контртеррористического отдела есть всего сутки.',1,89,'http://seasonvar.ru/serial-248-24_CHasa-1-season.html','http://cdn.bigsv.ru/oblojka/248.jpg'),(120,'Сериал 24 Часа/24  2 сезон онлайн','Сутки так коротки.... Это прекрасно известно шефу элитного антитеррористического подразделения ЦРУ - Джеку Бауэру. На его счету сотни опаснейших задержаний, но эти 24 часа станут для героя настоящим испытанием  мужества и стойкости. Всего за сутки он по долгу службы предотвратит покушение на кандидата в президенты, поймет, что в его отделе завелся крот и отыщет похищенную бандитами дочь. Сутки, которые изменят его жизнь.',2,89,'http://seasonvar.ru/serial-263-24_CHasa-2-season.html','http://cdn.bigsv.ru/oblojka/263.jpg'),(121,'Сериал 24 Часа/24  3 сезон онлайн','Джек Бауэр - не тот, кто отступит перед опасностью, но даже он, шеф элитного антитеррористического подразделения ЦРУ, не мог предположить, что готовят ему ближайшие сутки. Сплетение из интриг и предательств, похищение его любимой дочери и предотвращение громкого убийства кандидата в президенты - вот лишь мала часть того, с чем ему предстоит столкнуться. Честь и слава  таким отважным офицерам.',3,89,'http://seasonvar.ru/serial-268-24_CHasa-3-season.html','http://cdn.bigsv.ru/oblojka/268.jpg'),(122,'Сериал 24 Часа/24  4 сезон онлайн','Для многих обывателей - сутки это утро, день, вечер и ночь. Все как обычно. Но Джеку Бауэру, главе отдела элитного антитеррористического подразделения ЦРУ, за это время придется столкнуться со многим. Предательство друга, предотвращение убийства высокопоставленного чиновника и даже похищение собственной дочери... И все необходимо решить за 24 часа... А этого так мало...',4,89,'http://seasonvar.ru/serial-274-24_CHasa-4-season.html','http://cdn.bigsv.ru/oblojka/274.jpg'),(123,'Сериал 24 Часа/24  5 сезон онлайн','Прошло вот уже полтора года с тех пор, как командир контртеррористического отдела Джек Бауэр был объявлен погибшим. О том, что он инсценировал свою смерть, было известно лишь немногим. Зажив спокойной и размеренной жизнью, мужчина не подумал о том, что прошлое может отозваться в настоящем. \r\nИз-за убийства двух своих друзей главному герою приходится открыть себя тем, кто считал, что его нет в живых. Это влечет за собой новые опасности, ведь о том, что Джек жив, узнали не только союзники, но и враги. \r\nНа этот раз в руках террористов оказывается мощный нервнопаралитический газ, а президент, возможно, является участником заговора. Перед агентом становится непростая задача и на ее решение есть всего 24 часа.',5,89,'http://seasonvar.ru/serial-280-24_CHasa-5-season.html','http://cdn.bigsv.ru/oblojka/280.jpg'),(124,'Сериал 24 Часа/24  6 сезон онлайн','Сколько это двадцать четыре часа? Для обычного человека это одни сутки обычной жизни, однако для главы элитного антитеррористического подразделения ЦРУ - Джэка Бауэра это совсем мало времени. За одни сутки Джэк обязан помешать террористам убить Дэвида Палмера - кандидата в президенты США. Первой задачей Палмера сейчас - это найти крысу в своем отряде и отыскать свою похищенную дочь. Похищение ребенка чревато развалом и без того шаткой семейной жизни, что ему ждать в следующие 24 часа?... \n\n\n\n\n',6,89,'http://seasonvar.ru/serial-287-24_CHasa-6-season.html','http://cdn.bigsv.ru/oblojka/287.jpg'),(125,'Сериал 24 Часа/24  7 сезон онлайн','Чтобы предотвратить убийство высокопоставленного лица, у Джека Бауэра есть только 24 часа. Однако выясняется, что в отделе есть информатор, а похищение дочери Джека доводит его до отчаяния. Теперь под угрозой и его семейное счастье. Для начальника элитного подразделения ЦРУ нет ничего невозможного. Но справится ли Джек, ведь у него есть только сутки…',7,89,'http://seasonvar.ru/serial-306-24_CHasa-7-season.html','http://cdn.bigsv.ru/oblojka/306.jpg'),(126,'Сериал 24 Часа/24  8 сезон онлайн','Джейк Бауэр - босс одного из самых влиятельных антитеррористических подразделений в ЦРУ. Правда, ему не хватает в сутках даже 24 часов, чтобы выполнить всю работу. Он ответственен за многие дела, каждый день готовит все новые и новые преступления, которые требуют немедленного расследования и отличных результатов. За это короткое время он должен успеть сделать практически неосуществимое: предотвратить убийство кандидата в президенты Дэвида Палмера, вычислить предателя-информатора в своем отделе и отыскать похищенную девушку. Кто знает, что  для него готовят следующие 24 часа…',8,89,'http://seasonvar.ru/serial-727--24_CHasa-8-season.html','http://cdn.bigsv.ru/oblojka/727.jpg'),(127,'Сериал 24 Часа/24  9 сезон онлайн','Новый сезон захватывающего сериала «24 часа» представлен в 2014 году. История рассказывает про Джека Бауэра. Он -  борец с террористическими группировками. Герою предстоит предотвратить теракты, которые способны унести тысячи жизней людей, и нанести огромный вред природным ресурсам. В этом сезоне рассказывается отдельная история про самого героя и его жизни. Его самоотверженность и умение быстро принимать решение помогают справиться с раскрытием и предотвращением терактов. От Бауэра отвернулись все друзья, да еще и ЦРУ его преследует. Главному герою сериала \"24 часа\" предстоит поставить на карту все, чтоб осуществить свою миссию.',9,89,'http://seasonvar.ru/serial-9499-24_CHasa-9-season.html','http://cdn.bigsv.ru/oblojka/9499.jpg'),(128,'Сериал 24 часа (IN)/24  1 сезон онлайн','Терроризм уверенной поступью шагает по миру, не опасаясь никого! Теперь это проблема номер один и в Индии. В 2001 году атака на парламент в столице Нью-Дели всколыхнули общественность в первый раз. Через пять лет волнения прошли по стране после взрыва поезда в Мумбаи. В 2007 году террористы произвели несколько взрывов в Хайдерабаде. А потом вновь в Мумбаи, но уже через год. Но это только начало, которое невозможно забыть. Эти события украли покой мирных граждан, ведь государство ничего не может сделать против новых врагов. Нужно принять твердое решение, чтобы подобного больше никогда не повторилось. Правительство поставило перед собой задачу создать новую силу в борьбе против \"чумы\" 21 века. Совершенно новое Антитеррористическое подразделение готово нести службу в Индии. Глава АТП Джай Сингх Ратхор признает, что страна находится в опасности, но обещает сделать все, чтобы исправить положение.',1,90,'http://seasonvar.ru/serial-8015-24_chasa_IN-1-season.html','http://cdn.bigsv.ru/oblojka/8015.jpg'),(129,'Сериал 24 часа Ле-Мана/Le Mans: Racing Is Everything  1 сезон онлайн','Двадцать четыре часа Ле-Мана... для многих эти слова абсолютно ничего не значат, однако некоторые люди ждут это событие больше, чем собственную свадьбу. Эти люди называются любителями автоспорта. А каждый год в Ле-Мане проходит один из самых популярных заездов в истории всех гоночных серий. Отправляемся с вами во Францию, чтобы посетить знаменитую  трассу, где каждый раз собираются самые лучшие гонщики планеты. Великолепное путешествие ожидает вас по местным улочкам и по самой трассе. Мы узнаем, как именно можно попасть на автошоу, а также что именно нужно знать,чтобы насладиться этой гонкой!',1,91,'http://seasonvar.ru/serial-16014-24_chasa_Le-Mana-01-sezon.html','http://cdn.bigsv.ru/oblojka/16014.jpg'),(130,'Сериал 24 часа: Наследие/24: Legacy онлайн','Главный герой картины- Эрик Картер, который, как никто иной жаждет мира во всем мире. Он вновь вернулся домой, после долгих военных боевых событий. В каких горячих точках он только не был и чего только не видел. Теперь герой хочет побыстрее забыть обо всем и вернуться к прежней жизни, быть рядом со своей семьей и больше никогда не брать в руки оружие. Но прошлое его никак не хочет отпускать и ему вновь приходиться испытать на себе, все то , что когда, то с ним уже было. На этот раз угроза нависла над целой страной и поэтому Эрик вынужден вернуться в этот опасный мир, дабы предотвратить планы злоумышленников на террористический акт, где могут пострадать миллионы мирных граждан.',1,92,'http://seasonvar.ru/serial-15126-24chasa_nasledie-00000-sezon.html','http://cdn.bigsv.ru/oblojka/15126.jpg'),(131,'Сериал 24 часа: Япония/24 Japan онлайн','Во главе коллектива контр-террористической группы стоит Генба Шидо. Этот человек очень опытен в деле противостояния представителям преступного мира. Он умен и хорош, когда вопрос касается работы. Порой мужчине приходится принимать радикальные решения, которые могут вызывать противоречивые чувства. Ради спасения людей персонаж может жертвовать собой и своими подчиненными. Работать под давлением крайне непросто, однако Генба уверен в своих силах и всегда старается быть ответственным, когда речь касается террористической активности. Что же будет дальше в этом невероятном и захватывающем сериале? Авторы переносят зрителей в захватывающую атмосферу крупного расследования,в ходе которого представители оперативной группы продолжают разбираться с криминогенной ситуацией в стране и за её пределами. С другой стороны сюжета нам предстоит столкнуться с главой партии Минсей Урарой Асакурой. Она - ответственная и умная женщина, которая стремится отдать всю себя народу. Действуя во благо, героиня забывает порой о личной жизни. Она чем-то похожа на Шидо, но все же играет на другом поле. Это становится большой проблемой для неё, ведь вскоре, добившись успехов в политике, она станет жертвой покушения.',1,93,'http://seasonvar.ru/serial-27554-24_chasa_YAponiya.html','http://cdn.bigsv.ru/oblojka/27554.jpg'),(132,'Сериал 24/365 с BLACKPINK/24/365 with BLACKPINK онлайн','Перед зрителями разворачивается увлекательное телевизионное шоу, которое предлагает поближе познакомиться с командой BLACKPINK. Эта группа является уже давно состоявшимся коллективом, который делал большие успехи. Авторы сценария этого проекта уверены в том, что это шоу позволит девушкам вернуться на большую сцену. Конечно же, многие поклонники этого коллектива ждали их камбек. Теперь у них есть возможность погрузиться в эту невероятную атмосферу повседневных дел девушек, которые стремятся к творческому прогрессу и большим успехам. Что же их ждет в новом потрясающем шоу? Камеры следят за героинями двадцать четыре часа в день и триста шестьдесят пять дней за год!',1,94,'http://seasonvar.ru/serial-26264-24365_s_BLACKPINK.html','http://cdn.bigsv.ru/oblojka/26264.jpg'),(133,'Сериал 25-й километр онлайн','\"25-й километр\" - это увлекательная история о семье, которая поселилась в весьма своеобразном жилище. Этот дом находится между большим городом и деревней. Эдакий перевалочный пункт, где и расположились молодожены Бека и Лана. Главные герои счастливы тому, что вступили в брак. Кажется, их ждет беззаботная и счастливая жизнь вместе. Правда, каждый отношения между молодыми людьми сложились как-то стремительно и неожиданно. Вот уже полгода герои вместе и никак не могут найти место под солнцем. Казалось бы, они могут жить в родительском доме, в квартире родителей Ланы где-то в городе. Однако Бек не очень рад перспективе оказаться в большом населенном пункте. С другой стороны переезд к близким молодого человека в деревню не радует перспективами Лану. Главные герои вынуждены терпеть такие разногласия, ведь они уверены, что между ними настоящая любовь. Правда, совершенно неясно, что именно объединяет главных персонажей. Он просто обожает бокс, а она ходит по магазинам. Он любит вкусно покушать, но она не умеет готовить. Можно подобрать еще множество противоречащих их отношениям фактов, однако одно остается константой - семейная жизнь, как  ни странно, продолжает радовать героев!',1,95,'http://seasonvar.ru/serial-20794-25-j_kilometr-0-season.html','http://cdn.bigsv.ru/oblojka/20794.jpg'),(134,'Сериал 25-й час онлайн','Анна Громова  - очень смелая и отважная девушка-журналист, которая однажды спасает жизнь человека. Им оказывается внук часовщика, который в благодарность героине дарит старинные часы, обладающие невероятными, можно даже сказать, магическими свойствами. Теперь девушка может возвращаться назад во времени! Кажется, что такое умение позволит главной героине решить многие проблемы, связанные с личной жизнью и работой. Правда у часов есть одно неприятное свойство, которое не позволяет нормально использовать столь потрясающий дар! Перемещение во времени назад никак не контролируется, поэтому бедная Анна может оказаться в любом временном промежутке.',1,96,'http://seasonvar.ru/serial-14500-25-j_chas-00-sezon.html','http://cdn.bigsv.ru/oblojka/14500.jpg'),(135,'Сериал 257 причин, чтобы жить  1 сезон онлайн','Главная героиня сериала три года противостояла болезни, которая могла бы её сломить, однако не сломила. Девушка одержала победу. Женя Короткова понимала, что эта неравная битва может обернуться любым исходом, но в итоге она смогла выздороветь. Правда, с ужасом Евгения осознает, что здоровая она никому совершенно не нужна. Когда девушка болела, то все о ней заботились и пытались проводить время вместе. Как оказалось, парень Митя остался рядом с главной героиней из-за жалости, а сестра Соня не очень-то хотела проводить с ней время, занимаясь в основном лишь сборами в благотворительных фондах. Коллеги уже давно забыли о том, что у них был такой сотрудник в офисе. Кажется, что у главной героини больше нет особых причин, чтобы продолжать жить. Правда, вскоре девушка насчитывает порядка двухсот пятидесяти семи. Они все написаны в её дневнике, которые девушка хранила долгие годы, надеясь, что когда-нибудь исполнит те безумства, что описаны внутри. Героиня мечтает научиться водить машину, говорить по-испански, прыгнуть с тарзанки и, конечно же, встретить свою единственную любовь. Что же будет дальше? Сможет ли Женя все это реализовать?',1,97,'http://seasonvar.ru/serial-25328-257_prichin_chtoby_zhit_.html','http://cdn.bigsv.ru/oblojka/25328.jpg'),(136,'Сериал 257 причин, чтобы жить  2 сезон онлайн','Женя Короткова уже три года борется со страшной болезнью. Она выходит победителем из этого противостояния и чувствует, что жизнь наконец-то может наладиться. Однако самый счастливый день в жизни оказывается для девушки настоящим кошмаром, ведь она поняла, что была нужна всем только тогда, когда болела. В здоровом состоянии главная героиня отдана самой себе и, кажется, не вызывает интереса со стороны окружающих. Любимый парень Митя уже давно забыл о ней и, кажется, оставался рядом только из-за жалости. Сестра Соня вернулась к любимому занятию и продолжает собирать благотворительность, не обращая внимания на Женю. Несчастная осознала, что даже на любимой работе она уже давным-давно никому неинтересна, а многие о её существовании вообще забыли. Кажется, что выживание привело к десяткам причин, почему дальше жить вообще не стоит. Однако девушка вспоминает о заветных мечтах, о которых она писала в своем дневнике. Героиня оставляла записки о том, что хотела бы воплотить в жизни, если ей удастся выкарабкаться из лап жестокой болезни. Там много всего интересного, начиная от чего-то простого, заканчивая чем-то по-настоящему безумным и невероятным. И среди всех записей есть одна заветная: встретить свою настоящую любовь...',2,97,'http://seasonvar.ru/serial-27835-257_prichin_chtoby_zhit_-2-season.html','http://cdn.bigsv.ru/oblojka/27835.jpg'),(137,'Сериал 29 февраля/Leap Day онлайн','Главная героиня этой увлекательной дорамы из Гонконга родилась в високосный год. Неожиданная аномалия переносит девушку во времени на три года вперед. Теперь она находится в Саппоро, где встречает двадцать девятое февраля две тысячи двадцатого года. Здесь девушка сталкивается с загадочными незнакомцами. Иса узнает о том, что та погибнет в дорожном происшествии. Райан и Качунга уверены в том, что говорят, однако парни намерены сделать все возможное, чтобы предотвратить то, что кажется неотвратимым. Проект оказывается по-настоящему увлекательным и захватывающим. История обретает самые неожиданные повороты событий.',1,98,'http://seasonvar.ru/serial-26420-29_fevralya.html','http://cdn.bigsv.ru/oblojka/26420.jpg'),(138,'Сериал 3 Фунта/3 lbs.  1 сезон онлайн','Этот драматический сериал рассказывает нам о работе врачей нейрохирургов и об их нелегкой жизни. Один из героев этого сериала - нейрохирург Даглос Хенсон, который считается лучшим специалистом Нью-Йорка в этой области. У этого эксцентричного персонажа, не с самым лучшим характером, довольно простой подход к своей работе: человеческий мозг – это простая коробочка с проводками, и больной для него не имеет никакого значения. Несмотря на всё это, большинство врачей мечтают работать с ним.\n\r\nЕще один интересный персонаж – Джонатан, который ничем не уступает своими профессиональными качествами своему коллеге. Этот талантливый хирург работает благодаря протеже Хенсона, и имеет свой взгляд на то, как надо лечить своих пациентов. По его мнению, здоровье больных зависит от их психологического состояния. Несмотря на то, что Хенсон и Джонатан совсем разные по характеру и профессиональному подходу, они замечательно работают в паре, решая задачи - жизненно важные для их пациентов.',1,99,'http://seasonvar.ru/serial-3435--3_Funta.html','http://cdn.bigsv.ru/oblojka/3435.jpg'),(139,'Сериал 3-2-1 Пингвины!/3-2-1 Penguins!  1 сезон онлайн','Двум семилетним близнецам Джейсону и Мишель крупно повезло. Их игрушечные пингвины оказались живыми. И это не просто забавные черно-белые птицы. Это настоящая команда космических воинов и спасателей. Веселая четверка всегда оказывается так, где нужна помощь, даже если для этого необходимо совершить межгалактический перелет. В команду пингвинов входят: капитан Зилгель, его заместитель и одновременно пилот Мидгель, доктор Филгель и пингвиненок Кевин. У Кевина нет определенной специальности, но время от времени и он оказывается полезен. Мишель и Джейсон присоединяются к команде и помогают восстановить мир и покой во Вселенной.',1,100,'http://seasonvar.ru/serial-8825-3-2-1_Pingviny-1-season.html','http://cdn.bigsv.ru/oblojka/8825.jpg'),(140,'Сериал 30 градусов в феврале/30° i februari  1 сезон онлайн','Главные герои сериала мечтают о том, чтобы сменить место жительства. Скандинавия, конечно же, прекрасна своими пейзажами, однако погода здесь весьма сурова. Персонажи хотят переехать в теплый Таиланд, чтобы начать жизнь заново, с чистого листа. Некоторым это удается. Майлис вместе со своим супругом, который болен, отправляется в Таиланд, чтобы наконец-то узнать, что такое беззаботная жизнь в курортной стране. Здесь женщина надеется стать по-настоящему счастливой и забыть о прошлом. Однако при всем при этом героиня неожиданно сталкивается с непредвиденными сложностями. С другой стороны сюжета оказывается Гленн, который мечтает о том, чтобы завести наконец семью. В Тайланде персонаж верит, что сможет встретить вторую половинку. Кейса - мать-одиночка, которая считает, что именно в азиатской стране ей доведется найти мужчину, с которым она будет счастлива. Да и детям она мечтает подарить более яркое детство, а не то, что было в Скандинавии. Правда, вскоре герои поймут, что проблемы, сопутствовавшие им всю жизнь, почему-то решат переехать в другую страну вместе с ними.',1,101,'http://seasonvar.ru/serial-19681-30_gradusov_v_fevrale-1-season.html','http://cdn.bigsv.ru/oblojka/19681.jpg'),(141,'Сериал 30 градусов в феврале/30° i februari  2 сезон онлайн','Скандинавы любят свои земли, но суровая погода, чаще всего, сказывается на их настроении. Хмурые люди только и думают о том, чтобы променять тридцатиградусный холод на тридцатиградусную жару. Скандинавам бы на отдых в Таиланд, пока дома такая холодрыга. В центре внимания сюжета оказывается семья, где супруга пытается сделать все, чтобы наладить личную жизнь и помочь мужу, который стал для нее обузой. Больной мужчина принимает предложение супруги и отправляется вместе с ней в Таиланд. Глен - тоже посетитель этой экзотичной страны. Он очень одинок, поэтому в Таиланде мечтает встретить человека, с которым сможет построить личное счастье. Кайса в одиночку воспитывает дочерей, из-за чего испытывает большие финансовые проблемы. К тому же девушку некому поддержать, ведь после перенесенного инсульта ей становится все сложнее и сложнее справляться с детьми. Таиланд - место, где героиня мечтает забыть о прошлом и начать жизнь заново. Сериал говорит о том, что проблемы всегда последуют за тобой, как бы далеко ты не уехал. Однако справиться с этими сложностями по силам лишь тебе. Посмотрим, чем обернется эта история для главных действующих лиц второго сезона захватывающего сериала.',2,101,'http://seasonvar.ru/serial-21070-30_gradusov_v_fevrale-2-season.html','http://cdn.bigsv.ru/oblojka/21070.jpg'),(142,'Сериал 30 дней в Арктике с Вилли Хаапасало онлайн','Совершенно недавно на одном из телеканалов стартовал очень увлекательный документальный фильм, который состоит всего из десяти эпизодов. Ведущим этого фильма стал финский актер по имени Вилле Хаапасало. Этот харизматичный ведущий расскажет нам об образе северных народов, путешествуя по Северному морскому пути. Мы узнаем чуть больше об обычаях и традициях различных северных регионов, об их проблемах и трудностях бытия. А начало своего путешествия начнется на Кольском полуострове, позже нам откроются и другие виды: полуострова Ямал, Ханты-Мансийский автономный округ, Таймыр, Чукотка. Вилли с удивительной легкостью примерит на себя все образы повстречавшихся ему народов, что будет достаточно увлекательным занятием  для простого наблюдателя.',1,102,'http://seasonvar.ru/serial-15909-30_dnej_v_Arktike_s_Villi_Haapasalo.html','http://cdn.bigsv.ru/oblojka/15909.jpg'),(143,'Сериал 30 Потрясений/30 Rock  1 сезон онлайн','В команде не совсем нормальных сценаристов теперь новый начальник. Самое первое, что он делает - приглашает в шоу нового артиста, полу-сумасшедшего чернокожего юмориста. В результате на рабочем месте начинает твориться ужасный беспорядок: сценаристы сплочаются против нового шефа, новая звезда выступает против сценаристов, старые актеры недовольны всеми, а тут еще и какой-то странный секретарь Кеннет, по которому вовсе не понятно, на самом ли деле он абсолютный псих, или просто большной хитрец...',1,103,'http://seasonvar.ru/serial-438-30_Potryasenij_psdbzsj-000001-sezon.html','http://cdn.bigsv.ru/oblojka/438.jpg'),(144,'Сериал 30 Потрясений/30 Rock  2 сезон онлайн','На экране уже давно существует популярнейшие телешоу «The Girlie Show», команда которого состоит из группы нелепых неадекватных сценаристов, во главе которого стоит Лиз Лемон. У этого телевизионного шоу появляется новый босс  — Джека Донаги, и теперь вся жизнь задействованных лиц шоу совсем меняется. Джек приглашает на съемки нового актера – комика Трейси Джордана, который совсем не нравиться бывшему составу. \r\nВ итоге, на рабочем месте начинается полный хаос: сценаристы против начальства, новый актер против сценаристов, старые актеры недовольны всеми, а тут еще и непонятный секретарь Кеннет, по которому не совсем ясно, действительно ли он непролазный дебил, или на самом деле знатный хитрец…\n',2,103,'http://seasonvar.ru/serial-728--030_Potryasenij-2-sezon.html','http://cdn.bigsv.ru/oblojka/728.jpg'),(145,'Сериал 30 Потрясений/30 Rock  3 сезон онлайн','Все начинается с того, что у одного модного и знаменитого шоу в народе появляется новый босс, который решает кардинально поменять шоу. Для начала в телепередачу приглашают чернокожего комика Трейси Джордана, надеясь сделать пародию на весельчаки Мартина. Но итог всего этого разлад и не понимание. Сценаристы против «чернокожий» идеи боса, старые не желают нового подчинения, а с секретарь Кеннет это вообще загадочная личность…. Он дурак или только претворяется? ',3,103,'http://seasonvar.ru/serial-915--30_Potryasenij-3-sezon.html','http://cdn.bigsv.ru/oblojka/915.jpg'),(146,'Сериал 30 Потрясений/30 Rock  4 сезон онлайн','В этом сериале рассказывается о всей группе создателей одного известного телевизионного шоу. Лиз Лемон уже давно работает главным сценаристом этого шоу, на ее плечах лежит груз ответственности за дисциплину работников и сдачу сценариев в сроки. Но вот наступает время больших перемен, новым шефом становится Джек Донаг, он сразу берет управления всем в свои руки. Приводит странного типа, юмориста Трейси Джордана, сценаристам новенький совсем не нравится, они жалуются что у него не подходящий типаж, начинаются скандалы, актеры раздражены тем что сценаристы плохо работают, а Лиз Лемон бегает то к одним, то к другим, то к самому Джеку, дабы всех помирить и настроить на дальнейшее продолжение работы.',4,103,'http://seasonvar.ru/serial-923--30_Potryasenij-4-sezon.html','http://cdn.bigsv.ru/oblojka/923.jpg'),(147,'Сериал 30 Потрясений/30 Rock  5 сезон онлайн','C прибытием в группу к чудаковатым сценаристам ТВ-шоу «The Girlie Show» другого начальника, а именно Джека Донаги (раньше руководила на известном шоу Лиз Лемон) – всё стало иначе.  Тот сразу же поставил сниматься нового актёра – полуненормального чёрного комедианта Трейси Джордана, который чем-то походил на Мартина Лоуренса. После этих образований на шоу воцарился полный беспредел: сценаристы идут против начальника, Трейси направлен против сценаристов, а актёров уже ничто не устраивает, к тому же появился странный секретарь Кеннет, который для себя не решил, кто он есть, или глупец или хитрюга…',5,103,'http://seasonvar.ru/serial-1573--030_Potryasenij-5-sezon.html','http://cdn.bigsv.ru/oblojka/1573.jpg'),(148,'Сериал 30 Потрясений/30 Rock  6 сезон онлайн','Публика любит яркие шоу с комичными ситуациями и искрометным юмором. С виду все пристойно и гладко. Но кто знает, что творится за кулисами таких программ?\r\nК руководству одним из шоу приступает новый управляющий по имени Джек Донаги. Первым делом он «открывает новую звезду» представления. Для всех это стало потрясением. Приглашенный Трейси Джордан – афроамериканец. Да еще и его вздорный характер добавляет перца в отношения коллектива, до этого времени не отличавшиеся дружеским настроем. Наоборот, склоки и мелкие интриги здесь были в ходу.\r\nТрейси искренне считает, что он – улучшенный вариант Мартина Лоуренса, что не делает его привлекательнее для окружающих. После его появления в труппе начинаются брожения. Атмосфера недовольства давит на нервы, вынуждая сценаристов скандалить с актерами. Те, в свою очередь выражают открытое недовольство шефом.',6,103,'http://seasonvar.ru/serial-3707--30_Potryasenij-6-sezon.html','http://cdn.bigsv.ru/oblojka/3707.jpg'),(149,'Сериал 30 Потрясений/30 Rock  7 сезон онлайн','Команда сценаристов, не отличающихся высоким интеллектом, обзаводится новым боссом – Джеком Донаги. Тот приводит в теперь уже свое шоу нового актера – Трейси Джордана с весьма специфическим чувством юмора. В результате на съемочной площадке, на которой и без того царил полный хаос, начинается светопреставление. Сценаристы активно выступают против нового босса, новый комик – против сценаристов, старые актеры – против всех абсолютно. Свой вклад в этот бардак добавляет некий секретарь, чьи выходки заставляют совсем уж низко оценивать его умственные способности… ',7,103,'http://seasonvar.ru/serial-5156-Studiya_30_psxhbut-0007-sezon.html','http://cdn.bigsv.ru/oblojka/5156.jpg'),(150,'Сериал 30 случаев майора Земана/30 prípadu majora Zemana онлайн','Молодой человек, уроженец Чехословакии Ян Зееман, возвращается домой отмотав срок в концентрационном лагере. Теперь у него только одна цель - найти человека, который сделал донос на него гестаповцам. А дома его ждет неприятная новость о том, что его отца убили. Яну предстоит разыскать убийцу отца и предателя в одном лице, а поиски его приведут к сотрудникам общественной безопасности',1,104,'http://seasonvar.ru/serial-5525-30_sluchaev_majora_Zemana.html','http://cdn.bigsv.ru/oblojka/5525.jpg'),(151,'Сериал 30 шекелей в час/30 Shakh LeSha\'a  1 сезон онлайн','Главные героини этого сериала - такие разные девушки, но судьба их наградила одинаково непростыми испытаниями. Аснат - израильтянка. Ирен - русская. Амаль - арабка. Эти девушки вместе работают в офисе в городе Тел-Авив. Героини отвечают за целый этаж. Однако вскоре каждая узнает о том, что грозит увольнение. К тому же на их место уже были подобраны новые кадры. Работницы из Таиланда отлично подходят для фирмы, ведь им будут платить намного меньше, чем главным героиням. Приходится с такой несправедливость как-то бороться. Трудности заставляют главных героинь объединить усилия! У девушек созрел гениальный план!',1,105,'http://seasonvar.ru/serial-15261-30_shekelej_v_chas.html','http://cdn.bigsv.ru/oblojka/15261.jpg'),(152,'Сериал 30 шекелей в час/30 Shakh LeSha\'a  2 сезон онлайн','В центре внимания сериала оказываются судьбы трех совершенно разных женщин, каждая из которых по-своему счастлива и несчастна. Они работают уборщицами в небольшом офисном здании в Тель-Авиве. Их вполне устраивает работа. Аснат живет в Израиле уже давно, но вот русская девушка Ирен  и арабка Амаль - гости Тель-Авива. Однако руководство фирмы, где работают девушки, решило сократить расходы, наняв вместо девушек дешевую рабочую силу из Тайланда. Героини, которые не желают мириться с такой несправедливостью, готовы пойти на любые уступки, чтобы не потерять работу. Предложение доходит до руководства, которое решает пойти девушкам навстречу!',2,105,'http://seasonvar.ru/serial-15381-30_shekelej_v_chas-2-season.html','http://cdn.bigsv.ru/oblojka/15381.jpg'),(153,'Сериал 30, но 17/Seoreunijiman yeolilgopimnida онлайн','Главная героиня У Со Ри в свои семнадцать лет надеется на счастливое будущее. Она верит, что сможет стать выдающейся скрипачкой. Главная героиня обладает удивительным талантом, однако не успевает его реализовать. Главная героиня впадает в кому на тринадцать долгих лет после того, как становится участницей аварии. Тридцать лет ей стукает тогда, когда девушка приходит в себя. Близкие верили, что она выкарабкается. И вот героиня вернулась. Правда, по прежнему в душе она та самая семнадцатилетняя девчонка. Героиня вскоре встречает Кон У Джина, тридцатилетнего мужчину, который, как оказалось, перенес тринадцать лет назад серьезную психологическую травму, оставившую его тоже на эмоциональном уровне семнадцатилетнего паренька.',1,106,'http://seasonvar.ru/serial-19362-30_no_17.html','http://cdn.bigsv.ru/oblojka/19362.jpg'),(154,'Сериал 31 июня онлайн','Перед вами по-настоящему удивительный проект, который доказывает, что любовь способна существовать даже сотни лет. В центре внимания сюжета оказывается невероятная история, которая поведает об отношениях между художником, который проживает в двадцать первом веке и принцессой, жизнь которой пришлась на времена правления короля Артура. Казалось бы, как возможны такие отношения? Мужчина, работающий изо дня в день на нелюбимой работе неожиданно становится свидетелем странного видения, которым оказывается вполне реальная девушка, известная из курса истории. Средневековое волшебство позволяет главным героям встретиться снова, но теперь они думают над тем, как навсегда остаться вместе.',1,107,'http://seasonvar.ru/serial-17444-31_iyunya.html','http://cdn.bigsv.ru/oblojka/17444.jpg'),(155,'Сериал 33 квадратных метра  1 сезон онлайн','Это знакомый всем сериал о традиционной семье Звездуновых. Как всегда вы увидите интересные истории об отце Сергее, который ненавидит свою тёщу и не дождётся ее смерти. Много нового вы узнаете о неподражаемой главе семьи – Татьяне, и о ее более чем неординарном сыне Андрюше. Ну и конечно, сериал не смог обойтись без Клары Захаровны – бабушке советского времени.',1,108,'http://seasonvar.ru/serial-4598--33_kvadratnyh_metra-1-season.html','http://cdn.bigsv.ru/oblojka/4598.jpg'),(156,'Сериал 33 квадратных метра  2 сезон онлайн','Это продолжение 1 сезона сериала «33 квадратных метра». Здесь будут умопомрачительные шутки от любимых героев, все те же разногласия отца семейства и его тещи, все тот же неудачник Андрюша и защищающая его мать.. Клара Захаровна будет в своем репертуаре…',2,108,'http://seasonvar.ru/serial-4609--33_kvadratnyh_metra-2-season.html','http://cdn.bigsv.ru/oblojka/4609.jpg'),(157,'Сериал 33 квадратных метра  3 сезон онлайн','Один из самых смешных проектов на российском телевидении. Наверное, самое популярное скетч-шоу всех времен! Проект \"33 квадратных метра\" - это рассказ о повседневности простой российской семьи, которая сталкивается с многочисленными трудностями в жизни. Звездуновы постоянно борются за кусочек личного счастья, но вечно сталкиваются с комичными и странными ситуациями, генерируемыми самими персонажами или же каким-то знакомыми. В центре внимания сюжета оказываются Сергей и Татьяна, которые вынуждены терпеть в браке друг друга, а также решать вопросы, связанные с остальными надоедливыми и не всегда довольными родственниками.',3,108,'http://seasonvar.ru/serial-4610--33_kvadratnyh_metra-3-season.html','http://cdn.bigsv.ru/oblojka/4610.jpg'),(158,'Сериал 33 квадратных метра  4 сезон онлайн','В сериале идет речь об одной семье, которая во многом похожа на огромное количество других ячеек общества, но не существует двух семей, которые были бы абсолютно одинаковыми, - каждая чем-то отличается от других. Наша же семья отличается много чем.\r\nТак вот, состоит семейство из четверых человек: Сергей, Татьяна – его жена, их сын Андрей и мама Татьяны Клара Захаровна. Каждый член семьи имеет очень своеобразный нрав, и уживаться им всем вместе довольно трудно. \r\nКлара Захаровна – убежденная коммунистка, которая категорически не одобряет образ жизни молодежи, в частности, Андрея. Молодежь, в свою очередь, не разделяет ее убеждений.\r\nВ целом же, жизнь их семьи довольно интересна, и наблюдать за ней – огромное удовольствие.',4,108,'http://seasonvar.ru/serial-4611--33_kvadratnyh_metra-4-season.html','http://cdn.bigsv.ru/oblojka/4611.jpg'),(159,'Сериал 35 дней/35 Diwrnod  1 сезон онлайн','Джен Ричардс могла бы быть счастливой обладательнице шикарного особняка на окраине города. Она была счастлива переехать сюда тридцать пять дней тому назад. Правда, счастье длилось недолго, так как теперь её бездыханное тело лежит на холодном полу этого прекрасного дома. Что же произошло? Зрителей ожидает волнительный рассказ о тридцати пяти днях, которые только ждут главную героиню. В этот месяц с небольшим уложится история, которая приведёт женщину к роковому концу, но то, что произошло на самом деле шокирует многих. Как Джен решилась на покупку этого дома? Чем она занималась в его стенах? Как встретила свою смерть?',1,109,'http://seasonvar.ru/serial-25952-35_dnej-1-season.html','http://cdn.bigsv.ru/oblojka/25952.jpg'),(160,'Сериал 35 дней/35 Diwrnod  2 сезон онлайн','Телепроект \"35 дней\" знакомит зрителей с главной героиней Джен Ричардс. Однако встреча окажется не такой яркой и многообещающей, какой можно было бы её представить, ведь мы обнаружим героиню в собственном особняке убитой. Когда-то она купила его в надежде на лучшее будущее, однако теперь лежит бездыханная на холодном полу некогда желанного дома. Авторы начинают свой рассказ с событий за тридцать пять дней до происшествия. Мы узнаем о том, что стало причиной , приведшей к этой гибели. Возможно, в деле замешаны третьи силы, о которых мы ничего пока что не знаем, однако никто не исключает факта несчастного случая.',2,109,'http://seasonvar.ru/serial-25971-35_dnej-2-season.html','http://cdn.bigsv.ru/oblojka/25971.jpg'),(161,'Сериал 35 дней/35 Diwrnod  3 сезон онлайн','Третий сезон захватывающего и запутанного сериала \"Тридцать пять дней\" продолжает историю, взявшую свое начало в первом эпизоде стартового сезона. Авторы показали зрителям бездыханное тело Джен Ричардс. Убитая женщина была найдена в собственном же шикарном особняке. Сюда она переехала буквально недавно. Тридцать пять дней тому назад героиня покупала это жилище в надежде, что сможет стать здесь по-настоящему счастливой. С того самого момента женщина пережила многое. Проект рассказывает о том, что предшествовало её гибели и как так сложилось, что беда пришла в новый дом Джен Ричардс.',3,109,'http://seasonvar.ru/serial-25980-35_dnej-3-season.html','http://cdn.bigsv.ru/oblojka/25980.jpg'),(162,'Сериал 35 дней/35 Diwrnod  4 сезон онлайн','Тридцать пять дней тому назад жизнь Джен Ричардс казалась безупречной. Главная героиня была счастлива, когда купила особняк на окраине города. Казалось бы, здесь наконец-то жизнь пойдёт как по маслу. Правда, все оказалось совершенно иначе. За эти тридцать пять дней произошло предостаточно самых невероятных поворотов событий. Авторы сценария рассказывают зрителям о жизни Джен в новом доме, чтобы прийти к событиям настоящего времени. А что же происходит сейчас? Зрители наблюдают тело главной героине, бездыханно лежащее на холодном полу её особняка. Что же произошло на самом деле?',4,109,'http://seasonvar.ru/serial-25994-35_dnej-4-season.html','http://cdn.bigsv.ru/oblojka/25994.jpg'),(163,'Сериал 35 дней/35 Diwrnod  5 сезон онлайн','Пятый сезон захватывающего детективно-драматического сериала \"Тридцать пять дней\". Сюжет первого сезона начался с кадров в шикарном особняке, где на холодном полу лежало бездыханное тело Джен Ричардс. Несчастная погибла, но что именно произошло - неизвестно. Главная героиня купила этот прекрасный особняк ровно тридцать пять дней назад. Надеясь на то, что здесь ей удастся наконец-то стать счастливой  и успешной, женщина верила в себя и продолжала жить так, как ей хочется. Правда, все это привело к печальным последствиям, которые в итоге вылились в смерть. Что же произошло на самом деле?',5,109,'http://seasonvar.ru/serial-25998-35_dnej-5-season.html','http://cdn.bigsv.ru/oblojka/25998.jpg'),(164,'Сериал 35-летняя девочка/35-Year-Old Girl онлайн','Имамуре Нозоми было всего лишь десять лет, когда она в тысяча девятьсот девяносто пятом году впала в кому после печальной аварии. Мало кто верил, что когда-нибудь героиня придёт в себя, ведь даже спустя еще десять лет она продолжила находиться на искусственном поддержании жизни. Лишь в две тысячи двадцатом году в возрасте уже тридцати пяти лет она открывает глаза. Несмотря на столь серьезный возраст, Имамура осталась десятилетней девчонкой, которой была до аварии. Вокруг неё мир изменился до неузнаваемости. Девушка будто бы попала в совершенно иное будущее, о котором даже подумать не могла. Одним из первых узнает о пробуждении героини Юто. Этот мужчина работает в школе учителем начальных классов. Двадцать лет тому назад он был лучшим другом героини, которая считала, что влюблена в него. Встреча с Нозоми спустя долгое время расставания изменит характер высокомерного, но очень трусливого персонажа.',1,110,'http://seasonvar.ru/serial-27638-35-letnyaya_devochka.html','http://cdn.bigsv.ru/oblojka/27638.jpg'),(165,'Сериал 35ый отряд Антимагической академии/Taimadou Gakuen 35 Shiken Shoutai  1 сезон онлайн','Как многие уже догадались, речь в японском анимационном сериале \"35ый отряд Антимагической академии\" пойдет об одном из отделов, который входит в \"Антимагическую академию\". Эта академия была специально создана для особой цели, сделать из своих учеников настоящих бойцов, которые будут заниматься инквизицией. Ученики этого экспериментального подразделения готовы разрешить разной сложности магические атаки. Название \"35ый отряд Антимагической академии\" звучит солидно и сразу же кажется, что сотрудники здесь высококвалифицированные профессионалы... Но это лишь так кажется, ведь вместо профессионалов здесь люди, для которых важен их внутренний мир, которые даже не могут прийти к компромиссу...',1,111,'http://seasonvar.ru/serial-12551-35yj_otryad_Antimagicheskoj_akademii-1-season.html','http://cdn.bigsv.ru/oblojka/12551.jpg'),(166,'Сериал 37 дней/37 Days онлайн','Вашему вниманию представлен мини –сериал, посвященный последним неделям мирной жизни, предшествующим началу Первой мировой войны, охватившей европейский континент и разворачивающимся в эти дни интригам в политическом мире. События истории берут свое начало 28 июня 1914 года. Этот день начинался как самый обычный и не предвещал никаких потрясений. Но именно в этот день сэру Эдварду Грею, возглавляющему внешнеполитическое ведомство Британии, стало известно о том, что убит на Балканах Франц Фердинанд – австрийский эрцгерцог. Также о произошедшем стало известно и Вильгельму II, кайзеру Германии. Он принял решение, что Сараевскую трагедию использует в личных целях.',1,112,'http://seasonvar.ru/serial-16096-37_dnej.html','http://cdn.bigsv.ru/oblojka/16096.jpg'),(167,'Сериал 38 обезьян/Monkey Dust  1 сезон онлайн','38 обезьян - короткие сюжеты, посвященные обитателям крупного города, которые постепенно сходят с ума или просто типы с неуравновешенной психикой - невротики, извращенцы, маньяки, террористы. Все эти общественные элементы живут недалеко друг от друга, и сами про себя они наилучшего мнения. В сериале идет высмеивание не совсем типичных представлений о вере, антисемитизме, семье, арабском терроризме, и прочих негативных элементах и явлениях.',1,113,'http://seasonvar.ru/serial-3282--38_obez_yan.html','http://cdn.bigsv.ru/oblojka/3282.jpg'),(168,'Сериал 38 обезьян/Monkey Dust  2 сезон онлайн','38 обезьян - небольшие зарисовки из жизни нелицеприятных личностей мегаполиса, которые не вполне нормальны с точки зрения простых обывателей, это маньяки, убийцы, извращенцы, психи. Все они проживают в непосредственной близости друг от друга, и уверены в том, что они самые, что ни на есть нормальные. Этот сериал - своеобразный взгляд на этих личностей, порожденных городской жизнью. По фильму идет осмеяние такого не совсем правомерного образа жизни, как то антисемитизм, терроризм и прочие подобные явления.',2,113,'http://seasonvar.ru/serial-3283--38_obez_yan-2-season.html','http://cdn.bigsv.ru/oblojka/3283.jpg'),(169,'Сериал 38 обезьян/Monkey Dust  3 сезон онлайн','38 обезьян - короткие комедийные сценки, где собраны весьма интересные персонажи, проживающие в одном городе, на соседних улицах. Это лица с подорванной психикой, медленно, но верно сходящие с ума: маньяки, психи, убийцы, террористы и другие подобные личности, которые, кстати, сами про себя никогда не могут сказать ничего плохого. Это фильм-взгляд на изгоев, выброшенных из обычной жизни людей, которым, наверное, уже никогда не вернуться к нормальному образу жизни, но все это преподносится в весьма легкой форме.',3,113,'http://seasonvar.ru/serial-3284--38_obez_yan-3-season.html','http://cdn.bigsv.ru/oblojka/3284.jpg'),(170,'Сериал 3А класс, с этого момента вы в заложниках/3 Nen A Kumi -Ima kara Mina-san wa, Hitojichi Desu онлайн','Главный персонаж Хиираги Ибуки работает преподавателем в школе. Он посвящает своих учеников  в искусство. Главный персонаж не так давно обрел новый статус - теперь он руководит классом. 3А - весьма интересная группа. За десять дней до выпуска главный персонаж решает устроить переполох для своих подопечных. Он сообщает тем, что теперь они находятся у него в заложниках. Что вообще происходит? Слишком много вопросов и совсем нет никаких ответов. Главные персонажи собираются сделать всё возможное, чтобы вырваться из этого плена, однако все куда сложнее, чем кажется. Нам же предстоит наблюдать за всем этим со стороны.',1,114,'http://seasonvar.ru/serial-29600-3A_klass_s_etogo_momenta_vy_v_zalozhnikah.html','http://cdn.bigsv.ru/oblojka/29600.jpg'),(171,'Сериал 4 дома/4 Types of House онлайн','История рассказывает о некогда популярном Сонмине, который сейчас из-за многочисленных неприятностей вынужден каким-то образом выживать в одиночку. Из айдол группы парнишка ушел, но поклонники его не забыли. Правда, вспоминают его чаще злым словом, ведь последние события подпортили репутацию Сонмину. Парень поселяется в квартиру с другими жителями, где ему предстоит делить помещение  с тремя незнакомцами. Кто бы мог подумать, что именно эти печальные перемены сделают главному герою огромный зачин на начало настоящей жизни! Здесь Сонмин найдет свою любовь, познает, что такое дружба, а также разберется с вопросом о смысле жизни.',1,115,'http://seasonvar.ru/serial-20465-4_doma-0-season.html','http://cdn.bigsv.ru/oblojka/20465.jpg'),(172,'Сериал 4 квартала/4 blocks  1 сезон онлайн','Тони является двойным агентом. Он работает под прикрытием, выслеживая группировки арабских бандитов в Берлине. Главный герой мечтает когда-нибудь завязать со столь непростой работой, однако уходить просто так из опасной профессии не удавалось еще никому. Главный герой оказывается в Нойкёльне, где наконец-то устраивает личную жизнь. Семья выходит на первый план, поэтому Тони счастлив такому повороту событий. Правда, он даже не мог подозревать о том, что прошлое будет так настойчиво стучаться в дверь. Главный герой, как оказалось, не ушел из дела. О нем помнят как в службах безопасности, так и в криминальном мире.',1,116,'http://seasonvar.ru/serial-17615-4_kvartala-000001-sezon.html','http://cdn.bigsv.ru/oblojka/17615.jpg'),(173,'Сериал 4 квартала/4 blocks  2 сезон онлайн','С момента окончания первого сезона прошел уже год. Трагические разборки в одном из байкерских клубов повлияли на жизнь представителей группы Хамади. Один из видных представителей клана Аббас теперь сидит на скамье подсудимых, Амара оказывается на судьбоносном перепутье вместе с Лафитом, а Тони, как и всегда мечтал, занялся личным делом, зарабатывая деньги продажей недвижимости. Он понимает, что работе необходимо отдавать все силы, поэтому приходится рисковать не только личным временем, но и семьей. Вскоре Тони решается на расширение бизнеса, чем ставит под угрозу близких людей, ведь ему теперь противостоит клан Аль-Сафи.',2,116,'http://seasonvar.ru/serial-20466-4_kvartala--002--sezon.html','http://cdn.bigsv.ru/oblojka/20466.jpg'),(174,'Сериал 4 квартала/4 blocks  3 сезон онлайн','Сюжет третьего сезона сериала \"4 квартала\" повествует о главном герое Тони. Он - один из выдающихся агентов, который способен работать под прикрытием, исполняя самые сложные задачи. Главный герой сталкивается каждый раз с опасными бандитами, стараясь их обезвредить, будучи подставной личностью с прописанной легендой и надуманным прошлым. Однако вскоре ему это надоест. Он считает, что пора бы уделить время не только работе, но и семье. Главный герой бросает любимую работу, чтобы чаще бывать с близкими. Кто бы мог подумать, что последняя, подобно ревнивой супруге, не отпустит просто так.',3,116,'http://seasonvar.ru/serial-24020-4_kvartala--3-season.html','http://cdn.bigsv.ru/oblojka/24020.jpg'),(175,'Сериал 4 минуты бархатцев/Marigold in 4 minutes онлайн','Главному персонажу этого сериала Микото стукнуло двадцать пять лет. Он живёт вместе с родными братьями  и одной сестрой. Молодые люди постоянно общаются друг с другом и находят все новые и новые способны хорошо совместно проводить время. Кто бы мог подумать, что к Саре Микото привяжется больше всего. Главный персонаж уже жизни не представляет без своей сестры. Правда, вскоре парень узнает о том,что той осталось жить всего лишь год. У Микото есть особое умение, благодаря которому молодой человек способен увидеть последние минуты жизни человека. Теперь главный герой постарается всеми силами предотвратить печальное событие.',1,117,'http://seasonvar.ru/serial-24255-4_minuty_barhattcev.html','http://cdn.bigsv.ru/oblojka/24255.jpg'),(176,'Сериал 40+ или Геометрия любви  1 сезон онлайн','Главные героини этого сериала решили нагадать себе на красивую и счастливую жизнь. У подруг все получилось. Теперь Маша, Алина и Таня только и ждут того, чтобы получить счастье прямо в руки. Правда, счастье получается какое-то странное. Одна из девушек достигает небывалых высот в карьере, но все равно остается одинокой. К тому же Маша же никак не может оправиться от предательства первой любви. Алина же считает, что ее семейная жизнь превратилась в настоящий кошмар, ведь отношения с мужем складываются хуже некуда. Встреча с другим женатым мужчиной переворачивает ее жизнь. Татьяна же считает себя счастливой в браке, но все равно скрывает что-то, что может навредить семье.',1,118,'http://seasonvar.ru/serial-14910-40_ili_Geometriya_lyubvi.html','http://cdn.bigsv.ru/oblojka/14910.jpg'),(177,'Сериал 44 котенка/44 Gatti онлайн','Этот забавный мультсериал познакомит зрителей с четверкой милых котяток. Лампо, Пилоу, Миледи и Полетта - жизнерадостные пушистики, которые обитают среди людей. Когда на них обращают внимание, герои становятся все более и более добрыми и приветливыми. Правда, мало кто догадывается о том, чем именно промышляет этот дружный квартет. Как оказалось, главные персонажи - верные друзья, которые всегда с радостью берутся за решение чужих проблем. Лампо, Пилоу, Миледи и Полетта стремятся помогать другим кошкам и котам, которые попадают в трудную ситуацию, а такие случаются довольно часто. Бескорыстная помощь и настоящая дружба и любовь - вот, что действительно способно сделать мир чуточку лучше. Главные действующие лица это понимают, поэтому не собираются останавливаться, заряжаясь все большим энтузиазмом. Приятного просмотра всем поклонникам весёлых мультсериалов!',1,119,'http://seasonvar.ru/serial-24687-44_kotnka.html','http://cdn.bigsv.ru/oblojka/24687.jpg'),(178,'Сериал 4400/The 4400  1 сезон онлайн','Внезапно на землю возвращаются 4400 человек, которые пропали без вести в середине двадцатого века, однако возраст их остался тем же, что был на момент исчезновения. На вопрос где всё это время находились люди никто ответить не смог. Правительство начинает расследование, в ходе которого выясняется, что внезапное появление людей примет решающую и неожиданную роль в судьбе всего мира...',1,120,'http://seasonvar.ru/serial-1-4400-1-season.html','http://cdn.bigsv.ru/oblojka/1.jpg'),(179,'Сериал 4400/The 4400  2 сезон онлайн','Неожиданное возвращение на землю 4 400 человек, пропавших без вести в середине двадцатого века, вызывает множество вопросов со стороны властей. Не получив вразумительного ответа, правительство организовывает собственное расследование, дабы выяснить причину массового исчезновения. Главной загадкой происходящего, является возраст возвращенных - они вернулись в том же возрасте, какими были на момент исчезновения. Но никто даже не догадывается о миссии этих людей...',2,120,'http://seasonvar.ru/serial-2-4400-2-season.html','http://cdn.bigsv.ru/oblojka/2.jpg'),(180,'Сериал 4400/The 4400  3 сезон онлайн','Правительство озабочено внезапным появлением 4400 людей, пропавших в двадцатом веке. Власти начинают расследование с целью выяснения причин массового исчезновения. Главной загадкой остается возраст людей, который остался неизменным. Однако никто не может даже предположить о том, какая роль отведена возвращенным...',3,120,'http://seasonvar.ru/serial-3-4400-3-season.html','http://cdn.bigsv.ru/oblojka/3.jpg'),(181,'Сериал 4400/The 4400  4 сезон онлайн','Ещё в далёкие годы двадцатого столетия произошло невероятное событие – бесследно исчезли 4400 человек. \r\nКазалось бы, загадочная массовая пропажа людей феноменальна сама по себе, но внезапно происходит ещё более удивительное происшествие! Уже в наши дни исчезнувшие неожиданно возвращаются, как ни в чём не бывало. Более того – их возраст остался прежним, таким же, каким был на момент исчезновения.\r\nСпецслужбы берутся за расследование. Но чтобы понять, откуда и почему загадочные «пришельцы» из прошлого вернулись, надо разобраться, как и куда они испарились много лет назад. \r\nФакты и детали, с которыми столкнутся герои в ходе решения этой непростой загадки, говорят о том, что случившееся имеет более глобальные масштабы, чем может показаться на первый взгляд.',4,120,'http://seasonvar.ru/serial-4-4400-4-season.html','http://cdn.bigsv.ru/oblojka/4.jpg'),(182,'Сериал 45 революций/45 Revoluciones онлайн','Испанский сериал, который рассказывает зрителям о создании популярного музыкального лейбла. В центре внимания сюжета оказываются трое талантливых исполнителей, настоящих талантов, чьи работы могут изменить мир. Главные действующие лица борются за возможность принести аудитории своё видение происходящего вокруг и, кажется, им это удаётся отлично. Музыкальные композиции персонажей набирают популярность, а имена героев становятся известны всей Испании. Впереди их ждёт немало работы над собой, однако мечта уже совсем рядом, а создание музыкального лейбла всего в одном шаге.',1,121,'http://seasonvar.ru/serial-21863-45_revolyutcij.html','http://cdn.bigsv.ru/oblojka/21863.jpg'),(183,'Сериал 45 секунд онлайн','Представляем вашему вниманию остросюжетную мелодраматическую историю о людях, которые считают себя интеллигенцией и ведут соответствующий образ жизни. Они затерялись где-то в городской пучине, однако жизни хватит каких-то сорока пяти секунд, чтобы изменить их повседневность раз и навсегда. Главные действующие лица же не успеют понять, что на самом деле произошло, однако истина окажется как никогда близко. В центре внимания сюжета - Татьяна Чернигова. Женщина занимается серьёзным бизнесом. К тому же героиня - альпинистка, которая привыкла к рискованным действиям и непростым задачам. Правда, ей приходится переживать непростую семейную драму, которая может решить исход её личной жизни: девушка постоянно конфликтует с мужем из-за проблем с зачатием ребёнка и родами. Правда, на фоне печальных личных событий женщина оказывается вплетена ещё и в сложную криминальную историю, которая разворачивается настоящей трагедией для Татьяны. Самая серьёзная проблема в  том, что женщина является виновницей того, что произошло на глазах десятков людей. Что же будет дальше? Неужели счастливая жизнь главной героини закончится в этот печальный момент?',1,122,'http://seasonvar.ru/serial-22939-45_sekund_psjuxsd.html','http://cdn.bigsv.ru/oblojka/22939.jpg'),(184,'Сериал 46 исчезнувших/46 Yok Olan онлайн','Главный герой Мурат Гиней должен быть счастлив, ведь у него есть все: семья, перспективы на будущее, финансовая стабильность. Однако все круто меняется, когда главный герой становится свидетелем убийства собственного отца. Жестокая расправа над одним из лучших хирургов города и близким человеком Мурата становится поворотным моментом в жизни персонажа. Ему приходится взять на себя заботы о семье и думать о плане мести. Младшая сестра Мурата, видевшая то, что видел ее брат, после инцидента замкнулась в себе, а после впала в кому. Главный герой решает заняться наукой, чтобы найти способ вернуть сестру к нормальной жизни. Спустя несколько лет мужчина оказывается близок к изобретению необходимого препарата.Однако вскоре его ждет очередное потрясение и новый поворот истории. Готов ли к такому Мурат?',1,123,'http://seasonvar.ru/serial-20314-46_ischeznuvshih_pswybag-0-season.html','http://cdn.bigsv.ru/oblojka/20314.jpg'),(185,'Сериал 49 дней/49 days онлайн','Задумывалась ли Син Чжи о том, что ее окружающие мелочные и жестокие, и ей трудно будет найти по-настоящему любящих ее людей? Обо всем этом девушка узнала, попав в тяжелую жизненную ситуацию.\r\nДочь очень богатых родителей, имеющая все, что ей захочется, а также близких подруг и молодого человека, попадает в страшную аварию и оказывается в коме. Но ее время умирать еще не пришло, и девушка находится между двумя мирами. Потусторонние силы предлагают Син Чжи вернуться в прошлую жизнь, но для этого она должна найти людей, любящих ее по-настоящему и скорбящих по потере подруги.\r\nВот тут и открывается настоящая правда, оказалось, что таких людей, которые способны помочь героине вернуться в этот мир, совсем немного. Остается только надеяться, что у нее все получится.',1,124,'http://seasonvar.ru/serial-5893-49_dnej.html','http://cdn.bigsv.ru/oblojka/5893.jpg'),(186,'Сериал 50 квадратных метров/50 M2 онлайн','Сериал рассказывает о приключении преступника, который долгое время контактировал с мафией, однако теперь навел на себя ненависть представителей высших кругов преступного сообщества. Мужчина считает необходимым прятаться в небольшом ателье в одном из районов родного Стамбула. Жители этого квартала считают, что новенький - сын недавно умершего начальника этого заведения, а сам молодой человек, понимая, что это единственная возможность зацепиться за хоть какую-то легенду, отыгрывает свою роль. Зрителей ожидает не сложносочиненная и напряженная криминальная драма, а классический ситком с захватывающими событиями.',1,125,'http://seasonvar.ru/serial-28518-50_kvadratnyh_metrov.html','http://cdn.bigsv.ru/oblojka/28518.jpg'),(187,'Сериал 50 оттенков страха/50 States Of Fright  1 сезон онлайн','Сэм Рэйми представляет нашему вниманию удивительную и пугающую до мурашек историю-антологию, которая заставит зрителей визжать от страха и прикрывать лицо любыми подручными предметами, дабы не видеть того ужаса, что происходит перед ними на экране. А ведь у автора действительно есть немало возможностей нас испугать. Антология предлагает окунуться в экранизацию самых известных и не очень городских легенд Америки. Среди историй, рассказанных местными жителями, немало тех, которые действительно способны испугать ни на шутку. Это хоррор-приключения по самым известным штатам, начиная от Колорадо и Флориды, заканчивая Орегоном и Вашингтоном.',1,126,'http://seasonvar.ru/serial-25278-50_ottenkov_straha_psgzlrk.html','http://cdn.bigsv.ru/oblojka/25278.jpg'),(188,'Сериал 50 оттенков страха/50 States Of Fright  2 сезон онлайн','Со вторым сезоном возвращается телевизионный проект \"Пятьдесят оттенков страха\". Картина от продюсера Сэма Рэйми уже успела поразить зрителей своей оригинальной концепцией и интересной интерпретации ужаса. Истории, представленные здесь, пытаются добраться до самых потаенных стразов своих зрителей, затрагивая тему безмолвного ужаса, преследующего кошмара и непонимания происходящего, чтобы сделать эффект присутствия еще сильнее. Сериал \"Пятьдесят оттенков страха\" - это прекрасная работа, которая придется по душе поклонникам хоррор-жанра, истосковавшихся по крутым представителям жанра. Новый эпизод. Новый город. Новый монстр. И, быть может, этот монстр далеко не тот, за кого себя выдает...',2,126,'http://seasonvar.ru/serial-27357-50_ottenkov_straha_pstucjp-2-season.html','http://cdn.bigsv.ru/oblojka/27357.jpg'),(189,'Сериал 50 Централ/50 Central онлайн','Перед вами новый комедийный сериал, который представляет из себя уникальную попытку известного рэпера Кертиса Джексона выступить в качестве продюсера, режиссера и актера. Главный герой этого проекта сыгран самим исполнителем, которого многие в широких кругах знают как 50 cent. Персонаж оказывается в кругу людей, которые стремятся попасть в шоу-бизнес. Они - будущие комики, желающие славы и признания. Однако среди них Джексон выглядит как-то странно и неуютно. Правда, свою долю юмора главный герой, конечно же, выдает. Посмотрим, что получилось в дебютном проекте у известного рэп-исполнителя.',1,127,'http://seasonvar.ru/serial-17057--050_TCentral-0-sezon.html','http://cdn.bigsv.ru/oblojka/17057.jpg'),(190,'Сериал 500 наций/500 Nations онлайн','В этом историческом кинопроекте зрителю станет известно, а что же было на территориях Северной Америки и Центральной, пока не вторгся в эти пространства мореплаватель Колумб? Каким образом развивалась культура этноса на этих территориях, в то время как Европа была настроена всевозможными способами завоевать всё больше и больше колоний? Какой была жизнь индейцев, пока их не выгнали из Северной Америки, чем они занимались и к чему стремились? На эти и большое количество других вопросов вы сможете получить ответы в удивительном проекте американского производства под названием «500 наций».',1,128,'http://seasonvar.ru/serial-8945-500_natcij.html','http://cdn.bigsv.ru/oblojka/8945.jpg'),(191,'Сериал 54 часа/Gladbeck онлайн','\"Пятьдесят четыре часа\" - проект, основанный на реальных событиях. Эта история показывает насколько губительной может оказаться ошибка, совершенная средствами массовой информации и полицией при проведении важнейших операций. Главные действующие лица этого сериала - люди, бросившиеся на спасение заложников. Они действуют так, как должны действовать представители их профессиональной сферы, однако огромное количество ошибок, совершенное на этапе подготовки, не позволило главным героям выполнить свою работу на высоком уровне. К чему это привело? Общественное порицание и массовые беспорядки,призванные ответить за некомпетентность органов власти и массовой информации. Проект отсылает зрителей в восемьдесят восьмой год прошлого века. Именно тогда произошла эта печальная история, потрясшая всю Германию.',1,129,'http://seasonvar.ru/serial-21041-54_chasa-0-season.html','http://cdn.bigsv.ru/oblojka/21041.jpg'),(192,'Сериал 555 онлайн','Три пятерки. Загадочная комбинация цифр,которая чаще всего используется мошенниками и просто нехорошими людьми, которые пытаются выйти на связь с кем-либо. Эти фальшивые телефоны с трудом отслеживаются и нередко оказываются опасным оружием в руках преступника. Перед вами проект, снятый в стиле известного  сериала \"Черное зеркало\". \"Три пятерки\" рассказывают о темных тайнах жизни Голливуда, используя в сюжете элементы сюрра и черной комедии. Сатирический и ироничный рассказ с поддевкой о жизни звезд мирового и местного масштаба, оказавшаяся на передовицах газет в одной из самых позорных рубрик.',1,130,'http://seasonvar.ru/serial-19239-555.html','http://cdn.bigsv.ru/oblojka/19239.jpg'),(193,'Сериал 5baksiv.net  1 сезон онлайн','Огромное множество телесериалов в современном мире охватывает жизнь подростков и молодежи. Но сериалы продолжают снимать, и актуальность их только возрастает. Недавно на телеэкраны вышел новый, первый украинский телесериал  с оригинальным названием «5baksiv.net». Сериал рассказывает о жизни молодежи, где подробно осветят все проблемы их не легкой современной жизни, и их не большие радости, дискотеки, достижение целей и многое другое. Так же затронут курсы валют, их падение и повышение.\r\nВ главных ролях два парня - Макс и Зеник, которые идут на поводу у своего одноклассника, и даже не могут себе представить, что же может с ними случиться. И вы это сможете узнать посмотрев первый украинский вэб сериал «5baksiv.net».',1,131,'http://seasonvar.ru/serial-12840-5baksivnet-1-season.html','http://cdn.bigsv.ru/oblojka/12840.jpg'),(194,'Сериал 6 кадров  1 сезон онлайн','Что такое «Шесть кадров»? Вы еще ни разу не видели этот суперпроект, в котором разыгрываются анекдоты, миникомедии, миниистории? Тогда вы многое потеряли! «Шесть кадров» - это шесть актеров, которые покажут, что не только М.Галустян и С.Светлаков умеют делать скетч-шоу, что есть и другие талантливые актеры комедийного жанра на нашей сцене. «Шесть кадров» смогут поднять вам даже самое плохое настроение, поверьте, вы останетесь по-настоящему довольны, ведь вас будут смешить профессионалы!',1,132,'http://seasonvar.ru/serial-1268--6_kadrov-1-season.html','http://cdn.bigsv.ru/oblojka/1268.jpg'),(195,'Сериал 6 кадров  2 сезон онлайн','Я лично никогда не пропускаю «Шесть кадров». Ребята так легко, так талантливо играют, что оторваться от них просто невозможно. Кстати, у большинства актеров после этого сетч-шоу карьера пошла, как говорится, в гору и они стали приглашаться в кино уже не на роли 6-го милиционера в оцеплении и 5 трупа бандита, а на полноценные роли второго плана и даже на главные. Каждый выпуск – это полчаса юмора и смеха, которые просто нельзя пропустить, какие бы интересные сериалы не шли бы по другим каналам!',2,132,'http://seasonvar.ru/serial-1277--6_kadrov-2-season.html','http://cdn.bigsv.ru/oblojka/1277.jpg'),(196,'Сериал 6 кадров  3 сезон онлайн','Третий сезон «Шести кадров» не разочаровал поклонников, как это часто бывает с проектами, которые идут слишком долго. Наоборот, актеры видно отдохнули, набрались сил, сюжетов, поэтому не было даже «проходной» работы! Все просто замечательно – яркие типажи, образы, постановки, новые и уже полюбившиеся образы! Поверьте, это пропустить нельзя и я просто рекомендую всем поклонникам хорошего юмора пересмотреть эту часть «Шести кадров», еще спасибо скажете!',3,132,'http://seasonvar.ru/serial-1284--6_kadrov-3-season.html','http://cdn.bigsv.ru/oblojka/1284.jpg'),(197,'Сериал 6 кадров  4 сезон онлайн','Шестеро превосходных актеров снимаются в этой комедии положений не первый сезон. Они играют сцены из повседневной жизни обычных людей. Они делают это так искрометно и с таким непревзойденным чувством юмора, что даже самый серьезный человек улыбнется.\r\nВ героях можно узнать соседа, коллегу или даже себя. Жизненность всех эпизодов добавляет интереса. Ведь мы все порой оказываемся в комичных ситуациях в магазинах, госучреждениях или просто на улице. Ребята подмечают именно злободневные сцены и отражают их в комедийном сериале. Ко всему нужно относиться с юмором, тогда жизнь станет проще и веселей – это самое главное. Не идти на поводу у серых будней – вот главная задача сериала и актеров.',4,132,'http://seasonvar.ru/serial-1290--6_kadrov-4-season.html','http://cdn.bigsv.ru/oblojka/1290.jpg'),(198,'Сериал 6 кадров  5 сезон онлайн','Шесть актёров виртуозно организуют маленькие комедии. Для этих ребят такая работа и есть жизнь. Миникомедии с не предсказуемым завершением – это самое дорогое для них. Многие уверены, что стоящую шутку придумать невозможно, что они возникают сами по себе. Но это не так. Эта шестёрка покажет вам, что такое настоящая шутка. Каждая серия будет приятно вас удивлять, веселить и радовать.',5,132,'http://seasonvar.ru/serial-1296--6_kadrov-5-season.html','http://cdn.bigsv.ru/oblojka/1296.jpg'),(199,'Сериал 6 кадров  6 сезон онлайн','В сериале «6 кадров», нам рассказывают о шести великолепных актёрах, которые мастерски разыгрывают разные миниатюрные комедии с очень неожиданным концом. Возможно, что актёры, сами уверены в том, что вся жизнь – скетч-шоу. Даже, когда разные злые языки всё время твердят, что невозможно придумать смешную шутку, они ошибаются. Возможно, ещё и как! В каждом новом выпуске «6 кадров» нам показывают, как любую жизненную ситуация, можно непринуждённо и весело обыграть.',6,132,'http://seasonvar.ru/serial-1930--6_kadrov-6-season.html','http://cdn.bigsv.ru/oblojka/1930.jpg'),(200,'Сериал 68 Виски/68 Whiskey онлайн','Сюжет сериала \"68 Виски\" рассказывает зрителям о военных медиках, которые оказались на специальной базе \"Приют\". Она расположена в Афганистане, в горячей точке, где всегда требуется поддержка извне. Главные действующие лица этого проекта - восемь мужчин и восемь женщин. Они не похожи друг на друга, ведь отличаются и взглядами на жизнь и характером. Однако главные персонажи объединены одной общей целью - они должны работать вместе, чтобы помогать людям выживать в самых ужасных условиях. Конечно же, каждый новый эпизод оказывается наполнен драматическими событиями, а главные персонажи оказываются вынуждены бороться с самыми непредсказуемыми поворотами, которые только могут возникнуть во время войны. Конечно же, всем необходима помощь медиков, поэтому востребованность в работе главных персонажей останется всегда. Действующие лица не имеют никакого права каким-либо образом пренебрегать своими обязанностями. Работа и усердные командные действия помогут выживать даже в условиях развернувшейся войны. Конечно же, порой пугающее положение вносит свои коррективы в происходящее, однако главные действующие лица уверены, что их вмешательство так или иначе привнесёт пользу в сложившуюся ситуацию.',1,133,'http://seasonvar.ru/serial-24139-68_Viski.html','http://cdn.bigsv.ru/oblojka/24139.jpg'),(201,'Сериал 7 гномов/The 7D  1 сезон онлайн','В мультипликационном сериале  телезрителям  предстоит встретиться с  любимыми героями, которые  известны  всему миру. Множество приключений ожидает  товарищей  в волшебной стране, спокойную жизнь которой желают  разрушить  злые силы. Гномы «не опускают руки» ни в какой ситуации, потому что  ключевым методом борьбы со  всеми  бедами является настоящая дружба!',1,134,'http://seasonvar.ru/serial-11138-7_gnomov.html','http://cdn.bigsv.ru/oblojka/11138.jpg'),(202,'Сериал 7 гномов/The 7D  2 сезон онлайн','Белоснежка была дружна с гномами, ведь те ей помогали постоянно! Один случай вообще вошел в историю, а после о нем и сказку написали. Многие скажут, что гномов не существует, как и Белоснежки. Однако вот  же они, в мультсериале \"Семь гномов\". Здесь главные действующие лица мультсериала в очередной раз оказываются в эпицентре забавных волшебных событий, которые частенько сталкивают героев с известными сказочными персонажами. В королевстве магии никогда не было спокойно, однако настоящих авантюристов это никогда не останавливало. Семерка любимых по детским сказкам персонажей не падают духом перед сложностями, ведь их связывает крепкая дружба!',2,134,'http://seasonvar.ru/serial-18955-7_gnomov-2-season.html','http://cdn.bigsv.ru/oblojka/18955.jpg'),(203,'Сериал 7 первых поцелуев/Cheotkiseuman ilgobbeonjjae онлайн','Очень забавная драматическая комедия, которая рассказывает о девушке по имени Мин Су Джин. Простая стеснительная девушка никогда не была популярна среди молодых людей. Кажется, что ее замкнутость только портит все. Ей не удается отыскать свою вторую половинку.  Однако вскоре героине удается встретиться с богиней Чхве Чжи У, которая рассказывает о том, что может подарить ей уникальную возможность выбрать себе парня из семи самых привлекательных и интеллигентных юношей. Главную героиню ждут семь свиданий и семь первых поцелуев, которые определят ее дальнейшую судьбу и личную жизнь.',1,135,'http://seasonvar.ru/serial-14783-7_pervyh_potceluev.html','http://cdn.bigsv.ru/oblojka/14783.jpg'),(204,'Сериал 7 самураев/Samurai 7 онлайн','Зрителя переносят в будущее на планету, которая похожа на Землю. Бандиты постоянно обирают сельских жителей, которые уже почти умирают с голода. Они решили позвать себе на помощь самураев, которые бы избавили их от постоянных нападений разбойников и от нищеты. Для этого снарядили небольшой отряд.',1,136,'http://seasonvar.ru/serial-3251--7_samuraev.html','http://cdn.bigsv.ru/oblojka/3251.jpg'),(205,'Сериал 7 семян/7Seeds  1 сезон онлайн','Первый сезон увлекательнейшего сериала \"7 семян\" рассказывает о печальной судьбе человечества. В центре внимания истории оказываются пять групп по семь пар молодых людей и девушек. Главные действующие лица оказались на пустынном острове, где вынуждены теперь бороться за жизнь. Но как так получилось, что им приходится сражаться за своё существование? Дело в том, что эти люди - участники особо важной миссии \"7 семян\", которая призвана сохранить человеческий род и спасти наш вид от вымирания. Однако как случилось, что люди должны принимать столь крайние меры? Глобальная катастрофа, вызванная опасным метеоритом, столкнувшимся с планетой, вынудила учёных всего мира заняться разработкой новой программы по обеспечению выживания человечества. Что же будет дальше? Смогут ли главные персонажи справиться со своей непростой задачей? Им предстоит выживать в суровых и неблагоприятных условиях. Каждый раз придётся сталкиваться с весьма сложными и довольно неприятными ситуациями, связанными с различными характерами персонажей, многочисленными проблемами в самоопределении и трудностями борьбы с депрессией, вызванной полностью разрушенным миром.',1,137,'http://seasonvar.ru/serial-22352-7_semyan.html','http://cdn.bigsv.ru/oblojka/22352.jpg'),(206,'Сериал 7 семян/7Seeds  2 сезон онлайн','Сюжет сериала переносит зрителей в ближайшее будущее. Огромный метеорит становится причиной глобальной катастрофы. Столкнувшийся с Землей космический объект стер с лица планеты практически все живое. Среди людей выжили лишь самые удачливые и наиболее продвинутые. Правительство же давно предсказывало такой ход событий: они отобрали по пять групп юношей и девушек, которые должны были выжить в этих ужасных условиях, чтобы продолжить человеческий вид. Их отправили на пустынный остров, где персонажей не достанут катаклизмы, происходящие на планете. Этот план сработал, ведь главным героям теперь приходится натуральным образом выживать, будучи последними представителями человеческого вида.',2,137,'http://seasonvar.ru/serial-25331-7_semyan-2-season.html','http://cdn.bigsv.ru/oblojka/25331.jpg'),(207,'Сериал 7.39/The 7.39 онлайн','Действие мелодрамы начинается в электричке, когда менеджер оздоровительного центра Карл и менеджер по продажам Салли начинают вести перебранку по поводу свободного места. Карл женат и является примерным семьянином, да и Салли тоже встречается с бой-френдом. Каждый день они ездят на этой электричке на свою работу. Казалось бы, все в их жизни уже давно предрешено и сложилось определенным образом, но их перебранка перерастает в дружеские отношения, а затем и в нечто большее. Возникшая страсть захватывает разум – они начинают тайно встречаться и жизнь круто изменяет свое русло. Что же ожидает их дальше? Смогут ли они быть вместе?',1,138,'http://seasonvar.ru/serial-9100-739.html','http://cdn.bigsv.ru/oblojka/9100.jpg'),(208,'Сериал 72 метра онлайн','Александр Покровский, создал рассказ о гибели подводной лодки под названием «72 метра». Рассказ был написан за долгое время до схожей трагедии, которая постигла подводную лодку «Курск». Но это вовсе не означает, что Покровский стал прорицателем, и даже к простому совпадению этот случай не отнесешь, это закономерность. Ведь независимо от новизны и оснащенности самолета, он все равно может упасть. Самые суперсовременные самолеты падали и будут время от времени падать. Или будь- то новейший корабль, атомная подводная лодка - они, к сожалению, тоже не застрахованы. \n\r\nНо, скорее, две эти трагические истории, одна вымышленная, а другая, увы, реальная, повествуют вовсе не о самом судне, а о человеческих душах. О том, как в момент отчаяния человек может кардинально измениться, сильный, вдруг, может оробеть, а мягкий человек в одночасье превратится в скалу. Но, независимо от этого, они все герои. Главный смысл рассказа заключается в том, что надежда вечно жива...',1,139,'http://seasonvar.ru/serial-5445-72_metra.html','http://cdn.bigsv.ru/oblojka/5445.jpg'),(209,'Сериал 8 на 45/8x45 - Austria Mystery онлайн','Каждый эпизод сериала никак не связан с предыдущим, и единственное, что объединяет все серии – это мистическая составляющая. В основе сюжета лежат события, которые трудно объяснить, в числе которых паранормальные явления. Все перипетии сюжета сериала будут держать в напряжении зрителей, вне зависимости от их мировоззрения. Что интересно, сюжет для каждой отдельной серии выбирался создателями кинокартины очень тщательно – были даже проведены конкурсы среди молодых австрийских сценаристов. Было представлено более 150 различных проектов, и только восемь были удовлетворены создателями сериала.',1,140,'http://seasonvar.ru/serial-8662-8_na_45.html','http://cdn.bigsv.ru/oblojka/8662.jpg'),(210,'Сериал 8 простых правил для друга моей дочери-подростка/8 Simple Rules... for Dating My Teenage Daughter  1 сезон онлайн','Главный герой - счастливый отец двух дочерей. Но в последнее время его счастье омрачается поведением своих дочурок. Кула пропали покорные девочки с очаровательными бантиками, для которых папочка был единственным авторитетом? Бриджит и Керри теперь волнуют только наряды, дискотеки, косметика и мальчики, а мнение папы их абсолютно не интересует! Да еще и их навязчивые малолетние кавалеры осаждают квартиру и названивают по телефону... Даже у самого терпеливого папаши в такой ситуации терпение может лопнуть в любой момент. Пол очень часто использует радикальные методы, чтобы держать своих дочерей под контролем и порой попадает в очень смешные ситуации...',1,141,'http://seasonvar.ru/serial-574--8_prostih_pravil_dlya_druga_moej_docheripodrostka-1-season.html','http://cdn.bigsv.ru/oblojka/574.jpg'),(211,'Сериал 8 простых правил для друга моей дочери-подростка/8 Simple Rules... for Dating My Teenage Daughter  2 сезон онлайн','В этом сериале, речь пойдёт о семействе Хеннесси. У главного героя сериала Пола Хеннесси имеется две дочери – Бриджит и Керри (подросткового возраста). Но, последнее время глава семейства просто не узнаёт своих послушных дочерей. Куда подевались эти милые девочки в красивых бантиках, для которых отец, был всегда авторитетом? Послушные и милые девочки, думают теперь только о разных вечеринках, мальчиках, нарядах, косметике и танцульках, а мнение их папы вообще не интерисует их. В придачу, ещё их несовершенные и назойливые ухажёры, постоянно названивают по телефону и осаждают дом. В такой сложившейся ситуации, даже, у самого терпеливого отца, может лопнуть терпение. Чтобы держать под контролем своих дочерей, Полу часто приходится идти на самые жёсткие и неожиданные меры, из-за чего, он часто попадает в самые курьёзные ситуации.',2,141,'http://seasonvar.ru/serial-1916--8_prostih_pravil_dlya_druga_moej_docheripodrostka-2-season.html','http://cdn.bigsv.ru/oblojka/1916.jpg'),(212,'Сериал 8 простых правил для друга моей дочери-подростка/8 Simple Rules... for Dating My Teenage Daughter  3 сезон онлайн','Главный персонаж сериала по имени Пол Хеннесси воспитывает двух дочерей тинейджеров, Керри и Бриджит. Но со временем Пол перестает понимать своих дочерей: девочки повзрослели, и отец не успевает следить за переменой их интересов. Отец перестал быть авторитетом для своих дочерей, и с его мнением теперь совершенно не считаются. К тому же прилипчивые парни девочек постоянно обрывают телефон в доме своими звонками не по делу. Не каждый отец способен выдержать такое. И поэтому горе-отцу приходиться принимать строгие меры, для того, чтоб его девочки совсем не вышли из-под контроля.',3,141,'http://seasonvar.ru/serial-2610--8_prostih_pravil_dlya_druga_moej_docheripodrostka-3-season.html','http://cdn.bigsv.ru/oblojka/2610.jpg'),(213,'Сериал 8 секунд/8 saniye онлайн','Сон - удивительное явление. Во сне человек набирается сил и будто бы перезагружает свой организм для начала нового дня. Сюжет этого сериала будет завязан на тематике сновидений. В центре внимания сюжета оказывается турчанка Эсра, которая уже много лет со своей семьей проживает в Берлине. Правда, героиня затеряна между двумя совершенно непохожими друг на друга мирами. В каждом мире у нее - особая жизнь. Главная героиня, когда не спит, является представительницей простой семьи, пятой дочерью счастливых родителей, простой и милой девушкой, которая надеется на счастливое и большое будущее. Правда, когда девушка ложится спать, то попадает в совершенно иной мир, где живет иную жизнь. Там она - слуга, которая исполняет приказы тайного человека. Девушка никому не может поведать эту тайну, потому что боится, что ее примут за ненормальную. В девятнадцать лет героиня выходит замуж за молодого мужчину Тайфуна. Родители были против такого союза. Брак просуществовал всего год, а сновидения, в которых героиня живет другую жизнь, ее не оставляют. Чтобы избегать попадания в иной мир, девушка решает устроиться на работу в ночь официанткой. Так она надеется, что избежит своей проблемы. Однако ничего не выходит. О тайне девушки узнает молодой человек Мо, который пытается помочь Эсре, но все тщетно. Девушка оказывается в психиатрической клинике, где начинает путать реальность и сон.',1,142,'http://seasonvar.ru/serial-20638-8_sekund-0-season.html','http://cdn.bigsv.ru/oblojka/20638.jpg'),(214,'Сериал 8 способов любить онлайн','Мало кто  знает, как именно должна выглядеть любовь. Человек многогранен. Он способен пережить множество эмоций и по-разному относиться к определенным людям или группе людей. Отношения между друзьями может быть одним, а между родственниками - совершенно другими. Любовь становится отдельной темой в подобных обсуждениях. Главные действующие лица этой истории - персонажи, которые проявляют это прекрасное чувство. Именно через них будет выражена основная идея, связанная с философским подходом к рассмотрению тематики любви и отношений. Всеобъемлющее и прекрасное чувство - это то, что называется любовью.',1,143,'http://seasonvar.ru/serial-29827-8_sposobov_lyubit_.html','http://cdn.bigsv.ru/oblojka/29827.jpg'),(215,'Сериал 80 островов вокруг света./Il Giro Del Mondo In 80 Isole онлайн','Удивительный тревел-проект, который подарит зрителям необычайные эмоции. Это путешествие вы запомните на всю жизнь, ведь мы пройдем по землям восьмидесяти островов, расположенных в различных частях Земного шара. Вместе с ведущими мы повидаем как потрясающие по красоте тропические острова, где провести свой отпуск- мечта каждого, а также побываем на практически безжизненных и таких загадочных северных островках. Кто бы мог подумать, что эти кусочки земли могут быть настолько разными, непохожими друг на друга и уникальными по своей флоре и фауне. Остается только посетить их и узнать наверняка!',1,144,'http://seasonvar.ru/serial-19245-80_ostrovov_vokrug_sveta.html','http://cdn.bigsv.ru/oblojka/19245.jpg'),(216,'Сериал 80 чудес света/Around the World in 80 Treasures онлайн','Добро пожаловать в захватывающее и увлекательное приключение, путешествие, которое запомнится надолго. За проект нам предстоит посмотреть на самые выдающиеся человеческие творения в истории. Это настоящее сокровище нынешнего мира, которое многие люди предпочитают хранить и оберегать. Нам же предстоит познакомиться с этими выдающимися достопримечательностями. Есть менее известные места, которые редко описываются в книгах и учебниках, но они всё же несут в себе социальную, культурную и историческую значимость. О них так же пойдет рассказ в этом сериале. Приятного просмотра всем  поклонникам жанра.',1,145,'http://seasonvar.ru/serial-30764-80_chudes_sveta.html','http://cdn.bigsv.ru/oblojka/30764.jpg'),(217,'Сериал 80-е: Десятилетие, которое сотворило нас/The \'80s: The Decade That Made Us онлайн','Что мы знаем про не такие уж  далекие восьмидесятые года? Очень мало, особенно те кто только родился в те годы. А телевизионное шоу «80-е: Десятилетие, которое сотворило нас» позволит нам окунуться во времена нашего детства. Здесь нас ждет много моментов, которые не возможно позабыть. Этот проект можно назвать – путешествие во времени. Мы вспомним все культурные события, происходившие в те годы, познакомимся со становлением современного мира. Ведь благодаря восьмидесятым, мы видим современный мир, таким, какой он есть. Здесь мы услышим много прекрасной музыки, услышим интервью со знаменитостями, увидим много фотографий тех лет. Именно с этой передачей мы сможем вернуться в далекое детство.',1,146,'http://seasonvar.ru/serial-13043-80-e_Desyatiletie_kotoroe_sotvorilo_nas.html','http://cdn.bigsv.ru/oblojka/13043.jpg'),(218,'Сериал 800 слов/800 Words  1 сезон онлайн','Популярный обозреватель бросает свою работу. Казалось, что его труд в газете Сиднея популярен и перспективен, но после потери любимого человека главный герой не может дальше мириться с тем, что происходит в жизни. Через интернет он решает купить дом в Новой Зеландии и уехать из Австралии навсегда. Теперь главный герой пытается устроить переезд, а ведь еще нужно проследить за двумя детьми-подростками, каждый из которых пока еще не знает, кем станет в будущем. Однако начать жизнь на новом месте так и не удается. Местные жители, которые отличаются особой любознательностью, так и норовят помешать.',1,147,'http://seasonvar.ru/serial-13635-800_slov.html','http://cdn.bigsv.ru/oblojka/13635.jpg'),(219,'Сериал 800 слов/800 Words  2 сезон онлайн','Главный герой совсем пал духом. Он бросает свою любимую работу и уходит в отставку. Казалось бы, зачем он это делает? Мужчина просто не может пережить потерю любимой супруги, без которой жизнь для него выглядит совсем бессмысленной и грустной. Журналист решает уехать навсегда из родной Австралии, чтобы поселиться  в Новой Зеландии. Теперь ему нужно лишь все спланировать! Переезд весьма непростой, ведь предстоит еще и следить за двумя детьми.  Однако начать жизнь на новом месте так и не удается. Местные жители, которые отличаются особой любознательностью, так и норовят помешать. Второй сезон продолжает эту интереснейшую историю.',2,147,'http://seasonvar.ru/serial-15198-800_slov-2-season.html','http://cdn.bigsv.ru/oblojka/15198.jpg'),(220,'Сериал 800 слов/800 Words  3 сезон онлайн','Главный герой сериала не так давно потерял любимую супругу. Казалось бы, жизнь уже никогда не будет прежней, однако мужчина собирает все силы в кулак, находит в себе твердость духа и решает переехать на новое место жительства, где ничто не будет напоминать о прошлом. Правда, предстоит за собой перетащить в Новую Зеландию из Сиднея и детей, которые боятся неопределенности и не понимают, что их ждет впереди. Главный герой пытается найти себе новую работу. Никто еще не знает, что он талантливый журналист, однако у мужчины еще будет возможность себя проявить. Детям же придется привыкать к новой школе, новой обстановке и отцовской заботе.',3,147,'http://seasonvar.ru/serial-19549-800_slov-3-season.html','http://cdn.bigsv.ru/oblojka/19549.jpg'),(221,'Сериал 872 дня Ленинграда онлайн','Сериал, посвященный самым ужасным и сложным дням в истории жизни одного выдающегося города-героя. Порядка восьмисот семидесяти двух дней Ленинград держал оборону во времена Великой Отечественной Войны. В центре внимания сюжета оказываются главные события тех лет. Мы пройдемся по основным этапам ведения оборонительных действий. История рассказывает нам о по-настоящему смелых и сильных людях, которые боролись с общим врагом, понимая, что все очень плохо, ведь в городе был голод, а смерть шла рука об руку с жизнью. Главные действующие лица этого сериала - обыкновенные люди, которые так или иначе повлияли на ход исторического сражения. Удивительно то, что борьба велась не только за жизни, но и за творчество, культурное наследие и искусство. Люди, лишенные еды и воды,  сражались со стихией, когда загорелся Эрмитаж. Ленинградцы стали примером мужества и самоотверженности. Не сосчитать, как много людей отдало свои жизни за спасение города, за его свободу   и будущую победу Советского Союза. Восемнадцатого января сорок третьего года была прорвана блокада, а город был полностью освобожден от захватчиков уже к концу месяца двадцать седьмого числа. Именно эта дата теперь считается днем воинской славы...',1,148,'http://seasonvar.ru/serial-17743-872_dnya_Leningrada.html','http://cdn.bigsv.ru/oblojka/17743.jpg'),(222,'Сериал 9 месяцев онлайн','Основным местом действия данного фильма является шестиместная палата, где некоторые лежат по девять месяцев, тогда как другие, заскакивают всего на несколько деньков. Анна готовится в ближайшее время сделаться матерью-одиночкой. В это же время Тасе приняла решение на себе испытать эффект искусственного оплодотворения. У Марины любовные отношения вышли далеко за пределы семейных…\n\r\nДанная картина под названием «9 месяцев» является попыткой осознать, кто и с какой целью собирается рожать дитя в настоящее время. В фильме рассматриваются неприятные, тяжелые и значимые вопросы: чему отдать предпочтение - материнству или карьере? Как суррогатная мама может себе оставить ребенка? Между тем, рассматривая всю серьезность затрагиваемых вопросов, жанр картины является комедийно-лирическим…',1,149,'http://seasonvar.ru/serial-6157-9_mesyatcev.html','http://cdn.bigsv.ru/oblojka/6157.jpg'),(223,'Сериал 9 месяцев с Кортни Кокс/9 Months with Courteney Cox онлайн','Приглашаем зрителей на просмотр увлекательнейшего проекта, который расскажет зрителям о пятнадцати разных парах, которые переживают непростые времена беременности. Конечно же, зрителям предстоит проследить за каждым из действующих лиц. Пара получает в своё распоряжение камеру, на которую постараются запечатлеть самые яркие эмоции и чувства, которые только предстоит пережить в течение долгих 40 недель! Зрителей ожидают интимные подробности из жизни каждой пары, которая по-своему переживает трудные моменты жизни. Что же будет дальше и кто сможет прийти к гармонии и взаимопониманию?',1,150,'http://seasonvar.ru/serial-21546-9_mesyatcev_s_Kortni_Koks-0-sezon.html','http://cdn.bigsv.ru/oblojka/21546.jpg');
